INSERT INTO `default_contact_us` (`id`, `created`, `updated`, `created_by`, `ordering_count`, `url`, `name`, `email_address`, `message`, `arrival_date`, `departure_date`) VALUES
(1, '2016-07-10 21:23:05', NULL, NULL, 1, 'http://www.accesswinterpark.com/pet-friendly-properties', 'Cory Heinecke', 'cory.heinecke@patenergy.com', 'Looking a seasonal rental this winter in WP/Fraser area. Hoping  to secure a 3+ Beds and 2+ baths, 1+ garage and hot tub.  Pet friendly preferred but not required.  Planning on being in WP the weekend of the 23rd and hoping to set up some showings while we are in town.  Look forward to hearing from you.  Thanks, Cory', NULL, NULL),
(38, '2016-07-14 12:24:45', NULL, NULL, 2, 'http://www.accesswinterpark.com/property/aspen-hideaway-at-bavarian-village', 'Tracy A. Fletcher', 'fletcherfamily96@msn.com', 'Looking for a seasonal rental for the Winter. Do you have availability?', '11/01/2016', '04/30/2017'),
(39, '2016-07-14 13:38:21', NULL, NULL, 3, 'http://www.accesswinterpark.com/property/slopeside-200', 'Ryan Kazee', 'Kazeery@gmail.com', 'Info for homeowner. It was pleasure speaking with you.', NULL, NULL),
(56, '2016-07-16 23:36:20', NULL, NULL, 4, 'http://www.accesswinterpark.com/', 'Mary Douglass Ryan', 'mdouglassryan@gmail.com', 'Hi, Judi. I enquired via VRBO about Trademark 3-4 (their #109200) and am very interested but our dates have changed slightly. We will leave one day earlier, December 19th instead of  the 20th. Would you please send me a revised quote?\nbest regards, Mary', '12/15/2016', '12/19/2016'),
(71, '2016-07-17 20:59:20', NULL, NULL, 5, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Sarah Boman', 'sarah.boman@gmail.com', 'Hi- Do you have a pet-friendly rental for the ski season? We''re interested in a 2-3 bedroom place for 3 couples. Thanks,\nSarah', '11/01/2016', '03/01/2017'),
(73, '2016-07-24 11:51:13', NULL, NULL, 6, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Molly Fritz', 'mmfritz@hotmail.com', 'I am looking for a seasonal/long term rental in the Winter Park area, can you help?', NULL, NULL),
(74, '2016-07-25 18:22:42', NULL, NULL, 7, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Kurt Eisenhard', 'kurt.eisenhard@gmail.com', 'I am looking to lease a property for the months of January and February.  Family of 4, need 2 bedrooms (or 3) - do you have any properties available?', '01/01/2017', '02/28/2017'),
(75, '2016-07-27 17:21:43', NULL, NULL, 8, 'http://www.accesswinterpark.com/property/antlers-401-at-lakota', 'Kristen Reiss', 'kristenreiss@gmail.com', 'I am looking for a 4 bedroom seasonal rental in Winter Park for the 2016-2017 Ski Season, can you tell me more about rates for Antlers #401 for a longer time period?', NULL, NULL),
(76, '2016-07-28 01:34:19', NULL, NULL, 9, 'http://www.accesswinterpark.com/property/antlers-401-at-lakota', 'Mai Buell', 'mai_tran2000@yahoo.com', 'We are looking for a rental to accommodate 10 people (4 adults and 6 children) from Sat. 12/17-Thurs. 12/22.  How can I search rates for all avail. rates during that time period?', '12/16/2016', '12/22/2016'),
(77, '2016-07-28 15:54:52', NULL, NULL, 10, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Bill Buese', 'wjbuese@yahoo.com', 'I am looking for a 3-4 bedroom place, which sleeps at least 8, for the upcoming ski season in Winter Park.  Let me know if you have any available options for me to consider.\nThanks.\nBill\n720-480-5222', '12/01/2016', '04/30/2017'),
(78, '2016-07-28 18:53:33', NULL, NULL, 11, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Tonia Shaw', 'teachskicolorado@gmail.com', 'We''ve been in our 4/4 rental in Fraser for 3 years but the owner wants to sell. We need a year round rental. Currently, we are residing in about 3200 sq ft & have a 2.5 car garage. Something comparable would be tremendous. Please let me know if you have anything like that.', '10/02/2016', '10/01/2019'),
(79, '2016-08-04 14:09:59', NULL, NULL, 12, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Andrea Osborne', 'aosborne809@gmail.com', 'Looking for a 2-3 bedroom season rental that is pet friendly. Please advise. We have a really sweet dog who is crated when we''re not there and has a local dog walker who takes care of him when needed.', NULL, NULL),
(80, '2016-08-04 17:32:15', NULL, NULL, 13, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Lisa Wanger', 'lisahaley@hotmail.com', 'We are looking for a 3 bedroom season rental close to the base', '12/28/2016', '03/06/2017'),
(81, '2016-08-04 17:33:47', NULL, NULL, 14, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Lisa Wanger', 'lisahaley@hotmail.com', 'WE are looking for a long term rental dec 30-March 8. ish.', NULL, NULL),
(82, '2016-08-04 18:44:00', NULL, NULL, 15, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Toby', 'tobynuber@gmail.com', 'I am looking for a seasonal rental from Jan - April 2017.\nDo you have anything available or can you point me in the right direction?\nThanks,\nToby', NULL, NULL),
(83, '2016-08-07 22:50:44', NULL, NULL, 16, 'http://www.accesswinterpark.com/property/bavarian-village-11', 'Melissa Masek', 'melissa.masek@gmail.com', 'We have a group of 3-4 couples interested in a seasonal rental for the 2016/2017 ski season.  Do you have any suggestions?', NULL, NULL),
(84, '2016-08-08 12:10:37', NULL, NULL, 17, 'http://www.accesswinterpark.com/property/bavarian-village-11', 'Will Knause', 'knausewg@gmail.com', 'I am looking for a season long rental in the Winter Park/ Tabernash area. What is your availability and are any of your properties pet friendly?', '11/01/2016', '04/30/2017'),
(85, '2016-08-09 13:17:46', NULL, NULL, 18, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Andrew Schmieder', 'schmieds16@gmail.com', 'We are looking for a seasonal rental.  Specifically from from just before ski season to late spring/early summer.  Are there any properties which might offer these accommodations?', '11/01/2016', '04/30/2017'),
(86, '2016-08-21 19:22:45', NULL, NULL, 19, 'http://www.accesswinterpark.com/2-bedroom-properties', 'Karla Willoughby', 'tkwilloughby@comcast.net', 'Two bedroom two bathroom condo or townhouse.... Fireplace..... Looking for cozy and comfortable....', '12/23/2016', '12/27/2016'),
(87, '2016-08-23 04:09:41', NULL, NULL, 20, 'http://www.accesswinterpark.com/', 'Ivana Brets', 'ivana.brets@gmail.com', 'Hi\nWe can help your website to get on first page of Google and increase the number of leads and sales you are getting from your website. Please email us back for full proposal.\n\nBest Regards\nIvana', '08/23/2016', '08/23/2016'),
(88, '2016-08-25 12:43:04', NULL, NULL, 21, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Jason Dunn', 'jdunn@bhfs.com', 'Hi.  We are a family of four looking for a seasonal ski rental.  Prefer Jan 1 - March 31, but would consider Dec also.  Let me know what you have!  Thanks.', NULL, NULL),
(89, '2016-09-13 11:02:12', NULL, NULL, 22, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Mark Saks', 'mark.saks@molsoncoors.com', 'I am looking for a seasonal rental in winter park that is pet friendly and sleeps at least 5 people.', '11/01/2016', '04/02/2017'),
(90, '2016-09-24 00:20:54', NULL, NULL, 23, 'http://www.accesswinterpark.com/', 'Roger', 'roger@getbusinessontop.com', 'We can put your website on 1st page of Google to drive relevant traffic to your site. Let us know if you would be interested in getting detailed proposal. We can also schedule a call & will be pleased to explain our services in detail. We look forward to hearing from you soon. Thanks!', NULL, NULL),
(91, '2016-09-24 20:19:57', NULL, NULL, 24, 'http://www.accesswinterpark.com/property/zephyr-2223', 'Katherine', 'katty.tarazona@gmail.com', 'I would like to know if you have any rentals for the month of December, January, February and March. We are three girls that would like to rent here as we will be working on those months in Winter Park, I would to know the cost of the rental, any requirements and how is the payment made.\n\nThanks\nKatherine Tarazona', '12/12/2016', '03/31/2017'),
(92, '2016-09-25 14:38:53', NULL, NULL, 25, 'http://www.accesswinterpark.com/property/telemark-572', 'susan bishop', 'suerbishop@gmail.com', 'looking for a longterm seasonal rental', NULL, NULL),
(93, '2016-09-25 14:40:21', NULL, NULL, 26, 'http://www.accesswinterpark.com/property/wapiti-840', 'sue bishop', 'suerbishop@gmail.com', 'looking for a seasonal rental', '01/02/2017', '04/10/2017'),
(94, '2016-09-28 16:59:06', NULL, NULL, 27, 'http://www.accesswinterpark.com/property/zephyr-2223', 'Manuela', 'maanusalto@gmail.com', 'Hello, we are four friends that are going to work in the Winter Park Resort. We are looking for housing: 2 bedrooms, 1/2 bathroom and fully furnished, WiFi and short distance to the free ski shuttle. We&#39;re waiting a response', '12/01/2016', '04/02/2017'),
(95, '2016-10-01 18:22:27', NULL, NULL, 28, 'http://www.accesswinterpark.com/property/zephyr-2223', 'Erikaa Anderson', 'erikalaurelanderson@gmail.com', 'Our family is looking for a winter park seasonal rental  for the ski season. Our min requirement is to sleep 5. Our preferred monthly rate is under 1500. If you have any options, your feedback would be appreciated. Thank you, Erika', NULL, NULL),
(96, '2016-10-16 19:47:04', NULL, NULL, 29, 'http://www.accesswinterpark.com/property/bavarian-village-11', 'Kristin Olson', 'kristin@olsonplanet.com', 'Hello,\nWe are looking for a 2-3 month rental in the Winter Park area, either Feb-Mar or Jan-Mar. Our preference would be 2-3 bedrooms and 2 baths. We would like to pay around $2000/month. Please let us know if you can think of anything that would fit what we are looking for.\n\nThank you!\n\n(303) 619-3680', '02/01/2017', NULL),
(97, '2016-10-20 21:11:58', NULL, NULL, 30, 'http://www.accesswinterpark.com/season-long-term-rental-properties', 'Jennifer Orvis', 'jen.orvis@gmail.com', 'I am interested in LT summer rentals.  Do you have anything available, and what are the prices. \n\nThank you,\njen', '06/01/2017', '08/31/2017'),
(98, '2016-10-23 20:26:45', NULL, NULL, 31, 'https://www.accesswinterpark.com/special-offers', 'Michel Brossmer', 'Michelbrossmer@gmail.com', 'Your phone doesn''t work. Rings 1/2 time and then goes dead.\nI''m looking for a short term rental the week after xmas. It''s my husband, teenage son & me.  A 1 bed is fine if there is another sleeping area other than the living room for my son. Something like a loft.  We prefer to be in Winter Park not Fraser. Do you have anything available?', '12/26/2016', '12/29/2016');
