(7, '2016-05-20 16:36:06', '2016-05-23 00:56:12', 1, 1, '<h2 style="text-align: center;">This is the homepage.</h2>\n', NULL),
(8, '2016-05-20 18:24:19', '2016-05-21 07:40:35', 1, 1, '<h2>Save When You Stay</h2>\n\n<p>We believe in supporting our local business community and our local business community believes in supporting our guests. Here is a list of some of the discounts and special deals Access Winter Park can offer you thanks to just some of those amazing business owners.</p>\n', '9ea6aa9f793d2f6'),
(12, '2016-05-23 03:47:58', '2016-05-23 03:51:05', 1, 1, '<p>Thank you for contacting us! We will reply to your message as soon as possible.</p>\n\n<p>A copy of your message is below:</p>\n', 'b82fcceec2bca13'),
(13, '2016-05-23 05:19:29', '2016-05-23 05:29:36', 1, 1, NULL, '9ea6aa9f793d2f6'),
(14, '2016-05-24 02:15:40', '2016-05-24 07:09:48', 1, 2, '<p>Thank you for contacting us. We appreciate your interest and will get back to you as soon as possible.</p>\n', 'b82fcceec2bca13'),
(16, '2016-06-29 16:44:22', NULL, 1, 3, 'Privacy Policy goes here.', 'b82fcceec2bca13'),
(18, '2016-07-29 18:23:31', '2016-09-19 17:24:02', 2, 4, '<script type="text/javascript" src="//accesswinterparklodg.checkfront.com/lib/interface--30.js"></script>\n<!-- CHECKFRONT BOOKING PLUGIN v23-->\n<div id="CHECKFRONT_WIDGET_01"><p id="CHECKFRONT_LOADER" style="background: url(''//accesswinterparklodg.checkfront.com/images/loader.gif'') left center no-repeat; padding: 5px 5px 5px 20px">Searching Availability...</p></div>\n<script>\nnew CHECKFRONT.Widget ({\nhost: ''accesswinterparklodg.checkfront.com'',\ntarget: ''CHECKFRONT_WIDGET_01'',\ncategory_id: ''1,7,11,15,3,19,20,12,8,21,4,16,5,6'',\nprovider: ''droplet''\n}).render();\n</script>\n<noscript><a href="https://accesswinterparklodg.checkfront.com/reserve/" style="font-size: 16px">Continue to Secure Booking System &raquo;</a></noscript>', '1052f2d8924785b');
