INSERT INTO `default_email_templates` (`id`, `slug`, `name`, `description`, `subject`, `body`, `lang`, `is_default`, `module`) VALUES
(1, 'comments', 'Comment Notification', 'Email that is sent to admin when someone creates a comment', 'You have just received a comment from {{ name }}', '<h3>You have received a comment from {{ name }}</h3>\n				<p>\n				<strong>IP Address: {{ sender_ip }}</strong><br/>\n				<strong>Operating System: {{ sender_os }}<br/>\n				<strong>User Agent: {{ sender_agent }}</strong>\n				</p>\n				<p>{{ comment }}</p>\n				<p>View Comment: {{ redirect_url }}</p>', 'en', 1, 'comments'),
(2, 'contact', 'Contact Notification', 'Template for the contact form', '{{ settings:site_name }} :: {{ subject }}', 'This message was sent via the contact form on with the following details:\n				<hr />\n				IP Address: {{ sender_ip }}\n				OS {{ sender_os }}\n				Agent {{ sender_agent }}\n				<hr />\n				{{ message }}\n\n				{{ name }},\n				\n				{{ email }}', 'en', 1, 'pages'),
(3, 'registered', 'New User Registered', 'Email sent to the site contact e-mail when a new user registers', '{{ settings:site_name }} :: You have just received a registration from {{ name }}', '<h3>You have received a registration from {{ name }}</h3>\n				<p><strong>IP Address: {{ sender_ip }}</strong><br/>\n				<strong>Operating System: {{ sender_os }}</strong><br/>\n				<strong>User Agent: {{ sender_agent }}</strong>\n				</p>', 'en', 1, 'users'),
(4, 'activation', 'Activation Email', 'The email which contains the activation code that is sent to a new user', '{{ settings:site_name }} - Account Activation', '<p>Hello {{ user:first_name }},</p>\n				<p>Thank you for registering at {{ settings:site_name }}. Before we can activate your account, please complete the registration process by clicking on the following link:</p>\n				<p><a href="{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}">{{ url:site }}users/activate/{{ user:id }}/{{ activation_code }}</a></p>\n				<p>&nbsp;</p>\n				<p>In case your email program does not recognize the above link as, please direct your browser to the following URL and enter the activation code:</p>\n				<p><a href="{{ url:site }}users/activate">{{ url:site }}users/activate</a></p>\n				<p><strong>Activation Code:</strong> {{ activation_code }}</p>', 'en', 1, 'users'),
(5, 'forgotten_password', 'Forgotten Password Email', 'The email that is sent containing a password reset code', '{{ settings:site_name }} - Forgotten Password', '<p>Hello {{ user:first_name }},</p>\n				<p>It seems you have requested a password reset. Please click this link to complete the reset: <a href="{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}">{{ url:site }}users/reset_pass/{{ user:forgotten_password_code }}</a></p>\n				<p>If you did not request a password reset please disregard this message. No further action is necessary.</p>', 'en', 1, 'users'),
(6, 'new_password', 'New Password Email', 'After a password is reset this email is sent containing the new password', '{{ settings:site_name }} - New Password', '<p>Hello {{ user:first_name }},</p>\n				<p>Your new password is: {{ new_password }}</p>\n				<p>After logging in you may change your password by visiting <a href="{{ url:site }}edit-profile">{{ url:site }}edit-profile</a></p>', 'en', 1, 'users'),
(7, 'contact-us', 'Contact Us', 'Email that is sent when someone successfully fills out the "Send a Message" form in the footer.', 'You have been contacted via the "Send a Message" form.', '{{ entry }}\n<p><strong>{{ name }}</strong> has contacted you via the &quot;Send a Message&quot; form in the footer.</p>\n\n<p>The following information was submitted:</p>\n\n<p><strong>Name:</strong> {{ name }}<br />\n<strong>Email Address:</strong> {{ email_address:mailto_link }}<br />\n<strong>Arrival Date:</strong> {{ arrival_date }}<br />\n<strong>Departure Date:</strong> {{ departure_date }}<br />\n<strong>Message</strong> (<em>How Can We Help?</em>)<strong>:</strong><br />\n{{ message }}</p>\n\n<p>The form was filled out on the following page:<br />\n?<a href="{{ url }}">{{ url }}</a></p>\n{{ /entry }}\n\n<p><a href="{{ url:site }}admin/streams/entries/index/13">Click here</a> to view the &quot;Send a Message&quot; entries in your CMS.</p>', 'en', 0, ''),
(8, 'property-inquiry', 'Property Inquiry', 'Email that is sent when someone successfully fills out the Property Inquiry form in the side column of a property detail page.', 'You have been contacted via the "Property Inquiry" form.', '{{ entry }}\n<p><strong>{{ name }}</strong> has contacted you via the &quot;Property Inquiry&quot; form in the footer.</p>\n\n<p>The following information was submitted:</p>\n\n<p><strong>Name:</strong> {{ name }}<br />\n<strong>Email Address:</strong> {{ email_address:mailto_link }}<br />\n<strong>Phone Number:</strong> {{ phone_number }}<br />\n<strong>Property:</strong> {{ property:value }}<br />\n<strong>Arrival Date:</strong> {{ arrival_date }}<br />\n<strong>Departure Date:</strong> {{ departure_date }}</p>\n\n<p>The form was filled out on the following page:<br />\n?<a href="{{ url }}">{{ url }}</a></p>\n{{ /entry }}\n\n<p><a href="{{ url:site }}admin/streams/entries/index/26">Click here</a> to view the &quot;Property Inquiry&quot; entries in your CMS.</p>', 'en', 0, '');
INSERT INTO `default_features` (`id`, `created`, `updated`, `created_by`, `ordering_count`, `feature_image`, `feature_title`, `feature_text`, `feature_link_text`, `feature_button_text`, `feature_link_url`) VALUES
(1, '2016-05-24 06:10:52', '2016-08-16 13:36:49', 1, 1, '01814131055d78c', 'About the Mountain', 'With over 64 miles of trails spread out over five interconnected but highly varied mountain terrains, Winter Park has something for skiers of every ability. Want to get all the details about the Winter Park and Mary Jane ski areas and view detailed trail maps?', 'Learn More About the Mountain', 'Learn More', '/about-the-resort/ski-trail-info-and-maps'),
(2, '2016-05-24 06:11:20', '2016-08-16 13:37:02', 1, 2, 'd872e2e05d32536', 'Winter, Summer and Kids Activities', 'Winter Park and the Fraser Valley offer endless activities and special events throughout the entire year.', 'Explore Winter Park Activities', 'Winter Park Activities', '/activities'),
(3, '2016-05-24 06:11:53', '2016-08-16 13:37:15', 1, 3, 'b89ea45d8cd159d', 'Protect Your Vacation', 'AIG offers Travel Guard insurance coverage for unforeseen problems, from weather conditions causing delays or cancellations to serious illness—or even emergency medical evacuation.', 'Get Travel Insurance', 'Get Travel Insurance', '/travel-insurance'),
(4, '2016-06-07 17:03:52', '2016-08-16 13:37:43', 1, 4, '94a142cd85d6729', 'Why Winter Park, CO?', 'From snowboarding and sleigh rides to mountain biking and whitewater rafting, the Colorado mountain town of Winter Park is truly a four season destination. Tucked away in the scenic Fraser Valley beneath the towering peaks of the Continental Divide, Winter Park is well known for breath taking scenery, abundant wildlife, gracious hospitality, and world class skiing.', 'Learn More About Winter Park', 'Learn More', '/about-the-resort'),
(5, '2016-06-07 17:05:31', '2016-08-16 13:37:59', 1, 5, '2303a92ec90b202', 'Save on ''16-''17 Season Lift Tickets', 'Book your stay in any of our properties and you are eligible to purchase discount lift tickets.', 'View Package Deals', 'View Package Deals', '/special-offers'),
(6, '2016-06-07 17:10:26', '2016-08-16 13:38:26', 1, 6, '4e8cf473fc69e9f', 'Winter Park Trail Map', 'View a detailed map of the mountain that clearly depicts all of the parks, trails and difficulty ratings, lifts and available facilities.', 'Download Map', 'Download Map', '/files/download/5f54f1cc99d3666'),
(7, '2016-06-07 17:26:20', '2016-08-16 13:38:45', 1, 7, 'f99aa653057f8c8', 'Resort Shuttle', '“The Lift” is a free community shuttle service provided to help you get around Winter Park. Check out the schedule and pick up locations here.', 'View Routes and Schedules', 'View Routes & Schedule', '/about-the-resort/resort-shuttle');
