(1, '2016-05-23 19:32:47', '2016-05-29 06:43:34', 1, 1, '42ea76fa337f238', 'Powderhound Transportation Services', 'powderhound-transportation-services', '<p>Providing non-shared private shuttle service between Denver and Winter Park.</p>\n\n<p>Access Winter Park has partnered with PowderHound to offer our guests the very best in non-shared private shuttle service between Denver International Airport and Winter Park. Powderhound shuttles to Winter Park are convenient since you get to pick your own times and there are no unwanted stops.?</p>\n\n<p><a href="http://www.ridethepowder.com/?page=rates&refer=access-winter" target="_blank">Book online</a> and the referral code access-winter to get an additional 10% off the already low online rate.</p>\n\n<p>?All bookings made using our link and our referral discount code will be entered into our free lift ticket and lodging drawings.</p>\n\n<p><strong><a href="http://www.ridethepowder.com/?page=rates&refer=access-winter" target="_blank">Book Now</a></strong></p>\n\n<p>?You will need to make sure &quot;access-winter&quot; is in the referral code area before booking! You should see a green check mark next to it that reads discount applied on confirmation. Without this code (&quot;access-winter&quot;) you will not get the additional 10% discount applied upon check-out.</p>\n\n<p><strong>Private, non-shared Shuttle Service</strong><br />\nWith Powderhound, you pick the time to be picked up at the Denver International Airport. Start your vacation at the airport, as soon as you pick up your luggage. You will be picked up right outside baggage claim. Relax and enjoy the ride and the mountain scenery as their friendly and professional drivers take you, your family and friends directly to the door of your Access Winter Park lodging accommodations.?</p>\n'),
(2, '2016-05-23 19:33:30', NULL, 1, 2, '726c17279c285a2', 'Home James Transportation Services', 'home-james-transportation-services', '<p>Access Winter Park has partnered with Home James to offer our guests the very best shuttle service between Denver and Winter Park. <a href="https://homejamestransportation.hudsonltd.net/res" target="_blank">Book online</a> using the corporate code AWPW to get the best rates and to be entered into our free lift ticket and lodging drawings.</p>\n\n<p>?<strong>Scheduled Shuttle Service</strong><br />\nHome James offers up to 22 scheduled departures daily to and from the Denver International Airport. Start your vacation at the airport as their professional drivers take you and your family directly to the door of your Access Winter Park mountain lodging. Advanced reservations are suggested.</p>\n\n<p><strong>Private Charter Service</strong><br />\nHome James invites you to experience our premier private charter service. Catering to your every need, our private charters can be scheduled at any time day or night. We offer private service anywhere in the state of Colorado. View our Winter Park rates online or call for individual quotes throughout the state.?</p>'),
(3, '2016-05-23 19:36:45', NULL, 1, 3, '6e1aa33ab88c570', 'Breeze at Ski Depot Sports', 'breeze-at-ski-depot-sports', '<p>Breeze at Ski Depot is a partner with SkiRentals.com, North America&#39;s largest online ski and snowboard rental outlet. Breeze at Ski Depot has everything you need for your ski and snowboard rentals. As a guest of Access Winter Park, you receive the best names in rentals at the lowest prices. Breeze at Ski Depot offer the fantastic FREE &quot;STORE TO DOOR&quot; DELIVERY service at no additional cost.</p>\n\n<p>Ski Depot has two locations in Winter Park to serve you. The main store is located in the center of downtown Winter Park in Park Plaza at 78717 Highway 40. We also have a store in the Iron Horse Resort, 101 Iron Horse Way, which is located at the Iron Horse Resort in the base of the Winter Park Ski Area. With a location on the mountain, there is no need to come into town for a quick adjustment if one should be needed.</p>\n\n<p>The friendly and professional staff will be happy to help you at either locations, or they will deliver your rentals right to your lodging at no charge! Store Hours: 8am to 7pm weekday and 8am to 7pm weekends. <strong>Call the Main Store <a href="tel:1-970-726-8055">1-970-726-8055</a> or the Iron Horse location at <a href="tel:970-726-4703">970-726-4703</a>.</strong></p>\n\n<p>To get started, simply click the Book Now box on the <a href="http://www.skirentals.com/accesswinterpark" target="_blank">Breeze at Ski Depot Sports</a> Web Page, or call our Breeze Reservations Team at <a href="tel:888-427-3393">888-427-3393</a> or the Winter Park Main Street Store (<a href="tel:970-726-8055">970-726-8055</a>)&nbsp;and mention you are a guest of Access Winter Park to receive the best prices.</p>'),
(4, '2016-05-23 19:37:23', NULL, 1, 4, 'aba3f7065a58a72', 'Alpine Sun Ski & Sport', 'alpine-sun-ski-and-sport', '<p>Alpine Sun Ski &amp; Sport is a specialty ski shop located in Old Town Winter Park, only 1/3 of a mile from the base of Winter Park Resort. Alpine Sun provides the finest quality ski and board rentals, a full service tune and repair shop, and affordable accessories. Access Winter Park guests staying in Old Town Winter Park at Slopeside Village or Winter Park Place can conveniently walk to Alpine Sun and those staying at Slopeside, Trademark or Winter Park Place can walk or drive a very short distance. Lakota is located across Hwy 40 and Alpine Sun offers FREE parking with rentals and easy access to the FREE lift shuttle to Winter Park Resort.</p>\n\n<p>We have partnered with Alpine Sun and are able to offer all our guests the following great discounts:</p>\n\n<ul>\n <li>20% discount off their online bookings</li>\n <li>15% discount on walk-in equipment rentals (just mention Access Winter Park)</li>\n <li>25% discount on all service &amp; tune work (just mention Access Winter Park)</li>\n <li>Children 9 &amp; under ski rental package is FREE with a full paying adult ski rental</li>\n <li>Juniors 10 - 14 ski rental package is half price with a full paying adult ski rental</li>\n <li>FREE parking with rentals and easy access to FREE lift shuttle?</li>\n</ul>\n\n<p>?For additional information on Alpine Sun Ski &amp; Sport, visit their web site for rates and on-line reservations <a href="http://skialpinesun.com" target="_blank">www.skialpinesun.com</a></p>'),
(5, '2016-05-23 19:37:53', NULL, 1, 5, '0c4ced6f1677643', 'Black Tie Ski Rentals', 'black-tie-ski-rentals', '<p><a href="https://winterpark.blacktieskis.com" target="_blank">Black Tie Ski Rentals of Winter Park</a> is the newest branch of North America&#39;s premier ski rental delivery service successfully offering services for the past eight years in locations throughout Colorado and select locations in Utah, Montana, California and British Columbia. Black Tie has formulated a new concept for your ski rental needs, by knocking down the walls of your traditional ski shop and bringing the best equipment and service at a time and place that is convenient for you. Black Tie Ski Rentals is the largest and most reputable Ski Rental Delivery Service in the industry. Black Tie Ski Rentals of Winter Park is locally owned and operated. Our Kids Rent Free program is available to children 12 and under for each adult five day rental, one child 12 and under rents for free. Black Tie offers slope side service to accommodate your every need. <strong>To receive 20% off all ski rentals mention coupon code &quot;CORDUROY&quot;</strong> when making your reservation. Open from 7am to 10pm every day. <strong><a href="tel:1-877-328-7722">Call 1-(877)-328-7722</a></strong>.</p>'),
(6, '2016-05-23 19:38:26', NULL, 1, 6, 'a3686724679999f', 'Ski Broker Ski & Board Rental', 'ski-broker-ski-and-board-rental', '<p>We highly recommend the friendly and knowledgeable staff at the <a href="http://wpskibroker.com" target="_blank">Ski Broker</a> for great prices and customer service that can&#39;t be beat. Access Winter Park Lodging Company has partnered with the Ski Broker and has set up a great deal for all our guests on ski equipment rentals. <a href="http://wpskibroker.com" target="_blank">Click here</a> for more information on our discounts on ski, board and snowshoe rentals. Use the coupon code &quot;<strong>AWP5</strong>&quot; below to get <strong>25% off</strong> your entire rental order. You must book online and use the <strong>AWP5 coupon code</strong> to get this discount. Once booked, you can pick up your rentals from any of their 2 locations in Fraser.</p>\n\n<p>We strongly encourage you to reserve ahead of time as the rental shops in town could run out of ski rental equipment during peak periods.?</p>\n\n<p>Visit the <a href="http://wpskibroker.com" target="_blank">Ski Broker</a> on the web to view all their rental packages.?</p>'),
(7, '2016-05-23 19:39:01', NULL, 1, 7, 'f2bba57a00317c1', 'Dog Sled Rides of Winter Park', 'dog-sled-rides-of-winter-park', '<p><a href="http://www.dogsledridesofwinterpark.com/index.php?r=AWP" target="_blank">Dog Sled Rides of Winter Park</a> has 80 Siberian and Alaskan Huskies. Huskies love to pull. During the winter, the dogs pull sleds in the the forests near Winter Park. During the summer they pull one or two person carts through the forest and fields. When not pulling, the dogs are resting comfortably in the backyard, dreaming of snow and waiting for the sledding season. Summer Kennel tours are also offered. Come on out and meet the sled dogs of Winter Park.</p>\n\n<p>Call <a href="tel:970-726-3826"><strong>970-726-TEAM</strong></a> (<a href="tel:970-726-3826">970-726-3826</a>) to make your reservation today. Let them know Access Winter Park sent you. <strong>Referral code is AWP.</strong></p>'),
(8, '2016-05-23 19:39:54', NULL, 1, 8, 'b5cb6a87d6cc918', 'Grand County Fishing Company', 'grand-county-fishing-company', '<p>We highly recommend Jeff Ehlert, Guide &amp; Owner of <a href="http://www.grandflyfishing.com" target="_blank">Grand County Fishing Company</a>. Give him a call at <a href="tel:970-726-5231">970-726-5231</a> or <a href="tel:970-531-9998">970-531-9998</a> to book a guided trip. Visit his web site: <a href="http://www.grandflyfishing.com" target="_blank">www.grandflyfishing.com</a>.</p>'),
(9, '2016-05-23 19:40:22', NULL, 1, 9, 'a2ddc17f44640c2', 'Valley Board -n- Bike', 'valley-board-n-bike', '<p>We highly recommend the friendly and knowledgeable staff at the <a href="http://wpskibroker.com/Summer-Bike-Rentals" target="_blank">Ski Broker&#39;s Valley Board -n- Bike</a> for great prices and customer service that can&#39;t be beat. Call or visit the main store to reserve your mountain bikes, cruisers, youth bikes, child trailer or child&#39;s tag-a-long. Rates include helmet. Multiple day rates are available. They have a full repair service on site. The main store is located in Fraser in the Alco shopping center, across the streeet from the Safeway store. Visit their store for all your mountain bike rental or repair needs or call <strong><a href="tel:970-726-8882">970-726-8882</a></strong> or <strong><a href="tel:1-800-544-2431">1-800-544-2431</a></strong> and mention &quot;Access Winter Park&quot; sent you for their best rates.</p>'),
(10, '2016-05-23 19:40:52', NULL, 1, 10, '28ed82e323072d3', 'Lewis Sweet Shop', 'lewis-sweet-shop', '<p>If you have the time on the way up to Winter Park (or the way down), stop at the <a href="http://lewissweetshop.com" target="_blank">Lewis Sweet Shop</a> (a circa 1949 era candy shop) in the little town of Empire, located at the base of Berthoud Pass. You have to pass through Empire to get to Winter Park anyway. They have probably the best milkshakes this side of the Mississippi. Ask for a small (thick) AVALANCHE - your choice of flavor and enjoy. You&#39;ll soon see why it is called an AVALANCHE. Owners Bernie &amp; Peggie specialize in shakes, taffy and just plain fun &amp; friendly Colorado backcountry hospitality. They also display unique local handmade arts &amp;crafts. You might even be lucky enough to entertained by one of the local musicians who stop in to share stories and give impromptu performances. They have great gifts for sale there too. Buy a set of chocolate dominoes. After the game is over, the winner gets to eat them. Drop in for some great pulled pork BBQ or pick up a pound of chocolate covered bacon. They swear it&#39;s the greatest thing since deviled eggs (made of white chocolate and rice krispies)???? Haven&#39;t yet tried it ourselves but it is on the to do list. Tell them Access Winter Park sent you and you&#39;ll get a local discount. Ski Press magazine calls them one of America&#39;s Top 5 Sugar Shacks.</p>\n\n<p>So stop and stay awhile, catch up with the locals and maybe even catch a glimpse of the Rocky Mountain Bighorns who can often be spotted wandering through town. The kids ( little ones and big ones alike) will enjoy playing tic-tac-toe on the outside tables. &quot;Nothing more fun than eating there when everyone else is stuck in traffic.&quot;</p>');
