(1, '2016-10-18 22:53:11', '2016-10-19 00:00:23', 1, 1, 'dummy', '3 Things to Keep in Mind When Planning Your Family Vacation', '3-things-to-keep-in-mind-when-planning-your-family-vacation', '<p>Vacations, although often stressful, are one of the most fun events you and your family can do. Wholly 37% of U.S. families said that vacations make them happy. Unfortunately, vacations can go from fun and happy to stressful and a nightmare in a matter of seconds, so it&#39;s extremely important to take everything into consideration when planning and executing your trip.</p>\n\n<p><strong>Location</strong></p>\n\n<p>The most important decision you and your family can make regarding your vacation is actually where you&#39;re planning on going. Staying in expensive condos on a crowded beach can be even more stressful than your day job, but going on a trip to a winter park can be a new and exciting trip for the entire family. Make sure to plan out every aspect involving the location of your trip: weather conditions, any special events going on in the area, and any other important information.</p>\n\n<p><strong>Activities</strong></p>\n\n<p>The activities that you and your family will enjoy during your trip, aside from the sheer relaxation, are the second most important part of your vacation. Make sure the vacation you&#39;re planning has plenty of fun activities that the whole family can enjoy. Some vacations only have cliche tourist-oriented activities to enjoy, and honestly, not everyone enjoys those kind of activities. Winter park vacations can offer some original and exciting activities including skiing, snowboarding, dog sled riding, mountain biking, and plenty of other snow-related fun.</p>\n\n<p><strong>Lodging</strong></p>\n\n<p>Another important and potentially deal breaking aspect of your vacation is how much you&#39;re going to spend on lodging for your trip. Roughly 62% of vacationers said that they would stay in condos during their vacation because they have cheaper rates than major hotels.</p>\n\n<p>Approximately 22% of leisure travelers have stayed in a vacation rental over the past two years, and 24% have stayed in vacation condos. Spending thousands of dollars on expensive major hotels for your entire family, just to sleep there, seems like a giant waste of money. Instead, spend your money on lodging that can act as a home away from home while you&#39;re on vacation, with features like kitchens, hot tubs, and more. That way, you&#39;ll have more money left over for doing more family-friendly winter activities. Don&#39;t let high lodging prices ruin your vacation.</p>\n'),
(2, '2016-10-19 16:09:59', '2016-10-19 17:01:53', 1, 2, 'f96acb166816cb3', '5 Popular Colorado Summer Activities', '5-popular-colorado-summer-activities', '<p>Have you ever wanted to visit Winter Park, Colorado in the summertime but felt discouraged because there wasn&#39;t any snow on the ground? Well, worry no more! Winter Park, Colorado is just as beautiful in the warm weather as it is when there is snow on the ground. It is chock-full of different activities and seasonal rental properties that will make any family vacation one to remember.After all, 37% of families say that vacations make them happy, so why wouldn&#39;t you head out to a place that will bring smiles to everyone involved? So in order to give you some inspiration, here are some great summer activities to do during your summer vacation in Colorado.</p>\n\n<h4>1. Mountain Biking</h4>\n\n<p>Think all of those mountains and valleys are meant only for skiers? Think again! They provide the perfect terrain for mountain biking and other cross-terrain vehicles. You&#39;ll be able to find high-altitude paths with stunning views, or leveled trails for novices and beginners. Bring your camera because you&#39;ll zoom past fields of colorful wildflowers, over the top of snow-capped mountain peaks, and through dense green forests.</p>\n\n<h4>2. Fishing</h4>\n\n<p>Looking for an activity that is a little bit more relaxing? In Colorado you will find thousands of miles of streams great for fishers of all abilities. There are plenty of fish swimming in these rivers, so chances are even the most inexperienced fisher will be able to catch something great for dinner. Head back to your lodgings and prepare yourself for a feast once the day is done. And if you aren&#39;t in the mood for dealing with fish guts, just catch and release!</p>\n\n<h4>3. Hot Balloon Rides</h4>\n\n<p>This may be one of the best ways to see the Rocky Mountains. Book the earliest flight and you&#39;ll be able to take in breathtaking views at sunrise.</p>\n\n<h4>4. White Water Rafting</h4>\n\n<p>Grab a life vest and get ready for a thrilling ride! If you are ready for an adventure, you will even be able to book an overnight trip to see even more of the gorgeous landscape.</p>\n\n<h4>5. Horse-back Riding</h4>\n\n<p>Get a full cowboy experience by taking a fun trip on horseback through ranch country. Some trails throughout the state have been used for hundreds of years, so step back in time and enjoy the ride. Now that you have a vacation planned, you now need to book some lodgings for your trip. There are plenty of lodging options in Winter Park, Colorado, including affordable vacation rentals. These options let vacationers stay in a comfortable place without the hassles of a hotel, whether it&#39;s a college group or family of five. In fact, a full 62% of traveler&rsquo;s report that they would stay in a vacation rental because they are cheaper than the standard hotels, and 22% of leisure travelers have chosen this method within the past year.</p>\n\n<p><strong>So what are you waiting for? Book your Colorado summer vacation today!</strong></p>\n'),
(3, '2016-10-19 20:30:08', NULL, 1, 3, 'dummy', 'Vacation Ideas for the Whole Family', 'vacation-ideas-for-the-whole-family', '<p>It can be hard to figure out a great vacation activity for everyone in your family, especially during the winter. But both winter landscapes and family vacations offer a great opportunity to bond, see new places, and experience new things. Just as importantly, winter vacations are just plain fun. In fact, pleasure was cited as the reason for 61% of winter trips.</p>\n\n<p>Whether you travel across the state, country, or world, you are bound to have a great time with the people you love. Check out these three great vacation ideas:</p>\n\n<p><strong>Rent a Condo:</strong></p>\n\n<p>Staying at hotels is officially overrated. Even if you find a decent hotel, they can often seem uninviting and barren, making you crave your own bed and couch back home. And homesickness is a great way to kill a vacation just as it&#39;s starting.</p>\n\n<p>This is only one of the reasons why seasonal rentals or condo rental options for your next vacation is a great idea. Among other things, having a rental property can give you the freedom to make your own meals, have company over, and get a little privacy, especially when traveling with your family. About 22% of leisure travelers have stayed in a vacation home rental instead of a hotel already, so jump onto this trend fast before they become hard to book!</p>\n\n<p>After finding the perfect vacation rental (hint: look for rentals with a private hot tub or pool), many families end up returning to the same spot year after year. Not only will it give you and your kids something to look forward to all year long, but you can enjoy all the benefits of a vacation home without the inconvenience of a 30-year mortgage.</p>\n\n<p><strong>Ski In Ski Out:</strong></p>\n\n<p>If there&#39;s one thing that the winter holidays are for, it&#39;s winter sports. Between skiing, snowboarding, snowshoeing, and lounging in lodges, there&#39;s bound to be something for the whole family. In 2013, there were a grand total of 477 ski resorts in the U.S., which were visited by around 57 million skiers. Don&#39;t hesitate to join their ranks this year.</p>\n\n<p><strong>Be Seasonal:</strong></p>\n\n<p>Instead of vacationing just to vacation, why not structure your trip around a specific event? Maybe it&#39;ll be a harvest festival, a winter sporting competition, or an annual bloom. Research local holiday traditions or events in the area you are staying in. Experience natural or urban environments at their most exciting, and rent a condo for the duration of your stay.</p>\n\n<p>Whether you&#39;re zipping down slopes or checking out Christmas markets in new cities, you are sure to have a great winter vacation with your family by taking advantage of all the unique activities the season has to offer.</p>');
