(6, '2016-06-17 17:14:33', '2016-09-12 21:40:50', 1, 5, '94061011e6e3e3f', 'Several of our properties are willing to accept pets, subject to the following pet policies:<br />\n<br />\nPET POLICY:<br />\nONE (1) pet is allowed per property; specific pet acceptance is subject to approval by Access Winter Park in any of our pet friendly proeprties<br />\n*We require an additional $250 pet cleaning fee (non-refundable) and a separate $500 Refundable Pet Damage Deposit.<br />\n*Pets are not allowed to be left alone in the property unless they are crated.<br />\n*Any damage to the property or the contents within are the sole responsibility of the pet owner.<br />\n*Pets are not allowed on any of the furniture. If pet hair is found on the bedding or furniture, additional cleaning costs will be incurred to cover laundering, dry cleaning or replacement of the bedding and/or furniture.<br />\n*Owner must ensure that the pet does not bark. If complaints of barking are received, the owners will immediately remove the pet from the premises. If this requires an early departure, no refunds will be issued.<br />\n*Owner must clean up all pet waste. Doggie clean-up bags are generally available in several locations within the complex. If no doggie bags are available, it is the pet owner&#39;s responsibility to ensure that pet waste is picked up and disposed of in accordance with complex pet waste policy. Pet waste should be immediatley disposed of in the dumpster on the property. Any complaints received about owner not cleaning up after their pet will result in owner and pet being required to immediately vacant the premises. No refunds for the remainder of the stay or refund of the Pet Damage Deposit will be given if the stay is curtailed because of violations of the pet policy.<br />\n*Owner or owner&#39;s agent reserves the right to inspect the condition of the property during a pet stay.\n<p><br />\nTO RECAP: A PET STAY REQUIRES: ADDITIONAL $500 REFUNDABLE PET DEPOSIT and a $250 NON-REFUNDABLE PET CLEANING FEE (The REFUNDABLE $500 Pet Damage Deposit is due at the time the reservation is made. Must be paid by check or cash...credit cards are NOT ACCEPTED for a pet damage deposit.</p>\n', 'yes', 'yes', 'asc'),
(7, '2016-06-17 17:15:59', '2016-10-12 21:48:07', 1, 6, 'b82fcceec2bca13', '<p>Looking for a season long rental in Winter Park, CO?<br />\nWe have both summer and winter season rentals.<br />\nSome of our season rental properties are only available for summer rental; others are available for either summer or winter.<br />\nCall us at 303-704-7291 if you have questions.<br />\n<br />\nOur winter seasonal rentals typically run from November 01 through April 30, though on occasion we do have exceptions.<br />\nRATES ARE NOT POSTED ONLINE.&nbsp; MUST CALL US AT 303-704-7291 to discuss winter season leases.<br />\n<br />\nOur summer seasonal rentals typically run from June 01 through Sept 01, though on occasion we do have exceptions.<br />\nRATES ARE NOT POSTED ONLINE.&nbsp; MUST CALL US AT 303-704-7291 to discuss summer season leases.<br />\n<br />\n<strong>Our lease rates include cable or satellite and wifi. The lease rate does not include gas &amp; electric.<br />\n<br />\nThere is a one time cleaning fee, an AWP management fee and a REFUNDABLE Security/Damage Deposit.<br />\n<br />\nIf the property has a private hot tub, the guest would be responsible for the cost of the weekly hot tub maintenance checks and any drain &amp; fills requird during the lease.</strong><br />\n<br />\nAdditional housekeeping services are available on a per diem basis, upon request</p>\n\n<p>If you would like more information, or if you are interested in a seasonal for the 2016/17 winter ski season, please call 303-704-7291 or email us at accesswinterpark@mac.com.</p>\n\n<p>Note:&nbsp;These properties are all strictly non-smoking units and all have quiet hours between 9:30pm - 9:30am.<br />\n<br />\nGenerally speaking pets are not accepted in our ski lease properties, with the possible exceptions of Bavarian Village and Trademark 3-1. Strict pet policies are in place for these units.&nbsp;<br />\n<br />\nCall 303-704-7291 for details and current availability.<br />\n&nbsp;</p>\n', 'yes', 'yes', 'asc'),
