(13, '2016-06-30 20:25:50', '2016-09-01 10:50:42', 1, 11, 'b82fcceec2bca13', '<h3>No long term planning required!</h3>\n\n<p>Whether its a powder day or you just want to escape the tea, just grab your gear and head up to Winter Park. Great deals on last minute lodging!. For more information call us at <a href="tel:303-704-7291">303-704-7291</a> stop by the the office at 79050 US Hwy 40, Suite 8C, Winter Park....on the southwest corner of US Hwy 40 &amp; Vasquez Road in downtown Winter Park.<br />\n<br />\nCURRENT LABOR DAY &quot;STAY, PLAY &amp; SAVE&quot; DISCOUNT OFFERS:<br />\nStay 2 nights, get 3rd night free for any property. Valid for stays during the fall: Aug 28 - Oct 31, 2016.<br />\n&nbsp;</p>\n', 'yes', 'yes', 'asc');
