(3, '2016-05-24 16:25:25', '2016-06-25 00:43:18', 1, 2, 'b82fcceec2bca13', '<p>Thank you for your interest in the properties of Access Winter Park Lodging. This quick response is an automated acknowledgment of you inquiry. One of our team members will follow-up with you shortly.</p>\n\n<p>Please do not hesitate to give us a call at <a href="tel:303-704-7291">303-704-7291</a> if you have questions, would like additional information, or to confirm a reservation.</p>\n\n<p>We will be in touch with you soon.</p>\n\n<p>Cordially,</p>\n\n<p>Judi<br />\nAccess Winter Park Lodging<br />\nTel: <a href="tel:303-704-7291">303-704-7291</a><br />\nEmail: <a href="mailto:accesswinterpark@mac.com">accesswinterpark@mac.com</a><br />\nWeb Site: <a href="http://www.accesswinterpark.com">www.accesswinterpark.com</a></p>\n\n<p><br />\n<strong>You submitted the following:</strong></p>\n', 'yes', 'no'),
(4, '2016-05-27 21:44:20', '2016-06-25 00:41:57', 1, 3, 'b82fcceec2bca13', '<p>Thank you for your interest. This quick response is an automated acknowledgment of you inquiry. One of our team members will follow-up with you shortly. Please do not hesitate to give us a call at <a href="tel:303-704-7291">303-704-7291</a> if you have questions, would like additional information, or to confirm a reservation.</p>\n\n<p>We will be in touch with you soon.</p>\n\n<p>Cordially,</p>\n\n<p>Judi<br />\nAccess Winter Park Lodging<br />\nTel: <a href="tel:303-704-7291">303-704-7291</a><br />\nEmail: <a href="mailto:accesswinterpark@mac.com">accesswinterpark@mac.com</a><br />\nWeb Site: <a href="http://www.accesswinterpark.com">www.accesswinterpark.com</a></p>\n\n<p><br />\n<strong>You submitted the following:</strong></p>\n', 'yes', 'no'),
(5, '2016-06-01 20:15:44', '2016-06-07 17:07:58', 1, 4, 'b82fcceec2bca13', '<h2>Truly a Four Season Destination</h2>\n\n<p>Tucked away in the scenic Fraser Valley beneath the towering peaks of the Continental Divide lies the Colorado mountain town of Winter Park. Winter Park is known for breath taking scenery, abundant wildlife, gracious hospitality, and world class skiing.</p>\n\n<p>The Winter Park-Mary Jane ski complex averages 300 inches of Colorado champagne powder and boasts the most snowfall of any major Colorado resort. Winter Park has six distinct mountains: Winter Park, Mary Jane, Parsenn Bowl, The Cirque, Vasquez Ridge and Eagle Wind with plenty of runs for skiers and snowboarders of all abilities. Mary Jane is renowned for her moguls. Winter Park&rsquo;s newest lift, The Panoramic Express is located on Mary Jane Mountain and is the highest, high-speed six-pack chairlift in North America. It starts near the Sunnyside chairlift boarding terminal and runs to the top of Parsenn Bowl, to an elevation of 12,060 feet. With over 3,000 skiable acres, 143 designated trails, over 1200 acres of off-piste terrain, Winter Park has something for skiers and boarders of every ability.</p>\n\n<p>Winter activities include downhill and cross-country skiing, snowboarding, sleigh rides, dog sled rides, hot air ballooning, ice skating, ice fishing, snowcat photographic tours, snowmobiling, sledding, tubing and snowshoeing. Fraser boasts a tubing hill and is 10 minutes away. The Spa at Hot Sulphur Springs is a 20 minute drive away and is open year round.</p>\n\n<p>Summer Activities include mountain biking, hiking, alpine tubing, climbing wall, disc &amp; mini golf, leaps &amp; bounds bungee, whitewater rafting, fly fishing, horse-back riding, golf, fishing, hiking, back packing, water skiing, jet skiing, rock climbing, wildlife viewing &amp; photography and shopping. Rocky Mountain National Park is only 30 minutes away. Hike the trails, see the high mountain lakes &amp; snow fields, or watch the herds of elk and big horn sheep. Take a day trip to Mt. Evans and see the mountain goats grazing beside the roadway.</p>\n\n<p>Winter Park is truly a four season destination. So come on out and enjoy all that Winter Park and Grand County have to offer.</p>\n\n<h4>Stay with us, relax and enjoy the Winter Park experience!</h4>\n', 'yes', 'yes'),
(6, '2016-06-01 20:49:48', '2016-06-22 02:54:36', 1, 5, '19605e14cdc222b', '<h2>12,060 Feet of Fun</h2>\n\n<p>Winter Park has 145 trails and 3,078 acres (1,238 ha) of ski area spread over five summits. Winter Park&rsquo;s vast terrain is spread over five summits--Winter Park, Mary Jane, Parsenn Bowl, Vasquez Cirque and Vasquez Ridge--and the new Rail Yard Terrain Park. Winter Park Mountain is the largest and most versatile hub, offering well-manicured terrain for beginner, intermediate and advanced skiers from its summit, Sunspot, at 10,700 feet (3,261 m) down to its base at 9,000 feet (2,743 m). On its slopes you&rsquo;ll find Discovery Park, an award-winning enclosed learning area open to all sliders with its own lifts and gentle slopes. More experienced skiers head for the wilder Mary Jane Mountain, at 11,200 feet (3,414 m), rising behind Winter Park summit and named after a legendary local prostitute who laid claim to the land.</p>\n\n<p>Thee above-treeline Parsenn Bowl is the highest point on the mountain at 12,060 feet (3,675 m), offering a maximum vertical descent of 3,060 (933 m) and fabulous views of the Rockies: you&rsquo;re actually looking down onto the Continental Divide and the famous Moffat Tunnel which takes trains under it. Here you will find ungroomed trails with moguls and extensive off-piste and gladed terrain of varying density, and an untouched blanket of irresistible powder. The wide-sweeping Vasquez Ridge is the westernmost part of the resort with wide-open cruisers, exciting bump trails, plenty of fresh snow and a ernoon sun, while Vasquez Cirque at 11,900 feet (3,627 m) is for black and double-black diamond experts seeking steep cornices and 687 acres (278 ha) of extreme backcountry terrain.</p>\n\n<p>The resort also receives an average of 359 inches (912 cm) snowfall a year, more than any other major Colorado resort. Winter Park may be best known for its fantastic mogul skiing. Mary Jane is internationally famous for its bumps and &ldquo;Don&rsquo;t Groom the Jane&rdquo; is the locals&rsquo; rallying cry.</p>\n\n<p>With over 64 miles of trails spread out over five interconnected but highly varied mountain terrains Winter Park has something for skiers of every ability. Add an easygoing mix of old rural West and modern resort chic, with a playful railroad motif, throw in the added value of more snowfall and deeper powder than any other Colorado destination and you&rsquo;ve got a destination resort on the rise.</p>\n', 'yes', 'yes'),
(7, '2016-06-01 20:54:03', '2016-06-22 03:01:38', 1, 6, '1052f2d8924785b', '<h2>About the Resort</h2>\n\n<p><strong>2016&ndash;2017 Ski Season Opens November 16</strong></p>\n\n<p>Winter Park Resort is located 67 miles (108 kilometers) northwest of Denver and 85 miles (137 kilometers) from Denver International Airport (DIA). Set in the Vasquez Mountains of the Arapaho National Forest, Winter Park is the closest major ski resort to Denver (1 1/2 hours driving time) via I-70 west to exit 232 onto U.S. Hwy 40 North.</p>\n\n<p>Winter Park first opened in 1939 with a single rope tow and a $1.00 lift ticket. Since then Winter Park has developed into one of the top ten ski resorts in the United States. In 1975 Mary Jane Mountain opened. Revered for big bumps, deep chutes, tight glades and steep pitches, &ldquo;the Jane&rdquo; has earned cult-like status for her ego-humbling terrain. Mary Jane is consistently ranked #1 for moguls in North America by Skiing Magazine. Over the years additional sections of the mountain opened including Mary Jane&rsquo;s backside, Vasquez Ridge, Parsenn Bowl and, in 1997, Vasquez Cirque - the resort&rsquo;s most extreme and dramatic terrain. Today, Winter Park boasts 21 lifts serving 134 trails spread over more than 2,700 acres across four mountains.</p>\n\n<p>Winter Park Resort received 377 inches of snowfall during the 2013-2014 season and has the most consistent snow season after season. Averaging 30 feet of snow annually entitles the resort to the coveted title of &ldquo;most snow of any major Colorado resort,&rdquo; a distinction that has been unchallenged for more than 64 years. With its proximity to Denver, just 67 miles away, Winter Park is a magnet for outdoor enthusiasts. A network of trails and lifts interconnects the distinct sections of each mountain. With five mountains to chose from (Winter Park, Mary Jane, Vasquez Ridge, Vasquez Cirque and Parsenn Bowl) and consistent annual snowfall, Winter Park offers a great experience for skiers and boarders of all abilities.</p>\n\n<h4>Elevation</h4>\n\n<table>\n	<tbody>\n		<tr>\n			<td>Winter Park</td>\n			<td>Base 9,000 feet (2,743 meters); summit at Sunspot 10,700 feet (3,261 meters). Vertical drop: 1,700 feet (518 meters).</td>\n		</tr>\n		<tr>\n			<td>Mary Jane</td>\n			<td>Base 9,450 feet (2,880 meters); summit at North Cone 12,060 feet (3,676 meters). Vertical drop: 2,610 feet (796 meters).</td>\n		</tr>\n		<tr>\n			<td>Vasquez Ridge</td>\n			<td>Base 9,486 feet(2,486 meters); summit 10,700 feet (3,261 meters).</td>\n		</tr>\n		<tr>\n			<td>Vasquez Cirque</td>\n			<td>Base 10,400 feet (3,170 meters); summit 11,900 feet (3,627 meters). Vertical drop: 1,500 feet (457 meters).</td>\n		</tr>\n		<tr>\n			<td>Combined</td>\n			<td>Vertical drop: 3,060 ft. (933 m.); summit at North Cone to Winter Park base.</td>\n		</tr>\n	</tbody>\n</table>\n\n<h4>Terrain</h4>\n\n<p>3,060 total skiable acreage (1,521 hectares), includes 143 designated trails and 1,212 acres (490 hectares) of off-piste terrain, including Vasquez Cirque and glade skiing.</p>\n\n<table>\n	<thead>\n		<tr>\n			<td>&nbsp;</td>\n			<td>Total</td>\n			<td>Winter Park</td>\n			<td>Mary Jane &amp; Parsenn Bowl</td>\n			<td>Vasquez Ridge</td>\n			<td>Vasquez Cirque</td>\n		</tr>\n	</thead>\n	<tbody>\n		<tr>\n			<td>Beginner (green)</td>\n			<td>8%</td>\n			<td>28%</td>\n			<td>1%</td>\n			<td>10%</td>\n			<td>0%</td>\n		</tr>\n		<tr>\n			<td>Intermediate (blue)</td>\n			<td>17%</td>\n			<td>21%</td>\n			<td>19%</td>\n			<td>35%</td>\n			<td>0%</td>\n		</tr>\n		<tr>\n			<td>Advanced (blue-black)</td>\n			<td>19%</td>\n			<td>33%</td>\n			<td>22%</td>\n			<td>3%</td>\n			<td>2%</td>\n		</tr>\n		<tr>\n			<td>Most Difficult (black)</td>\n			<td>53%</td>\n			<td>18%</td>\n			<td>57%</td>\n			<td>51%</td>\n			<td>83%</td>\n		</tr>\n		<tr>\n			<td>Expert (double black)</td>\n			<td>3%</td>\n			<td>0%</td>\n			<td>1%</td>\n			<td>0%</td>\n			<td>14%</td>\n		</tr>\n	</tbody>\n</table>\n\n<h4>Trails</h4>\n\n<p>Total skiable acreage is 2,770 acres (1,121 hectares) which includes 143 designated trails and 1,212 acres (490 hectares) of off-piste terrain.</p>\n\n<p><strong>Longest Trail:</strong></p>\n\n<table>\n	<tbody>\n		<tr>\n			<td>Winter Park</td>\n			<td>2 miles (3.2 kilometers)</td>\n		</tr>\n		<tr>\n			<td>Mary Jane</td>\n			<td>4.5 miles (7.2 kilometers)</td>\n		</tr>\n		<tr>\n			<td>Vasquez Ridge &amp; Vasquez Cirque</td>\n			<td>1.4 miles (2.3 kilometers)</td>\n		</tr>\n		<tr>\n			<td>Combined</td>\n			<td>2.9 miles (4.6 kilometers)<br />\n			5.1 miles (8.2 kilometers); North Cone to Turnpike</td>\n		</tr>\n	</tbody>\n</table>\n\n<h4>Chairlifts</h4>\n\n<p>25 lifts including one high speed six-person chairlift, five triple chairlifts, seven high-speed express quads, seven double chairlifts, three surface lifts and three magic carpets provide an uphill capacity of 36,920 skiers per hour. For special occasions such as Thanksgiving, Christmas, New Year&rsquo;s, Martin Luther King holiday, President&rsquo;s Day and Valentine&rsquo;s Day, the Zephyr Express chairlift is modified to accommodate 20 gondola cabins for dinner service to The Lodge at Sunspot atop Winter Park Mountain.</p>\n\n<h4>Snowmaking</h4>\n\n<p>Snow is made on 26 trails covering 299 acres (121 hectares). The snowmaking capabilities guarantee the opening of Winter Park before Thanksgiving.</p>\n\n<h4>Parks, Pipe &amp; Freeride</h4>\n\n<p>Winter Park has expanded on its new terrain park, Rail Yard, with new progressive rails and improved jump design. Pipe aficionados head straight to the resort&rsquo;s new Superpipe on Allan Phipps trail. A 100-foot snow bridge whisks skiers and riders over Cranmer Cutoff for a more seamless transition between the park and the new Superpipe. Aspiring riders of all ages can test their skills in the expanded terrain park on Jack Kendrick trail with new jumps and rails. This year, the freeride scene at Winter Park Resort continues to push the progressive envelope with five levels of terrain parks. Rail Yard, Winter Park&rsquo;s advanced terrain, continues on its quest to impress taking home three Top 10 rankings in Transworld Magazine&rsquo;s 2005-2006 resort rankings for Best Park (tie for 4th), Best Overall Resort (8), and Best Pipe (10).</p>\n\n<p>Last season&rsquo;s addition of Dark Territory, Rail Yard&rsquo;s limited access area, also continues to evolve with more unique features. Dog Patch, located on the east side of the Eskimo Express, offers skiers and riders an intermediate park system ideal for perfecting skills. Dog Patch East, Winter Park&rsquo;s latest addition to the freeride family, is located just east of the original Dog Patch, and will o er a variety of non-traditional jib features for skiers and riders. Starter Park, located below Snoasis, is for the beginner-jibber and features small rails perfect for those first attempts at rail sliding.</p>\n\n<p><a class="btn btn-side-column btn-link" href="https://www.winterparkresort.com/the-mountain/weather-dashboard" target="_blank">Winter Park Webcams</a></p>\n\n<h3>Area Facilities</h3>\n\n<h4>Winter Park</h4>\n\n<h5>West Portal Station</h5>\n\n<p>This base facility houses Portal Perk; Boxcar Deli; Base Camp 9000 retail shop, West Portal Outfitters, West Portal Rental &amp; Repairs, West Portal Boots &amp; Boards, Lost and Found, lockers, an indoor climbing wall, and the National Sports Center for the Disabled (NSCD).</p>\n\n<h5>Moffat Market at West Portal Station</h5>\n\n<p>Dramatically remodeled last season, this food court, located at the base, has a railroad theme and offers fresh cuisine and specialties that reflect the different regions of the country. Storefronts and names identify the different food stations with options such as New York-style pizza at Grand Central Station, Tex-Mex at the Santa Fe Station, Asian cuisine at the Orient Express, and soups at the Shortline.</p>\n\n<h5>The Derailer Bar</h5>\n\n<p>This favorite apres ski bar is now larger, with a two-tiered drink and entertainment center. A full-service lunch menu offers pub-style food and a wide variety of apres ski specials.</p>\n\n<h5>Balcony House</h5>\n\n<p>At the base of Winter Park Mountain, this facility houses the Guest Services Center, which offers one-stop shopping for ticket sales, ski and snowboard lessons, and on-mountain tours. This building also houses Coffee &amp; Tea Market, an ATM, Ski Video Mountain Memories, Sharpshooters Photography, Competition Center offices, restrooms, Security, Season Pass Office, meeting rooms, and coin-operated lockers.</p>\n\n<h5>The Lodge at Sunspot</h5>\n\n<p>A mountaintop lodge with panoramic views of the Continental Divide and the Rocky Mountains. The Dining Room, a full-service restaurant, features European-style service with several &quot;chef&#39;s selections&quot; daily. The Provisioner is an upscale food court. The Sunspot Mercantile (an accessory and gift shop), the new Coffee Shop &amp; Bakery featuring espresso-based coffee drinks and fresh scones, Sunspot Lounge, and the National Disabled Ski Hall of Fame are also on site. Foot passenger tickets available from the base of Winter Park Resort to the Lodge at Sunspot via the Zephyr Express chairlift between 11:00 a.m. and 1:30 p.m.</p>\n\n<h5>Zephyr Mountain Lodge</h5>\n\n<p>Located at the base of Winter Park mountain, the lodge has 230 condominium units and meeting rooms on the upper levels and a variety of shops and restaurants on the ground floor including a new Starbucks, opening in December, the newly expanded and remodeled Slopeside Mountain Adventure Center (rental and retail shop), Colorado&rsquo;s first Rossignol exclusive store with the full range of Rossignol products, Trail&rsquo;s End Mercantile, and Rocky Mountain Eyewear.</p>\n\n<h5>Snoasis Market</h5>\n\n<p>Located mid-mountain, Snoasis is a blast to the past with its music, colors, deck space, and specialty drinks.</p>\n\n<h4>Mary Jane</h4>\n\n<h5>Mary Jane Center</h5>\n\n<p>Nestled at the base of Mary Jane Mountain, this facility houses the Club Car, a local favorite offering full-service bistro-style dining and bar, Pepperoni&rsquo;s Pizza &amp; Sports Bar, and Mary Jane Food &amp; Drink--a food court. Ticket sales, The Jane Shop (rentals and retail), Guest Services, Ski Patrol/First Aid room, lockers, and meeting rooms are also on site.</p>\n\n<h5>Lunch Rock</h5>\n\n<p>This mountaintop spot specializes in casual food, weekend burger barbecues, deck dining, and incredible views of Parry&rsquo;s Peak.</p>\n\n<h4>Vasquez Ridge</h4>\n\n<h5>Sundance Cafe</h5>\n\n<p>Warming hut with vending convenience, picnic deck, and restrooms.</p>\n\n<h3>Childcare</h3>\n\n<p>Are your kids too young to ski? Child care is available at Winter Park, both at the resort and in your own condo!</p>\n\n<h4>Personalized Child Care</h4>\n\n<p>Personalized Child Care in your condo is available during peak periods. Personnel are limited and book up early. If interested, please contact Judi at Access Winter Park for additional information. Weather permitting, our experienced staff can take the kids snowshoeing on Fraser river trail, tubing, play games or stay inside and bake cookies.</p>\n\n<p><a href="#footer">Send us a message</a> describing your needs or call <a href="tel:1-303-704-7291">1-303-704-7291</a>.</p>\n\n<h4>Wee Willie&#39;s Childcare</h4>\n\n<p>A non-ski program for children 2 months through 6 years with indoor activities and outdoor play. Lunch is available on site. A complimentary beeper/pager is included. Reservations are required. Cost for full-day childcare is $85 during value season. A one-hour private ski or snowboard lesson add-on is available for children (3 years and older) who are enrolled in full-day childcare for $55.</p>\n\n<p>New this season, parents can take advantage of our Jump Start Program, which includes a 2-hour lesson and rentals in the morning and an all-day childcare and lunch for $101 (value season).</p>\n\n<h4>Ski and Ride School Programs</h4>\n\n<p>Winter Park Resort offers adult class lessons and private lessons, including unique learning experiences such as First Tracks, Last Tracks, Family Privates, and specialty clinics throughout the season that cater to women, mogul skiers, freeriders, and telemarkers. For more information and pricing, contact the Guest Contact Center at <a href="tel:800-729-7907">(800) 729-7907</a> or visit <a href="http://www.winterparkresort.com" target="_blank">www.winterparkresort.com</a>.</p>\n\n<h5>Kids Adventure Junction</h5>\n\n<p>Winter Park Resort is well known for its outstanding youth ski and snowboard programs and childcare facilities. Registra- tion, rentals, a nursery and meeting rooms are all located in the Kids Adventure Junction at the base of Winter Park, located adjacent to West Portal Station. Advance reservations are available. For information and reservations, call the Guest Contact Center at <a href="tel:800-729-7907">(800) 729-7907</a> or visit <a href="http://www.winterparkresort.com" target="_blank">www.winterparkresort.com</a>.</p>\n\n<h5>The Kids Daily Programs</h5>\n\n<p>The program for 3 and 4 year-olds (Snow Tykes) is a non-chairlift riding ski orientation with all-day supervision, playtime, and lunch. Children are introduced to skiing through indoor and outdoor activities designed and paced for each group. Participants must be potty-trained and willing to play outside. Classes for all other kids are determined by ability level; beginner through advanced, and age; 5- and 6-year-olds (Explorers), and 7&ndash;17 years of age (Freeriders). Cost includes ski/snowboard rental, lift ticket, complimentary helmet rental, lunch, snack, and instruction. Indoor supervision is provided for kids 3 - 6 years old, before and after their lessons. Snowboard lessons are offered for children as young as age 5. These particular classes are kept small, with a maximum of three students per instructor to provide the necessary student/teacher ratio for optimal learning. Registration for lessons is from 8 to 9 a.m. on lesson day at any Winter Park Resort Guest Service Center Desk. Kids enrolled in the full-day ski or snowboard program may add on a one-hour private, starting at 8:30 am, for an additional $55.</p>\n\n<h5>National Sports Center for the Disabled</h5>\n\n<p>Information and reservation line: <a href="tel:970-726-1540">(970) 726-1540</a> or <a href="tel:303-316-1540">(303) 316-1540</a> or visit <a href="http://www.nscd.org" target="_blank">www.nscd.org</a>.</p>\n\n<p>The internationally acclaimed National Sports Center for the Disabled (NSCD) is the largest and most successful program of its kind in the world. The NSCD began in 1970 with 23 amputee children from Denver taking ski lessons at Winter Park. Launching its 37th season, the non-profit organization teaches more than 17,000 lessons annually in a variety of year-round sports for children and adults of all disabilities. The NSCD Competition Program provides race training and coaching for disabled skiers participating in regional, national, and international events.</p>\n\n<h5>Competition Center Programs</h5>\n\n<p>Information line: <a href="tel:970-726-1590">(970) 726-1590</a> or Denver <a href="tel:303-316-1590">(303) 316-1590</a>.</p>\n\n<p>Seasonal training programs are available in alpine and freestyle for all ages of intermediate and advanced skiers and snowboarders. Clinics are offered throughout the season. Other services available include tuning, binding mounts, boot fitting, and equipment repair.</p>', 'yes', 'yes'),
(8, '2016-06-06 19:58:08', '2016-06-07 18:25:51', 1, 7, '9ea6aa9f793d2f6', '<h3>Winter Park Territory</h3>\n\n<p>Summit at Sunspot: 11,220 ft<br />\nBase: 9,000 ft<br />\nVertical drop: 2,200 ft (667m)<br />\nLongest trail: 2 miles (3.2km)</p>\n\n<p>30 feet of the white stuff every year, the 3,078 acre Winter Park Ski Resort averages the most annual snowfall of any major resort in Colorado and with with five terrain parks and over 140 trails ranging from bunny slopes to double black diamond, there is something for everyone!</p>\n\n<h4>Enhanced Tree Skiing</h4>\n\n<p>Over 100 acres of gladed, intermediate terrain and trails &ndash; Parry&#39;s Peek and Forever Eva. Just another way to experience Winter Park&#39;s 354&#39; of average annual snowfall.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/5f54f1cc99d3666">View Winter Park Map</a></p>\n\n<h3>Mary Jane Territory</h3>\n\n<p>Summit at North Cone: 11,200 ft<br />\nBase: 9,450 ft<br />\nVertical drop: 1,766 ft (538 m)<br />\nLongest trail: 4.5 miles (7.2 km)</p>\n\n<p>Mary Jane<sup>&reg;</sup> No Pain, No Jane<sup>TM</sup>. That&rsquo;s our motto. And after you feel the impact of the Jane&rsquo;s relentless long mogul runs, it&rsquo;ll be yours, too. Cruising at an altitude of 11,000 feet, here you may encounter a bit of turbulence. People come to Mary Jane when they want to feel a bit guilty for enjoying themselves too much. This beautiful, bumpy mountain has been voted #1 in North America for bump skiing. With over 70 trails on 3 different mountains (Mary Jane, Parsenn Bowl and Vasquez Cirque), each offering a unique skiing and riding experience, Mary Jane offers exactly the bump experience you are looking for. So if you&rsquo;re needing a push, wanting a challenge, or maybe just feeling you&rsquo;ve been naughty, try one of the runs down Mary Jane.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/2d090083d719c5b">View Mary Jane Ski Trail Map</a></p>\n\n<h3>Vasquez Ridge Territory</h3>\n\n<p>Summit: 10,700 ft<br />\nBase: 9,486 ft<br />\nVertical drop: 1,215 ft (370 m)<br />\nLongest trail: 1.4 miles (2.3 kilometers)</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/9d1d7e9cc57c890">View Vazquez Ridge Map</a></p>\n\n<h3>Parsenn Bowl Territory</h3>\n\n<p>Summit: 12,060 ft<br />\nBase: 10,348 ft<br />\nVertical drop: 1,714 ft (522 m)<br />\nLongest trail: 4.9 miles (7.9km)</p>\n\n<p>You start pretty much at the top of the world, and it only gets better from there. There isn&rsquo;t much that&rsquo;s not impressive at 12,060 feet. Parsenn Bowl is the kind of skiing you dream of, filled with vast empty spaces, beautiful gladed tree runs, unreal powder and the gorgeous opportunity for fresh tracks.</p>\n\n<h4>Panoramic Express Lift</h4>\n\n<p>The highest six-person lift in North America will whisk you to the 12,060&rsquo; summit of Parsenn Bowl with a view that lives up to its name...You can see all the way to Rocky Mountain National Park from the summit. Extending from the bottom of Mary Jane&rsquo;s Edelweiss trail to the top of Parsenn Bowl at 12,060 feet above sea level, the Panoramic Express provides skiers and riders access to over 1,123 acres of terrain including Parsenn Bowl, Vasquez Cirque and the Eagle Wind terrain. The Panoramic Express is a quicker ride to the top from the original 11 minutes it once took guests to get there to seven minutes.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/37d73e6b4188edc">View Parsenn Bowl Ski Trail Map</a></p>\n\n<h3>The Cirque Territory</h3>\n\n<p>Summit: 12,600 ft<br />\nBase: 10,400 ft<br />\nVertical drop: 2,060 ft (628 m)<br />\nLongest trail: 0.36 miles (0.58 km)</p>\n\n<p>This backcountry adventure area is for experts only. Steep doesn&rsquo;t really describe the 1,500 foot vertical drop. Drop in off a cornice at The Cirque. Over 687 acres of cornices, lips, and glades make The Cirque one incredible, intense, challenging experience for anybody. But for just the right skier, it could be adrenaline heaven.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/9d1d7e9cc57c890">View The Cirque Ski Trail Map</a></p>\n\n<h3>Eagle Wind Territory</h3>\n\n<p>Summit: 11,600 ft<br />\nBase: 10,000 ft<br />\nVertical drop: 1,600 ft (488 m)<br />\nLongest trail: 0.52 miles (0.84 km)</p>\n\n<h4>Eagle Wind Chairlift</h4>\n\n<p>A triple chairlift providing access the backside of Parsenn Bowl. Eagle Wind starts at an elevation of 10,316 feet along the Vasquez Cirque egress and extends up to the backside of Parsenn Bowl to 11,486 feet.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/5f54f1cc99d3666">View Eagle Wind Ski Trail Map</a></p>\n', 'yes', 'no'),
(9, '2016-06-06 20:39:35', '2016-06-07 18:26:50', 1, 8, 'b82fcceec2bca13', '<h3>Winter Park Ski Shuttle Service</h3>\n\n<p>The Winter Park Ski Shuttle, fondly called &ldquo;The Lift&rdquo;, operates free ski shuttle service between many of the condo and townhome complexes in Winter Park and Fraser.</p>\n\n<p>Most of our properties are located within walking distance of the resort or are on a free shuttle route. Our base area properties in Trademark, Slopeside, Winter Park Place and Base Camp are within walking distance and are on the free shuttle route as well.</p>\n\n<p>Please note that the Antlers and Lakota community HOA has discontinued the private Lakota Shuttle, effective for the 2011-2012 ski season. On demand shuttle service is being offered for $3.00 per person per one direction. Minimum of 3 passengers. Please ask us for additional details.</p>\n\n<p>Fraser Shuttle Update: Plans have been made to continue free shuttle service to the communities affected by the discontinuation of the Red and Purple shuttle lines in Fraser. Please ask us for additional details.</p>\n\n<h4>Winter Schedule</h4>\n\n<p>Winter Park Resort Shuttle: Trademark Route:<br />\nIn the winter, the Resort Shuttle &ldquo;Green Line&rdquo; makes a continuous circuit, passing in front of the Trademark community approximately every 20 minutes during the week day. On weekends and holidays, this route is called &ldquo;The Old Town Shuttle&rdquo; and passes by about every 10 minutes. Best shuttle service in Winter Park! The Resort Shuttle stops for pick-ups at the Ski Exchange and at the north gate entrance to the resort. Both stops are just outside of the Trademark Gate. On the way back, just ask the shuttle driver to drop you at the Trademark Gate. Please click the links below for the Resort Shuttle bus schedule. This information is accurate at the time of posting but shuttle schedules can always change. Call Shuttle Dispatch at <a href="tel:970-726-4163">970-726-4163</a> for current information.</p>\n\n<h4>Summer Schedule</h4>\n\n<p>In the summer time, the resort shuttle operates only on Saturdays and Sundays. Buses run between the central resort and Downtown Winter Park and Fraser. Buses leave the resort every hour on the hour, beginning at 10:00am. Last bus leaves the resort at 5:00pm. Buses depart for the resort from downtown Winter Park &amp; Fraser every hour on the half hour, beginning at 9:30am. The last bus departs downtown for the resort at 5:30pm. Please click the links below for the Resort Shuttle bus schedule. This information is accurate at the time of posting but shuttle schedules can always change. Call Shuttle Dispatch at <a href="tel:970-726-4163">970-726-4163</a> for current information.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/c358b9176e51df4">Day Bus &amp; Shuttle Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/37167c08b7bd805">Night Bus &amp; Shuttle Map</a></p>\n', 'yes', 'no'),
(10, '2016-06-06 20:50:05', '2016-06-06 22:16:46', 1, 9, 'b82fcceec2bca13', '<h3><a href="/activities/winter-activities">Winter Activities</a></h3>\n\n<p>It&rsquo;s not just about skiing. Check out all the other things wintertime in Colorado has to offer like snowmobiling, dog sled rides, hot air ballooning or a nice long soak in the local hot springs.</p>\n\n<h3><a href="/activities/summer-activities">Summer Activities</a></h3>\n\n<p>Summer in Winter Park features plenty of activities for the whole family like Alpine Slides, scenic chairlift rides to the top of the mountain, mountain biking, mini-golf, a human maze and more.</p>\n\n<h3><a href="/activities/activities-for-kids">Children&rsquo;s Activities</a></h3>\n\n<p>Traveling with kids? Winter Park is a family friendly destination and you don&rsquo;t need to spend a ton of money to show them a great time. Here are some inexpensive (or free) activities you can enjoy together.</p>\n\n<h3><a href="/activities/worship-in-winter-park">Worship</a></h3>\n\n<p>Would you like to attend church while on vacation in Winter Park? We have put together a list of local congregations including phone numbers, directions and service times so that you may worship during your visit.</p>\n', 'yes', 'no'),
(11, '2016-06-06 21:06:24', '2016-06-22 03:03:54', 1, 10, 'b82fcceec2bca13', '<h3>Activities at Winter Park Resort</h3>\n\n<h4>Scenic Chairlift Rides</h4>\n\n<p>Experience the majestic beauty of the Colorado Rockies without skis or snowboards. Take a winter scenic chairlift ride as a &ldquo;foot passenger&rdquo; to The Lodge at Sunspot. Non skiers can hop on the Zephyr Express Chairlift after 11am daily and enjoy a scenic ride up to The Lodge at Sunspot to meet the family for lunch. A 12-15 minute Zephyr Express chairlift ride will whisk you from the base area altitude of 9,000&rsquo; to the breathtaking Sunspot Summit at 10,700&rsquo;. Call <a href="tel:970-726-1616">(970)-726-1616</a> if you have any questions.</p>\n\n<h4>Scenic Snowcat Tours</h4>\n\n<p>Cozy up in a heated, enclosed 13-passenger snowcat and enjoy a two hour sightseeing tour of Winter Park Mountain. This loop tour travels across beginner, intermediate, and expert trails, making several stops along the way for photos. Call <a href="tel:970-726-1616">(970)-726-1616</a> or <a href="tel:970-726-5514">(970)-726-5514</a> ext 1727 for advance reservations.</p>\n\n<h4>Snowshoe Tours</h4>\n\n<p>Explore some of Winter Park&rsquo;s miles of snowshoe trails with a knowledgeable guide. This relaxing walk through the backcountry is perfect for non-skiers and first time snowshoers. The tour route travels off-the-beaten-path along wildlife game trails and summer mountain biking trails. Learn more about native plants and animals and enjoy the peaceful quiet of the forest. Call the Tour Center at <a href="tel:970-726-1616">(970)-726-1616</a> or call <a href="tel:970-726-5514">(970)-726-5514</a> ext 1727.</p>\n\n<h4>Slope Tracker</h4>\n\n<p>The souvenir that proves you really did take that run. SlopeTracker uses GPS technology to track vertical feet, calories burned, distance traveled and so much more.</p>\n\n<h4>NASTAR Racing</h4>\n\n<p>The Winter Park NASTAR race course is on the lower portion of Cranmer, just above the Snoasis mid-mountain lodge. Race against the clock with your friends or by yourself. Skiers and snowboarders of all abilities are welcome to race. Simply stop by the start house at the top of the course between 11am and 2:30pm daily from mid-December through April 12 to sign up, and you&rsquo;ll be ready to go! Call <a href="tel:970-726-1590">970-726-1590</a> or <a href="tel:303-316-1590">303-316-1590</a> for more information.</p>\n\n<h4>Free Guided Mountain Tours</h4>\n\n<p>Tours are offered daily from mid-December through the beginning of April, snow conditions and terrain opening permitting and are a great way to see our mountain, to learn how to get around and find the locals&rsquo; favorite places. Tours last a maximum of 2 hours. All guests must meet and sign-up at the Sunspot Map Kiosk, at the top of the Zephyr Express chairlift, at least 15 minutes prior to tour departure. Tour group size may be limited based on guide availability. Tours are offered on intermediate terrain for skiers and riders. All participants must be intermediate level or better. Guests will be placed into the appropriate tour based on their skiing or riding ability. Children are welcome, only if accompanied by an adult guardian. Lift ticket required.</p>\n\n<h4>Mountaintop Nondenominational Services</h4>\n\n<p>Outdoor services are held every Sunday, December 11, 2005 through April 16, 2006 at 12:45 PM at the top of the Zephyr Express chairlift. A lift ticket is required.</p>\n\n<h3>Activities Outside the Resort</h3>\n\n<h4><a href="http://www.winterparkresort.com/events-and-activities/activities/resort-activities/winter-activities/snow- shoe-tours.aspx" target="_blank">Snowshoeing</a></h4>\n\n<p>Winter Park has some of the best snowshoe trails in Colorado! You can get a trail map at the Chamber of Commerce in town, or go on a guided tour below. You can rent snowshoes at the Ski Broker in Fraser. Redfeather Snowshoe Rentals are also available at Balcony House Guest Services, located in the Balcony House at the base of Winter Park Resort. For tour reservations and information call <a href="tel:800-729-7907">800-729-7907</a> or <a href="http://www.winterparkresort.com/events-and-activities/activities/resort-activities/winter-activities/snow- shoe-tours.aspx" target="_blank">click here</a> to learn more.</p>\n\n<h4><a href="http://www.devilsthumbranch.com/experiences/winter-experiences/snowshoeing" target="_blank">Snowshoeing at Devils Thumb</a></h4>\n\n<p>You can also rent snowshoes at Devil&rsquo;s Thumb Ranch, <a href="tel:800-933-4339">800-933-4339</a> or check their <a href="http://www.devilsthumbranch.com" target="_blank">web site</a>. They have a miles of trails -which meander through open meadows and through the trees beneath the panoramic backdrop of the Continental Divide.</p>\n\n<h4><a href="http://www.devilsthumbranch.com/experiences/cross-country-skiing" target="_blank">Cross Country Skiing</a></h4>\n\n<p>Devil&rsquo;s Thumb Ranch <a href="tel:800-933-4339">800-933-4339</a> - Best cross country skiing in the area. You can rent equipment and head out onto countless trails. Visit their <a href="http://www.devilsthumbranch.com" target="_blank">web site</a> for more information.</p>\n\n<h4><a href="http://www.grandadventures.com" target="_blank">Snowmobiling with Grand Adventures</a></h4>\n\n<p>Enjoy a two-hour guided tour to the Continental Divide or choose from five great riding locations for beginners through advanced riders. <a href="http://www.grandadventures.com" target="_blank">Reserve your guided snowmobile tour here</a> or call <a href="tel:800-726-9247">(800) 726-9247</a>.</p>\n\n<h4><a href="http://www.dogsledridesofwinterpark.com/" target="_blank">Dog Sled Rides of Winter Park</a></h4>\n\n<p>Bring the whole family to share in a once in a lifetime experience right here in Winter Park, Colorado. Whether you come out for the 45 minute ride, or learn how to mush yourself, you are guaranteed to have fun in the snow with some of their 80 sled dogs. The trails are private so they do not run into snowmobilers or skiers, just the occasional moose. Kennel tour available by reservation only. <a href="http://www.dogsledridesofwinterpark.com/" target="_blank">Learn more</a>.</p>\n\n<h4>Sleigh Rides at Sombrero Stables</h4>\n\n<p>Over the River and rough the Woods. From the Beaver Village location, enjoy an old fashioned sleigh ride through the trees and meadows along the Fraser River. Stop at a &ldquo;cowboy camp&rdquo; for some hot chocolate and marshmallows around the campfire. At Snow Mountain Ranch a Dinner Sleigh Ride is also offered. Cuddle up under the blankets and enjoy a 40 minute ride through the meadows and trees while the stars and moon light your way. Return to a warm &amp; cozy dining hall for dinner. Call <a href="tel:970-722-0100">970-722-0100</a> for times, rates and reservations.</p>\n\n<h4><a href="http://hotsulphursprings.com/" target="_blank">Hot Sulphur Springs</a></h4>\n\n<p>Just a 45 minute drive from Winter Park and you can bathe where the Ute Indians once bathed and healed mind, body, and spirit in their sacred waters... at 7,600 feet. In operation continually for the past 140 years, there are now 22 pools and private baths plus a new jet spa and outdoor oriental bath and solarium pool. They have massages and body wraps too. Many of the upper and private pools do not allow children to enter. They have to stay in a specific area. Learn more here or call <a href="tel:970-725-3306">(970) 725-3306</a>.</p>\n\n<h4>Sledding at Fraser Tubing Hill</h4>\n\n<p>Bring the whole family for a snow tubing adventure. This is a hit to everyone we&rsquo;ve ever talked to whether they are 3 years or 70 years old. Located 1/2 mile behind the Alco shopping center in Fraser. Go through the town of Winter Park on I-40 to Fraser - turn left at the first (main) traffic light and you will see it ahead of you. Groups welcome. They do charge about $15/ hour for kids and $17/hour for adults. Kids under 3 not permitted on the hill. Be sure to wear a helmet! Call <a href="tel:970-726-5954">(970) 726-5954</a> for more information.</p>\n\n<h4>Ice Skating at Cooper Creek Square Rink</h4>\n\n<p>Skating is free and skates may be rented at nearby Christy Sports (726-8873) or the Viking Lodge (726-8885). Located near Cooper Creek shopping center, in the middle of town on the left-hand side (large open air shopping center).</p>\n\n<h4><a href="http://www.grandadventureballoon.com/home.html" target="_blank">Grand Adventure Hot Air Balloon Tours</a></h4>\n\n<p>How does a one hour hot air balloon ride followed by a champagne breakfast sound? For reservations and information call <a href="tel:970-887-1340">(970) 887-1340</a> or visit their <a href="http://www.grandadventureballoon.com/home.html" target="_blank">website</a>. <em>Tip: Always ask for the first available flight and call ahead before leaving for the lift off location.</em></p>\n', 'yes', 'no'),
(12, '2016-06-06 21:36:08', '2016-06-06 21:54:15', 1, 11, 'b82fcceec2bca13', '<p>Summer in Winter Park features plenty of activities for the whole family. Check out Colorado&rsquo;s longest Alpine Slide, take a scenic chairlift ride to the top of the mountain or cruise down the mountain on your bike. And enjoy mini-golf, a human maze and much more.</p>\n\n<p>The resort offers all of the following activities:</p>\n\n<ul>\n	<li>Park Pass</li>\n	<li>Alpine Slide - Colorado&rsquo;s longest</li>\n	<li>Chairlift Rides</li>\n	<li>Climbing Wall</li>\n	<li>Disc Golf</li>\n	<li>Human Maze</li>\n	<li>Leaps &amp; Bounds Bungee</li>\n	<li>Mini Golf</li>\n	<li>Rock-n-Roll Gyro Extreme</li>\n	<li>Mountain Biking</li>\n	<li>Mountain Boards</li>\n</ul>\n\n<h3>Mountain Biking</h3>\n\n<p>Winter Park &amp; Grand County boasts some of the best mountain biking opportunities anywhere in Colorado. From heart-pounding high altitude climbs to fairly level trails winding along the valley floor, there is something here for everyone. 600 miles of marked, mapped and user-friendly trails wind through the fields of wild flowers, over the tops of the mountain peaks and back into the forest. Winter Park Resort has over 50 miles of lift accessible varied terrain trails and 3 terrain parks. Take your bike on specially equipped Zephyr Chairlift to the top, chose a route (color-coded by the level of difficulty) and bomb down the mountain or find a trail that will hook up with the other 600 miles of rails in the area. Enjoy the ride!</p>\n\n<p>Pick up a free copy of The Official Mountain Bike &amp; Trail Guide to Winter Park and The Fraser Valley at the Chamber of Commerce.</p>\n\n<h3>Fishing</h3>\n\n<p>There are many fishing options in Grand County and the nearby area. With 1,000 miles of streams, 1,000 acres of high mountain lakes and 11,000 acres of reservoirs, a fishing trip to this particular area of Colorado will reward anglers of all levels of expertise. Trout and salmon are the most sought after prizes in mountain fishing and all through Grand County, lurking below the water&rsquo;s surface you will find Mackinaw and Kokanee salmon as well as rainbow, brook, German brown and cutthroat trout.</p>\n\n<p>Grand County streams enticed President Eisenhower here in the 1940&rsquo;s and 50&rsquo;s. Grey Reef was #1 on the American Angler list of the 25 best places to go for big fish. Whether young or old, on private waters or public, fishing by wading or by boat, the waters of Grand County have something for everyone.</p>\n\n<p>We highly recommend Jeff Ehlert, Guide &amp; Owner of Grand County Fishing Company. Give him a call at <a href="tel:970-726-5231">(970)-726-5231</a> or visit his <a href="http://www.grandflyfishing.com" target="_blank">website</a>.</p>\n\n<p>Need a fishing license, poles, rods, reels or just some local information? The experienced guides at Grand County Fishing can help you make the most of your time on the water. From insider knowledge to equipment, rentals and supplies for anglers of all ages and abilities, Grand County Fishing Company is ready to help. Visit Jeff and his staff at his shop in Fraser, Colorado. Located on Hwy 40 in the Alco Shopping Center in Fraser, just across from the Safeway Grocery Store.</p>\n\n<p>Jeff offers wade and float trips, public and private water, full and half day trips. He can custom tailor a guided trip for you. Call <a href="tel:970-531-9998">(970)-531-9998</a> to book your Guided trip now. Whatever the season, Grand County Fishing Company can take you to the best fishing spots. <a href="http://www.grandflyfishing.com" target="_blank">Click the link</a> for Grand County Fly Fishing Tips.</p>\n\n<h3><a href="http://www.grandadventureballoon.com/home.html" target="_blank">Grand Adventure Hot Air Balloon Tours</a></h3>\n\n<p>A wonderful way to see the Rockies. A one hour tour followed by a champagne breakfast. Local tip: Always ask for the first available flight. Flights may be canceled due to bad weather or high winds aloft. Call Grand Adventure Balloon Tours before leaving for the lift off location. For reservations and information call <a href="tel:970-887-1340">(970) 887-1340</a> or <a href="http://www.grandadventureballoon.com/home.html" target="_blank">visit their website</a>.</p>\n\n<h3>White Water Rafting</h3>\n\n<p>Enjoy an action packed ride thrilling ride in Colorado&rsquo;s white water or take a leisurely float trip. Either way, it&rsquo;s sure to be a good time.</p>\n\n<p>Half-day, full day and overnight trips are available. Check with the rafting company for details and rates.</p>\n\n<h4>Red Tail Rafting</h4>\n\n<p>Call <a href="tel:970-726-1197">970-726-1197</a> or visit their <a href="http://www.redtailrafting.com" target="_blank">web site</a>.</p>\n\n<h4>Adventures in Whitewater</h4>\n\n<p>Call <a href="tel:970-887-1771">(970) 887-1771</a> or visit their <a href="http://www.adventuresinwhitewater.com" target="_blank">web site</a>.</p>\n\n<h3>Horse-back Riding</h3>\n\n<p>Take a step back in time and experience the adventure and romance of cowboy country. Explore the scenic meadows and mountain grandeur of Colorado&rsquo;s high country from astride your trusty steed. You will travel on some of the same trails that have been used for thousands of years. Ute and Arapahoe Indians once crossed these mountain passes seeking elk and deer. Later came the mountain men, trappers and prospectors. All crossed the high country on horseback. Come on out and Ride the Rockies&ndash;trail rides, wagon rides, breakfast or dinner rides are all waiting for you.</p>\n\n<h4>Sombrero Stables</h4>\n\n<p>In Winter Park: <a href="tel:970-722-0100">(970)722-0100</a><br />\nIn Snow Mountain Ranch: <a href="tel:970-887-1999">(970)-887-1999</a><br />\nIn Grand Lake: <a href="tel:970-627-3514">(970)-627-3514</a></p>\n\n<h4>Monarch Stables &amp; Wagon Rides</h4>\n\n<p>In Fraser: Call <a href="tel:970-726-5376">970-726-5376</a></p>\n\n<h4>Blue Sky Outfitters</h4>\n\n<p>In Tabernash: Call <a href="tel:970-726-5632">970-726-5632</a></p>\n\n<h3>Golfing</h3>\n\n<p>Destination Golf at 8,000 feet! Watch your ball fly 15% farther framed by spectacular mountain views. Choose from four outstanding, distinctively different golf courses in and around Winter Park and Grand County.</p>\n\n<h4>Pole Creek Golf Club</h4>\n\n<p>Pole Creek Golf Club is a tree-lined, links-style 27-hole course rated by Golf Digest in 1998 as the &lsquo;Best New Course in America&rdquo; and &ldquo;Number One Place to Play in Colorado&rdquo;. Three distinct 9-hole courses (The Ranch, The Meadow, and The Ridge) incorporate native lodgepole pines, valley meadows, sagebrush and a variety of water hazards. Pro golfer JT Thompson calls the Ridge &ldquo;the most spectacular View in Colorado&rdquo;. Call <a href="tel:1-800-511-5076">1-800-511-5076</a> for tee-times.</p>\n\n<h4>Grand Lake Golf Course</h4>\n\n<p>Known as the &ldquo;Crown Jewel of Mountain Courses&rdquo; this 18-hole mountain course is adjacent to Rocky Mountain National Park. Set amidst a pristine mountain setting, the challenging fairways offer dramatic views of the surrounding snow-capped peaks of the Never Summer Range and Grand Lake and glimpses of wildlife sharing the tees. Call <a href="tel:970-627-8008">970-627-8008</a>.</p>\n\n<h4>Headwaters Golf Course at Granby Ranch</h4>\n\n<p>An open style 18-hole links style course tucked between the waters of the Fraser River and the majestic Rocky mountains. Natural obstacles including wetlands, lakes, trees and large deep bunkers o er golfers of every ability an exceptional experience. Call <a href="tel:888-283-7458">888-283-7458</a>.</p>\n\n<h4>Grand Elk Ranch &amp; Club</h4>\n\n<p>The newest addition to Grand County’s mountain golf paradise. Grand Elk is Colorado’s first Heathland-style golf course. Featuring gently rolling fairways and strategically placed hazards this course offers five sets of tee boxes and views of protected wetlands that are habitat for hundreds of birds. Call <a href="tel:866-272-9822">866-272-9822</a>.</p>\n\n<p>Access Winter Park has some great summertime specials. We can arrange golf vacation packages and book your tee times. Choose from our selection of condos, townhomes and private homes for all your Winter Park vacation lodging needs.</p>', 'yes', 'no');
INSERT INTO `default_pages_standard` (`id`, `created`, `updated`, `created_by`, `ordering_count`, `page_hero`, `page_content`, `display_properties_subnavigation`, `display_features`) VALUES
(13, '2016-06-06 22:05:16', '2016-06-06 22:07:41', 1, 12, 'b82fcceec2bca13', '<p>Winter Park is a family friendly destination and you don&rsquo;t need to spend a ton of money to show the kids a great time. There are lots of free things to do to keep the kids entertained - like the free sledding hill at Hideaway Park, the free ice skating rink at Cooper Creek Square and free skiing at Winter Park for kids ages five years and under.</p>\n\n<h3>Winter Activities</h3>\n\n<h4>Hideaway Park Sledding Hill - free</h4>\n\n<p>A fun little sledding hill with sleds provided! It&rsquo;s a huge hit for kids of all ages, and best of all, it&rsquo;s completely free. Just get the kids bundled up and let &lsquo;em loose on the sleds. Feel free to stop by the Visitor Center across the street for more information on things to do while the kids are at the hill. Call <a href="tel:970-726-4118">970-726-4118</a> or <a href="tel:800-903-7275">800-903-7275</a> for more info. Click here to see a map of downtown Winter Park with Hideaway Park&rsquo;s location.</p>\n\n<h4>Cooper Creek Square Ice Skating Rink - free</h4>\n\n<p>Try the covered ice skating rink right across from the Cooper Creek Square shopping center. It is free for all to use. Don&rsquo;t have your own skates? Go to the Viking Lodge or Christy Sports, right next door to get some.</p>\n\n<h4>Snowshoe Hikes - free</h4>\n\n<p>Take a day off from skiing and explore the natural beauty of our area. The Winter Park Visitor Center offers free guided snowshoe hikes every Fri-Sun. Snowshoes are provided, so all you need to do is tip your guide a few bucks. Be sure to call to sign up, since there is a limit on how many people can go. eir number is <a href="tel:970-726-4118">970-726-4118</a> or <a href="tel:800-903-7275">800-903-7275</a>. Have your own snowshoes and want to explore on your own? You can also rent snowshoes from <a href="http://wpskibroker.com/" target="_blank">The Ski Broker</a>, at four locations in Winter Park (<a href="tel:970-726-8882">970-726-8882</a>). Go grab a trail map at the Visitor Center and head out to explore our winter wonderland.</p>\n\n<h4>Snow Mountain Ranch Activities - affordable</h4>\n\n<p>Also known as the YMCA of the Rockies, this place has lots of things to do, and you don&rsquo;t have to pay a lot of money to do them. You don&rsquo;t need to be a member to take part of the fun, but it&rsquo;s even cheaper if you are. There is a sledding &amp; tubing hill, covered outdoor ice skating rink, indoor pool, indoor climbing wall, miles and miles of cross-country ski &amp; snowshoe trails, and sleigh rides with Sombrero Stables (we have discounts). For most activities you only pay for a daily activity pass ($10-$15 for an entire family), and there is a minimal fee to rent sleds, tubes or ice skates. Call <a href="tel:970-887-2152">970-887-2152</a> ext 4173 for information.</p>\n\n<h4>Fraser Tubing Hill - expensive</h4>\n\n<p>Located on Country Road 72, behind the Alco shopping center, the tubing hill in Fraser is a favorite for all ages. Speed down the hill by yourself or in a group, and then let the tube-tow transport you and your tube right back up the hill. Descend individually, in tandems, or group &ldquo;clusters&rdquo; where the speeds are the highest, and the run-outs the longest! Be sure to rent a helmet before heading out to the hill. Helmets can be rented at the Ski Broker, (<a href="tel:970-726-8882">970-726-8882</a>) located in the Alco Shopping Center, before heading up to the tubing hill. A warming house, hot drinks and snacks are also available. Open daily during the height of the season though the hours may vary. Call <a href="tel:970-726-5954">970-726-5954</a>. Hourly rates are $17 for adults and $15 for children ages 7&ndash;15. Kids ages 3&ndash;7 ride free in an adult&rsquo;s lap. Children under 3 years old are not permitted on the hill.</p>\n\n<h4>Colorado Adventure Park - expensive</h4>\n\n<p>Located on County Road 72 (CR 721), behind the Alco Shopping Center and next to the Fraser Tubing Hill, Colorado Adventure Park o ers tubing, airboards and snow scoots. Grab a tube and take an easy ride up the Magic Carpet lift. There is a variety of terrain from slow &amp; easy to fast &amp; wild to satisfy everyone from ages 3 and up. Airboards are faster and can be steered with an easy lean. Airboarders have their own terrain park. For ages 13 and up. Snow Scoots are Polaris 120 snowmobiles and are ridden along a track in the meadow. For kids age 6 and up but weigh 130 pounds or less. Free sledding on a kid friendly hill. Complimentary sleds too!. Call <a href="tel:970-726-5779">970-726-5779</a> for info and reservations. Check with us before you go&ndash;AWP VIP Gold Medallion Holders get discounts!</p>\n', 'yes', 'no'),
(14, '2016-06-06 22:16:14', NULL, 1, 13, 'b82fcceec2bca13', '<h3>Winter Park Congregation Directory</h3>\n\n<h4><a href="http://www.fraservalleybaptist.org/" target="_blank">Fraser Valley Baptist Church</a></h4>\n\n<p>100 Doc Susie Avenue<br/>\nFraser, CO<br/>\n<a href="tel:970-726-8020">970-726-8020</a><br/>\nPastor Pat O’Connell<br/>\nServices: Sunday 9:00 a.m. and 6:30 p.m.<br/>\n(Mountaintop Services Summer and Winter 12:45 p.m. at the top of the Zephyr)<br/>\nDirections: Hwy 40 to CR 72 in Fraser. Left at the light, right on Elk Creek Drive. Follow Elk Creek Drive to Fraser Valley Baptist Church on the right.</p>\n\n<h4><a href="http://lordofthevalley.org/" target="_blank">Lord of the Valley Lutheran Church</a></h4>\n\n<p>63294 US Hwy 40<br/>\nGranby, CO<br/>\n<a href="tel:970-887-9252">970-887-9252</a><br/>\nPastor Joel Martin<br/>\nServices: Saturday 5:30 p.m.<br/>\nSunday 9:30 a.m.<br/>\nDirections: Across from Sol Vista, next to City Market</p>\n\n<h4>St. Bernard of Montjoux Church (Catholic)</h4>\n\n<p>275 E. Rendezvous Rd.<br/>\nFraser, CO<br/>\n<a href="tel:970-727-4588">970-727-4588</a> or <a href="tel:970-887-0032">970-887-0032</a><br/>\nFather Francis J. Gerber, Pastor<br/>\nServices: Saturday 7:00 p.m., Sunday 7:00 a.m. Wednesday 8:30 a.m.<br/>\nDirections: Hwy 40, right on Rendezvous Rd.</p>\n\n<h4><a href="http://www.eternalhills.org/" target="_blank">Church of the Eternal Hills (Presbyterian)</a></h4>\n\n<p>100 Meadows Blvd.<br/>\nTabernash, CO<br/>\nRev. Gretchen Bretz and Rev. Paul Bretz<br/>\nServices: Sunday 10:30 a.m.<br/>\nDirections: Hwy 40 and Meadows Blvd.</p>\n\n<h4><a href="http://www.wpcc4him.org/" target="_blank">Winter Park Christian Church (Non-Denominational)</a></h4>\n\n<p>274 Ponderosa<br/>\nTabernash, CO<br/>\nPastor Doug Toller<br/>\n<a href="tel:970-887-9784">970-887-9784</a><br/>\nServices: Sunday 8:30 a.m., 10:30 a.m. & 6:00 p.m.<br/>\nDirections: Hwy 40, left at Meadows Blvd, left at Ponderosa.</p>\n\n<h4><a href="http://stjohnsgranby.dioco.org/" target="_blank">St. Johns (Episcopal)</a></h4>\n\n<p>390 E. Garnet Ave.<br/>\nGranby, CO<br/>\n<a href="tel:970-887-2742">970-887-2742</a><br/>\nReverend Spencer Carr<br/>\nServices: Sunday 7:30 a.m., 9:00 a.m.<br/>\nDirections: Hwy 40 in Granby, right at 4th St., left at Garnet Ave.</p>\n\n<h4><a href="http://stjohnsgranby.dioco.org/About%20Us/services-at-cranmer-me- morial-chapel.html" target="_blank">Cranmer Memorial Chapel (Episcopal)</a></h4>\n\n<p>75 High Country Rd<br/>\nWinter Park, CO<br/>\n<a href="tel:970-887-2742">970-887-2742</a><br/>\nServices: Saturday 5:00 p.m.<br/>\nDirections: Hwy 40 in Winter Park, right at High Country Rd., small chapel on the left.</p>\n\n<h4>Grand River Assembly (Assembly of God)</h4>\n\n<p>257 W. Topaz Ave.<br/>\nGranby, CO<br/>\n<a href="tel:970-887-3522">970-887-3522</a><br/>\nServices: Sunday 10:30 a.m.<br/>\nDirections: Hwy 40 in Granby, right at Mesa St, left at Topaz.</p>', 'yes', 'no'),
(15, '2016-06-06 22:26:57', '2016-08-29 12:49:36', 1, 14, 'b82fcceec2bca13', '<h3>Save When You Stay</h3>\n\n<p>We believe in supporting our local business community and our local business community believes in supporting our guests. Here is a list of some of the discounts and special deals Access Winter Park can offer you thanks to just some of those amazing business owners.</p>\n\n<h4>Discount Lift Tickets &amp; SKI SEASON PASSES 2016&ndash;2017 Ski Season</h4>\n\n<p><strong>Here&rsquo;s the deal:</strong></p>\n\n<p>Best Deal for 2016-2017 season at Winter Park is the FOUR PASS. Valid for any four days during the season. No black-out dates. Price is currently $179, Price is subject to change at any time. Prices do go up as the ski season approaches so lock in this great rate now. It will only get more expensive as time goes on. Sometime in late fall this deal will no longer be available. Price is subject to change without notice.</p>\n\n<p>WINTER PARK SEASON PASS 2016-2017: Currently priced at $409. Unlimited access at Winter Park Resort. Restricted Access at 8 other ski areas. No Blackouts. Price is subject to change without notice.</p>\n\n<p>ROUTE 40 SEASON PASS 2016-2017: Unlimited Access at Winter Park Resort, 4 days at Steamboat, and 3 days at Mount Hood. Price is subject to change without notice.</p>\n\n<p>ROCKY MOUNTAIN SUPER PASS PLUS 2016-2017: Currently priced at $569. Unlimited access at Winter Park Resort, Copper Mountain &amp; Eldora Mountain Resort. Restricted Access for 6 days at Steamboat, 3 days at Crested Butte, and 3 days at Alyeska Resort. No blackouts. Price is subject to change without&nbsp; notice.</p>\n\n<p>ROCKY MOUNTAIN SUPER PASS 2016-2017: Currently priced at $499. Unlimited access at Winter Park Resort, &amp; Copper Mountain. No blackouts.</p>\n\n<p>Give us a call at <a href="tel:303-704-7291">303-704-7291</a> and we can arrange to have your passes or lift tickets ready &amp; waiting for you! Daily ticket prices not yet available. Supplies of discount lift tickets are limited. Reserve yours NOW while supplies last.</p>\n\n<p>Book a stay in any of our properties and you are eligible to purchase discount lift tickets.</p>\n\n<p>Please give us a call a <a href="tel:303-704-7291">303-704-7291</a> if you have any questions.</p>\n\n<h4>Stay and Ski Packages 2016&ndash;2017 Season</h4>\n\n<p>We can customize special lodging and lift ticket packages for you and your party. To get a quote call <a href="tel:303-704-7291">303-704-7291</a> and let us know which property would like to reserve as well as and the number of adult and child skiers per each stay.</p>\n\n<h4>Equipment Rental</h4>\n\n<p>Whether you need to skis, snowboards, snow shoes, bikes or even a jacket our local rental partners have you covered at discounted prices. Many even offer front door delivery.</p>\n\n<p><a class="btn btn-side-column btn-link" href="/special-offers/equipment-rental">Get Deals on Equipment Rental</a></p>\n\n<h4>Save On Transportation Services</h4>\n\n<p>Check out these highly recommended partners for great deals on airport shuttle services from Denver Airport to Winter Park as well as charter services to anywhere in Colorado.</p>\n\n<p><a class="btn btn-side-column btn-link" href="/special-offers/transportation">View Transportation Service Offers </a></p>\n\n<h4>Discounts On Local Attractions</h4>\n\n<p>No matter what time of year you decide to vacation at Winter Park, there&rsquo;s always something to do. And, thanks to some great local merchant partners, we can o er our guests discounts on many of these fun activities.</p>\n\n<p><a class="btn btn-side-column btn-link" href="/special-offers/local-attractions">Save on Local Attractions</a></p>\n', 'yes', 'no'),
(16, '2016-06-07 17:49:44', '2016-06-17 20:24:07', 1, 15, 'a754c2696d058cf', '<h3>Getting Started</h3>\n\n<p>Access Winter Park Lodging Company has a great selection of privately owned rental homes, townhomes and condos for your Winter Park, Colorado vacation. We have studios, 1 bedroom, 2 bedroom, 3 bedroom, &amp; 4+ bedroom Winter Park vacation lodging rentals to choose from. From large luxurious ski-in/ski-out homes to a cozy studio condominium nestled in the trees along the river, we have something for everyone. We have ski-in/ski-out homes, handicap accessible condos, condos within walking distance of the resort, rental properties on the free resort shuttle and in downtown Winter Park next to the shopping and the restaurants, and properties tucked away in the surrounding communities of Fraser and Tabernash. If you&rsquo;re looking for a Winter Park, Colorado rental property, you&rsquo;ve come to the right place. Don&rsquo;t see exactly what you&rsquo;re looking for? Call us and we&rsquo;ll help you find it.</p>\n\n<h5>Your perfect Colorado vacation starts here!</h5>\n\n<ul>\n	<li>Look over the properties we have available. Detailed property descriptions, location maps and plenty of photos help ensure you never have any surprises.</li>\n	<li>Call or email us with questions about any of our properties. Call 303-704-7291 or email accesswinterpark@mac.com.</li>\n	<li>Once you&rsquo;ve found the right home, we&rsquo;ll send you a Guest Agreement and a credit card authorization. A refundable security deposit and 50% of the rental amount is due at the time you return the signed Guest Agreement to us. The remaining 50% rental amount is due 60 days before your arrival.</li>\n	<li>We offer the option of a Refundable Security Deposit or the purchase of an <a href="http://www.rentwinterpark.net/images/AIG_TravelGuard_AccidentalDamageRentalInsurance_DOC.pdf" target="_blank">Accidental Rental Damage Insurance&nbsp;policy</a>.</li>\n	<li>Access Winter Park offers optional travel insurance (trip cancellation and trip interruption) Our All Seasons Travel Plan can cover you and your vacation investment when the unexpected happens.</li>\n	<li>Payment is made by check or credit card. There is a 3.5% credit card processing fee. We are happy to hold your reservation for several days with a credit card guarantee until payment by check can reach us.</li>\n	<li>Review our Cancellation policy.</li>\n	<li>We have great discounts on ski rental equipment, up to 50% off on lift tickets and more.</li>\n	<li>We offer concierge services - let us know if you want groceries delivered, a hot meal waiting or would like to arrange for a catered meal or a personal chef.</li>\n	<li>Check-in information, directions, maps and additional information will be sent to you well before your arrival.</li>\n	<li>A Guest hot line for assistance anytime during your stay is available 24/7.</li>\n	<li>Arrive, relax and enjoy our western hospitality and the Colorado experience!</li>\n</ul>\n\n<p>We are passionate about Colorado and can provide tips and suggestions that will truly make a difference to your overall Winter Park vacation.</p>\n\n<p>Now, begin your search for the best in Winter Park vacation homes, townhomes and condos!</p>\n\n<h6>Already a registered guest? <a href="/assets/arrival-and-checkin">Get information about your property here.</a></h6>\n', 'yes', 'no'),
(17, '2016-06-07 17:55:54', '2016-08-17 23:12:18', 1, 16, 'd7f214d3d40305d', '<h3>Download your Arrival Packet here.</h3>\n\n<p>Select the property in which you have a reservation to access all of the information specific to that property.</p>\n\n<p>If you have any questions or problems, please give us a call or send us a message.</p>\n\n<h6><u>Welcome &amp; Arrival Packets:</u></h6>\n\n<p><a class="pyro-file" href="{{ url:site }}files/download/b24bdd23f1dda42">Antlers #401 at Lakota</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/8d2543001ec26d9">Aspen Hideaway @ Bavarian Village #11</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/1ad18b9f4601673">Base Camp at Jane Creek #460</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/ed22d8f20be6056">Base Camp at Jane Creek #490</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/dfa1f4f34b59eea">Base Camp at Jane Creek #496</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/6dfe77d3962152b">Divide View Penthouse</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/6329089aadcb1c3">Dreamcatcher #180 at Lakota</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/0e59a142cfa0098">Indian Peaks at Red Quill</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/0894ea4bce08a53">Slopeside #100</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/d290b57892cb871">Slopeside #102</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/2d91c5329859ea9">Slopeside #200</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/27a4c6d0d1b0bdc">Slopeside #203</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/87d34dfb8b7569b">Slopeside #206</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/034771612f2f53b">Telemark #572</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/8d8849e8ce35ae2">Trademark 3-1</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/a16a49ae042b435">Trademark 3-2</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/a003aa7d5fa56f5">Trademark 3-4</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/1296e11c3fb1774">Winter Park Place #8</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/122248c39eecc5f">Winter Park Place #14</a><br />\n<a class="pyro-file" href="{{ url:site }}files/download/74143d77351dee1">Zephyr Riverside</a></p>', 'no', 'yes'),
(18, '2016-06-07 18:19:47', '2016-06-07 18:21:41', 1, 17, '72a08406462780c', '<h3><a href="http://www.travelguard.com/agentlink.asp?ta_arc=164825&amp;pcode=&amp;agencyemail=accesswinterpark@mac.com" target="_blank">Travel Guard Travel Insurance</a></h3>\n\n<p>Travel Guard provides travel insurance coverage for your reservation. To view details regarding the travel insurance plan, visit Travel Guard&rsquo;s <a href="http://www.travelguard.com/agentlink.asp?ta_arc=164825&amp;pcode=&amp;agencyemail=accesswinterpark@mac.com" target="_blank">website</a> for additional information and pricing.</p>\n\n<p>Alternatively, you may opt to call Travel Guard at <a href="tel:877-249-5376">877-249-5376</a> and speak to a licensed agent regarding the travel insurance options available for your stay. You will need to reference our account, Access Winter Park, account #164825 as well as the specific property and the dates of your stay.</p>\n\n<p><a class="btn btn-side-column btn-link" href="http://www.travelguard.com/agentlink.asp?ta_arc=164825&amp;pcode=&amp;agencyemail=accesswinterpark@mac.com)" target="_blank">Take Me to the Travel Guard Site</a></p>\n', 'yes', 'no'),
(19, '2016-06-07 18:48:18', '2016-06-22 03:26:29', 1, 18, 'f5e45e95ab21080', '<h3>Why Choose Access Winter Park</h3>\n\n<p>We&rsquo;ve been Colorado vacation property owners for years. Having been owners we are aware of the needs of resort community property owners and guests. We have been successful in renting our own property directly to visitors and we have experienced some of the challenges of working with traditional property management companies. From our experience and success to date we&rsquo;ve put together an arrangement that works for everyone. And we&rsquo;ve had strong demand from our existing and returning guests for additional vacation rentals in Winter Park, as well as requests from Winter Park homeowners for our services.</p>\n\n<p>We have deliberately chosen to remain a small business, with a limited number of select properties. By remaining small, we can continue to offer personalized and custom tailored services to both owners and guests. We understand that each property owner has different needs and different goals so with that in mind, we work with you to establish a model that best suits your needs.</p>\n\n<p>We market your property (web presence &amp; print media), book your property and can handle everything from check-in to any issues that may arise.</p>\n\n<p>We&rsquo;ve been very successful in our rental operations in Winter Park and will be launching additional properties later this summer.</p>\n\n<h3>The Difference</h3>\n\n<p>Here&rsquo;s what&rsquo;s different about working with Access Winter Park and why it might be the right solution for you:</p>\n\n<ul>\n	<li>We do most of the challenging work for you - finding the right guests for your home, finalizing all terms and maintain ongoing guest services during each course of stay.</li>\n	<li>We offer assistance to owners and guests 24 hours a day, 7 days a week.</li>\n	<li>We can help plan your vacation itineraries.</li>\n	<li>We have a concierge program designed to assist guests with groceries, have a meal ready and waiting, arrange catered meals or have a personal chef cook you dinner.</li>\n	<li>We book guests into your property, according the the dates you make available.</li>\n	<li>We provide owners with a secure online availability status calendar allowing you to block out dates when you are using your home and see when we&rsquo;ve booked your property.</li>\n	<li>You can make your property available as much or as little as you desire&ndash;no penalties for only renting your property one day a year.</li>\n	<li>Our fees are much lower than traditional property management fees.</li>\n	<li>Property owners have the right to terminate our working relationship at any time.</li>\n</ul>\n\n<p>Contact us at <a href="tel:1-303-704-7291">1-303-704-7291</a> or <a href="mailto:accesswinterpark@mac.com">email us</a> to see what we can do for you.</p>', 'no', 'yes'),
(20, '2016-06-08 02:01:38', '2016-08-17 22:47:39', 1, 19, 'b82fcceec2bca13', '<p>This page is intentionally left blank.</p>\n', 'no', 'no'),
(21, '2016-06-08 02:36:30', '2016-06-09 20:57:51', 1, 20, 'f5e45e95ab21080', '<h3>Hello Owners</h3>\n\n<p>Welcome to our online confirmed reservation calendar system. For those owners who have requested an online calendar, please scroll down and find your property name. Click on the link for your property to take you to your online reservation calendar page. Enter your user name and password to access your online calendars. You can view all confirmed reservations and reserve dates for owner stays.</p>\n\n<p>Please check with us for any pending reservations and notify us directly via phone call or email of any dates you may like to reserve.</p>\n\n<h6><u>Property Links:</u></h6>\n\n<p><a href="http://www.brownbearsw.com/cal/BC490" target="_blank">Base Camp at Jane Creek #490</a></p>\n', 'no', 'yes'),
(22, '2016-06-17 21:07:58', '2016-06-17 23:03:03', 1, 21, '9ea6aa9f793d2f6', '<p>Below are maps of Winter Park, Old Town, Trademark, Lakota, Ski Trails Maps and many more. Be sure to check out the <a href="/about-the-resort/resort-shuttle">Ski Shuttle (&quot;The Lift&quot;)&nbsp;schedule page</a> as well for &quot;The Lift&quot; schedule and routes. Additionally check out&nbsp;our <a href="/about-the-resort/ski-trail-info-and-maps">Ski Trail Maps &amp; Info page</a> as well as <a class="pyro-file" href="{{ url:site }}files/download/5f54f1cc99d3666">downloading a detailed map of the mountain</a> that clearly depicts all of the parks, trails and difficulty ratings, lifts and available facilities.</p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/fff43988e926bd8">Getting Here Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/4620e2d60129ab5">Winter Park and Fraser Town Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/5d4cc3fd5801003">Winter Park Downtown Road Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/6e910d786212e97">Old Town &amp; Ski Area Road Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="http://www.rentwinterpark.net/images/MAP_TrademarkVillageMap.pdf" target="_blank">Trademark Village Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/752c75bf834f541">Lakota Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/a1fd82cd4f5f3fa">Winter Park Ski Trail Map 2011-2012</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="/about-the-resort/ski-trail-info-and-maps">Winter Park Ski Trail Maps</a> (Mary Jane, Parsenn Bowl and Vasquez Cirque)</p>\n\n<p>?<a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/81c3ffbf1ddc8df">Resort Village Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/fc9fbcfa71e6089">Resort Summer Village Map</a></p>\n\n<p><a class="btn btn-side-column btn-link" href="{{ url:site }}files/download/0680a6d1b3d8bf1">Winter Park Resort Trestle Bike Park Map 2009</a></p>\n', 'no', 'yes'),
(23, '2016-06-22 16:27:29', '2016-06-22 20:24:55', 1, 22, 'b82fcceec2bca13', '<p>Looking for lodging for multiple families or large groups? Want to stay in individual homes but be close to each other?</p>\n\n<p>We have a great solution! Come and check out our recommendations. Accommodating from 10 - 60 people, these luxury groups are the way to go. Extra discounts for multiple bookings may apply!</p>\n\n<h3>Base Camp Group Lodging</h3>\n\n<p>BASE CAMP on JANE CREEK: Together these three exquisite 4 bedroom ski-in/ski-out properties can easily accommodate a group of 23. Pull out sleeper sofas or air beds provide sleeping space for 6 additional people. Set on the edge of the Arapaho National Forest, alongside Jane Creek and mid-way on the ski corridor between Mary Jane and Winter Park, these properties offer the very best in a ski-in/ski-out location. Located just a few yards from each other, you can combine the privacy of individual accommodations and the fun of a group get-together.</p>\n\n<p><strong>Access Winter Park Base Camp on Jane Creek properties:</strong><br />\n<a href="/property/base-camp-at-jane-creek-460">Base Camp at Jane Creek #460</a><br />\n<a href="/property/base-camp-at-jane-creek-490">Base Camp at Jane Creek #490</a><br />\n<a href="/property/base-camp-at-jane-creek-496">Base Camp at Jane Creek #496</a></p>\n\n<h3>Lakota Group Lodging</h3>\n\n<p>LAKOTA & ANTLERS @ LAKOTA: Together these three gorgeous ski base area properties can easily accommodate a group of 30. Sleeper sofas and/or air beds in the properties would allow sleeping space for an additional 4 people. Set in a in the prestigious Lakota community just opposite the Winter Park ski resort, these properties offer amazing views, private hot tubs, upscale furnishings and a Colorado mountain lodge style ambience. Located just a short walk from each other, you can combine the privacy of individual accommodations and the great fun of a group get-together.</p>\n\n<p><strong>Access Winter Park Lakota properties:</strong><br />\n<a href="/property/antlers-401-at-lakota">Antlers #401 at Lakota</a> (sleeps 10)<br />\n<a href="/property/dreamcatcher-180-at-lakota">Dreamcatcher #180 at Lakota</a> (sleeps 12 + 2 on sleeper sofa)</p>\n\n<h3>Slopeside Village Group Lodging</h3>\n\n<p>SLOPESIDE VILLAGE: Together these five  base area properties can easily accommodate a group of 39. Pull out sleeper sofas or air beds provide sleeping space for 4 additional people. Set on the northern edge of Winter Park Resort ski area, Slopeside Village offers the convenience of being in the base area without the noise, traffic and congestion of the central resort. It is even possible to ski-in!. The complimentary resort shuttle stops at the entrance to Slopeside Village and whisks you to the lifts in less than 2 minutes.  It''s perhaps a 7 minute walk to the lifts. These properties offer an unbeatable base area location. Located just a snowball''s throw from each other, you can combine the privacy of individual accommodations with the fun of a group get-together</p>\n\n<p><strong>Access Winter Park Slopeside Village properties:</strong><br />\n<a href="/property/slopeside-100">Slopeside #100</a> (sleeps 8)<br />\n<a href="/property/slopeside-102">Slopeside #102</a> (sleeps 8)<br />\n<a href="/property/slopeside-200">Slopeside #200</a> (sleeps 6 + 2 on sleeper sofa)<br />\n<a href="/property/slopeside-203">Slopeside #203</a> (sleeps 9)<br />\n<a href="/property/slopeside-206">Slopeside #206</a> (sleeps 8 + 2 on sleeper sofa)</p>\n\n<h3>Trademark Group Lodging</h3>\n\n<p>TRADEMARK: Together these three gorgeous ski base area properties can easily accommodate a group of 24. Add in neighboring Winter Park Place properties  and we have beds for 30. Sleeper sofas in the properties would allow sleeping space for an additional 4 people. Set in a private gated enclave in the ski base area,within walking distance of the lifts and set on the Fraser River at the Fraser River Trailhead, these properties have it all!  Trademark offers a large in-ground common area hot tub. Trademark 3-4 and Trademark 3-2 also have private hot tubs on the deck overlooking the ski area. Stunning views, luxurious comfort, convenience are just a few of the reasons to choose to stay at Trademark. Located just a few yards from each other, you can combine the privacy of individual accommodations and the great fun of a group get-together. Plan your next family reunion here!</p>\n\n<p><strong>Access Winter Park Trademark properties:</strong><br />\n<a href="/property/trademark-31">Trademark 3-1</a><br />\n<a href="/property/trademark-32">Trademark 3-2</a><br />\n<a href="/property/trademark-34">Trademark 3-4</a></p>', 'yes', 'yes'),
(24, '2016-08-29 21:50:48', '2016-08-29 22:00:18', 3, 23, 'bf6beef8d688350', 'Tired of the endless lines of traffic &amp; icy winter roads ?????<br />\n<br />\n<strong>GREAT NEWS: THE WINTER PARK WEEKEND SKI TRAIN IS BACK!</strong><br />\n<br />\nThe <strong>Amtrack Winter Park Express Ski Train</strong> weekend service from Denver to Winter Park will be running Jan 07 - Mar 26, 2017.<br />\nBuy a round trip or 1 way ticket for as low as $39 each way.&nbsp; You can stay overnight or stay for a week.<br />\n<br />\nThe round-trips will run on Saturdays and Sundays, with an additional round-trip on Martin Luther King Day and Presidents Day. Winter Park Express trains will enable customers to skip the congestion and stop-and-go ski traffic on I-70 and U.S. 40 while enjoying a comfortable and scenic two hour ride on the historic route through Moffat Tunnel.<br />\n<br />\nThe weekend morning train departs Union Station in downtown Denver at 7:00am and arrives at Winter Park Resort platform at approximately 9:00am.<br />\nThe weekend afternoon train will depart Winter Park at 4:30pm and arrive at Denver&#39;s Union Staion at approximately 6:40pm.<br />\n<br />\nReservations must be made and tickets purchased by 11:59 p.m. Mountain Time the day before departure.<br />\nTwo children ages 2-12 can ride for half-fare with each ticketed adult.<br />\nPassengers with disabilities may book by calling 800-USA-RAIL.<br />\n<br />\nA new commuter rail line from Denver International Airport to Union Station enables visitors from throughout the country and across the globe to travel from their flight to Winter Park. Seamless rail connectivity will be available from the airport, to the Winter Park Express and on to Winter Park Resort, without having to rent a car, secure a shuttle or navigate mountain roads.&nbsp;<br />\n<br />\nAccess Winter Park Lodging offers a concierge service that offers our guests the opportunity to have groceries and beverages delivered to their rental property ahead of their arrival.&nbsp; Groceries will be ready and waiting when you arrive!<br />\n<br />\nTickets will be available exclusively online through Amtrak at: Amtrak.com/WinterParkExpress.<br />\n<br />\nBOOK YOUR TRIP &amp; YOUR ACCESS WINTER PARK LODGING TODAY!<br />\nCall us at 303-704-7291 to confirm lodging reservations.', 'yes', 'yes');
