INSERT INTO `default_page_types` (`id`, `slug`, `title`, `description`, `stream_id`, `meta_title`, `meta_keywords`, `meta_description`, `body`, `css`, `js`, `theme_layout`, `updated_on`, `save_as_files`, `content_label`, `title_label`) VALUES
(1, 'default', 'Default', 'A 1-column layout for legal type documents (ex.: Terms of Use & Privacy Policy).', 2, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-10 col-md-10 col-lg-10">\n\n						{{ body }}\n\n					</main>\n					<!-- /Main -->', '', '', 'default.html', 1464194312, 'n', '', ''),
(9, 'listings', 'Listings', 'For organizing & displaying "Listings" data.', 17, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n					\n						<!-- Page Content -->\n						{{ listings_page_content }}\n						<!-- /Page Content -->\n\n						<!-- Listings -->\n						{{ listings_select sort=listings_order:key order_by="listing_title" }}\n						<div class="listing-item row">\n							\n							<!-- Image -->\n							<div class="listing-image col-xs-12 col-sm-3 col-md-3 col-lg-3">\n								<img class="img-responsive" src="{{ listing_image:image }}" alt="" />\n							</div>\n							<!-- /Image -->\n							\n							<!-- Content -->\n							<div class="listing-content col-xs-12 col-sm-9 col-md-9 col-lg-9">\n								<h4>{{ listing_title }}</h4>\n								{{ limit:words text=''{{ listing_content }}'' words=''30'' ending='' ... <a href="/details/{{ listing_slug }}">Read More</a>'' }}\n							</div>\n							<!-- /Content -->\n						\n						</div>\n						{{ /listings_select }}\n						<!-- /Listings -->\n					\n					</main>\n					<!-- /Main -->\n					\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n						\n						{{ if listings_display_properties_subnavigation:key == ''yes'' }}{{ theme:partial name="aside-properties-subnav" }}{{ endif }}\n						\n						{{ if listings_display_features:key == ''yes'' }}\n\n						<!-- Featured Information -->\n						{{ listings_features_select sort="random" order_by="feature_title" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /listings_features_select }}\n						<!-- /Featured Information -->\n\n						{{ endif }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1464381627, 'n', '', ''),
(10, 'listing', 'Listing', 'DO NOT USE this layout. It functions based upon data from a reffering URL. It displays an individual "Listing" data set.', 18, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n					\n					{{ streams:listings limit="1" include_by="listing_slug" include="[segment_2]" }}\n						<p><img class="img-responsive" src="{{ listing_image:image }}" alt="" /></p>\n						{{ listing_content }}\n					{{ /streams:listings }}\n					\n					</main>\n					<!-- /Main -->\n					\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n					\n						<!-- Featured Information -->\n						{{ streams:features sort="random" limit="2" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /streams:features }}\n						<!-- /Featured Information -->\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1464113975, 'n', '', ''),
(12, 'home', 'Home', 'For the homepage ONLY.', 19, '', NULL, '', '<!-- First Row (Featured Properties) -->\n		<div id="firstrow-wrapper" class="position-relative">\n			<div class="container">\n				\n				<!-- Content -->\n				<div class="row">\n					<div id="first-row-content" class="text-center col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-12 col-md-12 col-lg-12">\n						{{ session:messages success="success-message" notice="notice-message" error="error-message" }}\n						{{ first_row_content }}\n					</div>\n				</div>\n				<!-- /Content -->\n				\n				<!-- Featured Properties -->\n				<div class="row">\n					{{ featured_properties limit="4" sort="asc" disable="property_slug|street_address|city|state|zip_code|property_meta_description|property_hero|property_average_cost_per_night|property_pet_friendly|property_smoking|property_handicap_accessible|property_slideshow|property_overview|property_amenities|property_rates_fees" }}\n					<div class="featured-property text-center col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-3 col-lg-3">\n						<a class="margin-auto" style="display: block;" href="/property/{{ property_slug }}"><img class="img-responsive" src="{{ property_feature_image:image }}" alt="" /></a>\n						<p>\n							<a href="/property/{{ property_slug }}">{{ property_name }}</a><br />\n							Sleeps up to {{ property_sleeps }}<br />\n							{{ property_bedrooms }} Bdrm. / {{ property_bathrooms }} Bath<br />\n							{{ if property_hot_tub:key == ''private'' || property_hot_tub:key == ''public'' }}{{ property_hot_tub:value }} Hot Tub{{ endif}}\n						</p>\n					</div>\n					{{ /featured_properties }}\n				</div>\n				<!-- /Featured Properties -->\n				\n				<!-- Button -->\n				{{ if first_row_button_link && first_row_button_text }}\n				<div class="row">\n					<div class="text-center col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-12 col-md-12 col-lg-12">\n						<a class="btn btn-side-column btn-link" href="{{ first_row_button_link }}">{{ first_row_button_text }}</a>\n					</div>\n				</div>\n				{{ endif }}\n				<!-- /Button -->\n				\n			</div>\n		</div>\n		<!-- /First Row (Featured Properties) -->\n		\n		<!-- Second Row (Snowy Trees Background) -->\n		<div id="secondrow-wrapper" class="position-relative">\n			<div class="container">\n				<div class="row">\n					<div class="col-xs-offset-1 col-xs-10 col-sm-10 col-md-offset-0 col-md-6 col-lg-6">\n						<img class="img-responsive margin-auto" src="{{ second_row_feature:feature_image:image }}" alt="" />\n					</div>\n					<div class="col-xs-offset-1 col-xs-10 col-sm-10 col-md-offset-0 col-md-6 col-lg-6">\n						<h2>{{ second_row_feature:feature_title }}</h2>\n						<p>{{ second_row_feature:feature_text }}</p>\n						<p><a class="btn btn-side-column btn-link" href="{{ second_row_feature:feature_link_url }}">{{ second_row_feature:feature_button_text }}</a></p>\n					</div>\n				</div>\n			</div>\n		</div>\n		<!-- /Second Row (Snowy Trees Background) -->\n		\n		<!-- Third Row (Blue Canvas Background) -->\n		<div id="thirdrow-wrapper" class="position-relative">\n			<div class="container">\n				<div class="row">\n					\n					<!-- Snow Report -->\n					<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-3 col-lg-3">\n						<img class="img-responsive margin-auto" src="{{ snow_report_image:image }}" alt="" />\n					</div>\n					<div class="thirdrow-content col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-3 col-lg-3">\n						<h4>{{ snow_report_title }}</h4>\n						<p>{{ snow_report_content }}</p>\n						<p><a class="btn btn-blue-canvas btn-link" href="{{ snow_report_button_link }}" target="_blank">{{ snow_report_button_text }}</a></p>\n					</div>\n					<!-- /Snow Report -->\n					\n					<div class="clearfix visible-xs-block visible-sm-block"></div>\n					\n					<!-- Feature -->\n					<div class="thirdrow-feature col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-3 col-lg-3">\n						<img class="img-responsive margin-auto" src="{{ third_row_feature:feature_image:image }}" alt="" />\n					</div>\n					<div class="thirdrow-feature thirdrow-content col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-3 col-lg-3">\n						<h4>{{ third_row_feature:feature_title }}</h4>\n						<p>{{ third_row_feature:feature_text }}</p>\n						<p><a class="btn btn-blue-canvas btn-link" href="{{ third_row_feature:feature_link_url }}">{{ third_row_feature:feature_button_text }}</a></p>\n					</div>\n					<!-- /Feature -->\n					\n				</div>\n			</div>\n		</div>\n		<!-- /Third Row (Blue Canvas Background) -->\n		\n		<!-- Last Row -->\n		<div id="lastrow-wrapper" class="position-relative">\n			<div class="container">\n				<div class="row">\n					<div class="text-center col-xs-offset-1 col-xs-10 col-sm-10 col-md-offset-0 col-md-12 col-lg-offset-1 col-lg-10">\n						{{ if last_row_image }}<img class="img-responsive margin-auto" src="{{ last_row_image:image }}" alt="" />{{ endif }}\n						{{ last_row_content }}\n						<p><a class="btn btn-side-column btn-link" href="{{ last_row_button_link }}">{{ last_row_button_text }}</a></p>\n					</div>\n				</div>\n			</div>\n		</div>\n		<!-- /Last Row -->', '', '', 'open.html', 1471382753, 'n', '', ''),
(13, 'checkfront_property_listings', 'Checkfront Property Listings', 'For displaying the Checkfront property listings "Droplets."', 20, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-12 col-md-offset-0 col-md-12 col-lg-12">\n\n						{{ checkfront_page_content }}\n\n						{{ checkfront_droplet }}\n\n					</main>\n					<!-- /Main -->', '', '', 'default.html', 1464059141, 'n', '', ''),
(14, 'standard', 'Standard', 'The default 2-column content layout.', 22, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n\n						{{ page_content }}\n\n					</main>\n					<!-- /Main -->\n\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n						\n						{{ if display_properties_subnavigation:key == ''yes'' }}{{ theme:partial name="aside-properties-subnav" }}{{ endif }}\n						\n						{{ if display_features:key == ''yes'' }}\n						\n						<!-- Featured Information -->\n						{{ features_select sort="random" order_by="feature_title" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /features_select }}\n						<!-- /Featured Information -->\n						\n						{{ endif }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1464114492, 'n', '', ''),
(15, 'thank_you', 'Thank You', 'DO NOT USE this layout. It is for displaying the custom "Thank You" page visitors arrive at after successfully filling out the "Send a Message" form in the footer.', 22, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n\n						{{ page_content }}\n\n						<!-- Form Submission Data -->\n						{{ streams:contact_us limit="1" include="[segment_2]" }}\n						<p>\n							<strong>Name:</strong> {{ name }}<br />\n							<strong>Email Address:</strong> {{ email_address:email_address }}<br />\n							<strong>Arrival Date:</strong> {{ arrival_date }}<br />\n							<strong>Departure Date:</strong> {{ departure_date }}<br />\n							<strong>How Can We Help?</strong><br/>\n							{{ message }}\n						</p>\n						{{ /streams:contact_us }}\n						<!-- /Form Submission Data -->\n\n					</main>\n					<!-- /Main -->\n\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n						\n						{{ if display_properties_subnavigation:key == ''yes'' }}{{ theme:partial name="aside-properties-subnav" }}{{ endif }}\n						\n						{{ if display_features:key == ''yes'' }}\n						\n						<!-- Featured Information -->\n						{{ features_select sort="random" order_by="feature_title" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /features_select }}\n						<!-- /Featured Information -->\n						\n						{{ endif }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1468455521, 'n', '', ''),
(17, 'property', 'Property', 'DO NOT USE this layout. It functions based upon data from a reffering URL. It displays an individual "Property" data set.', 24, '', NULL, '', '{{ streams:properties limit="1" include_by="property_slug" include="[segment_2]" }}\n		<div id="main-wrapper" class="position-relative">\n			<div class="container">\n				<div class="row">\n					\n					{{ session:messages success="success-message" notice="notice-message" error="error-message" }}\n\n					<!-- Aside (Property Preview) -->\n					<aside id="property-preview" class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-12 col-md-4 col-lg-3">\n						\n						<!-- Property Preview Info -->\n						<div id="property-preview-info">\n							<div class="row">\n								<div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">Property Preview</div>\n							</div>\n							<div class="row">\n								<!--<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Avg. Cost Per Night: <span>{{ property_average_cost_per_night }}</span></div>-->\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Bedrooms: <span>{{ property_bedrooms }}</span></div>\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Sleeps: <span>{{ property_sleeps }}</span></div>\n							</div>\n							<div class="row">\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Bathrooms: <span>{{ property_bathrooms }}</span></div>\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Hot Tub: <span>{{ property_hot_tub:value }}</span></div>\n							</div>\n							<div class="row">\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Pet Friendly: <span>{{ property_pet_friendly:value }}</span></div>\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Smoking: <span>{{ property_smoking:value }}</span></div>\n							</div>\n							<div class="row">\n								<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12">Accessibility: <span>{{ property_handicap_accessible:value }}</span></div>\n							</div>\n						</div>\n						<!-- /Property Preview Info -->\n						\n						<!-- Buttons -->\n						<div class="row">\n							{{ if property_checkfront_item_id }}<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12"><a class="btn btn-side-column btn-link" href="#book-this-property">Book Now</a></div>{{ endif }}\n							<div class="col-xs-12 col-sm-6 col-md-12 col-lg-12"><a class="btn btn-side-column btn-link" data-toggle="collapse" href="#property-inquiry-form" aria-expanded="false" aria-controls="property-inquiry-form">Inquire</a></div>\n						</div>\n						<!-- /Buttons -->\n						\n						<!-- Property Inquiry Form -->\n						<div id="property-inquiry-form" class="row collapse">\n							<div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n								{{ streams:form\n									stream="property_inquiry"\n									mode="new"\n									required="*"\n									error_start="<p class=\\"red\\">("\n									error_end=")</p>"\n									notify_a="accesswinterpark@me.com"\n									notify_from_a="noreply@accesswinterpark.com|Access Winter Park"\n									notify_template_a="property-inquiry"\n									return="/property-inquiry-thank-you"\n									success_message="Your message has been sent successfully. Thank you."\n									failure_message="There were errors with the information you submitted. All fields are required. Please try again or call us."\n								}}\n								{{ form_open }}\n									<h5>I want Access Winter Park to contact me about this property.</h5>\n									<input type="hidden" name="{{ url:slug }}" value="{{ url:current }}" />\n									<div class="form-group">\n										<label for="{{ name:slug }}">{{ name:label }} {{ name:required }}</label>\n										{{ name:error }}\n										<input type="text" name="{{ name:slug }}" class="form-control" placeholder="{{ name:instructions }}" />\n									</div>\n									<div class="form-group">\n										<label for="{{ email_address:slug }}">{{ email_address:label }} {{ email_address:required }}</label>\n										{{ email_address:error }}\n										<input type="email" name="{{ email_address:slug }}" class="form-control" placeholder="{{ email_address:instructions }}" />\n									</div>\n									<div class="form-group">\n										<label for="{{ phone_number:slug }}">{{ phone_number:label }} {{ phone_number:required }}</label>\n										{{ phone_number:error }}\n										<input type="text" name="{{ phone_number:slug }}" class="form-control" placeholder="{{ phone_number:instructions }}" />\n									</div>\n									<div class="form-group">\n										<label for="{{ property:slug }}">{{ property:label }} {{ property:required }}</label><br />\n										{{ property:error }}\n										{{ property:input }}\n									</div>\n									<div class="form-group">\n										<label for="{{ arrival_date:slug }}">{{ arrival_date:label }} {{ arrival_date:required }}</label><br />\n										{{ arrival_date:error }}\n										<input type="text" id="arrival_date_inquiry" name="{{ arrival_date:slug }}" class="form-control" placeholder="{{ arrival_date:instructions }}" />\n									</div>\n									<div class="form-group">\n										<label for="{{ departure_date:slug }}">{{ departure_date:label }} {{ departure_date:required }}</label><br />\n										{{ departure_date:error }}\n										<input type="text" id="departure_date_inquiry" name="{{ departure_date:slug }}" class="form-control" placeholder="{{ departure_date:instructions }}" />\n									</div>\n									<div class="row">\n										<div class="col-xs-6 col-sm-6 col-md-6 col-lg-6">\n											<input type="submit" class="btn btn-side-column" value="Send" />\n										</div>\n										<div class="col-xs-6 col-sm-6 col-md-6 col-lg-6">\n											<input type="reset" class="btn btn-side-column-cxl" data-toggle="collapse" data-target="#property-inquiry-form" aria-expanded="false" aria-controls="property-inquiry-form" value="Cancel" />\n										</div>\n									</div>\n								{{ form_close }}\n								{{ /streams:form }}\n							</div>\n						</div>\n						<!-- /Property Inquiry Form -->\n						\n						<!-- Featured Information (md & lg) -->\n						{{ streams:features sort="random" limit="2" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a class="btn btn-default btn-link" href="{{ feature_link_url }}">{{ feature_button_text }}</a></p>\n							</div>\n						</div>\n						{{ /streams:features }}\n						<!-- /Featured Information (md & lg) -->\n					\n					</aside>\n					<!-- /Aside (Property Preview) -->\n\n					<!-- Main -->\n					<main id="property-details" class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-12 col-md-8 col-lg-offset-1 col-lg-8">\n						<div class="row">\n							<div class="hidden-xs col-sm-12 col-md-12 col-lg-12">\n								\n								<!-- Property Details Navigation -->\n								<div class="btn-group btn-group-justified" aria-label="Property Details Navigation">\n									<a href="#photos" class="btn btn-property-details" role="button">Photos</a>\n									<a href="#overview" class="btn btn-property-details" role="button">Overview</a>\n									{{ if property_amenities }}<a href="#amenities" class="btn btn-property-details" role="button">Amenities</a>{{ endif }}\n									<a href="#rates-fees" class="btn btn-property-details" role="button">Rates & Fees</a>\n									{{ if street_address && city && state && zip_code }}<a href="#map" class="btn btn-property-details" role="button">Map</a>{{ endif }}\n								</div>\n								<!-- /Property Details Navigation -->\n							\n							</div>\n						</div>\n						<div id="photos" class="row">\n							<div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n								\n								<!-- Property Slideshow -->\n								<div id="property-slideshow" class="carousel slide" data-ride="carousel" data-interval="false">\n									\n									<!-- Wrapper for slides -->\n									<div class="carousel-inner" role="listbox">\n										\n										<!-- Slides -->\n										{{ property_slideshow order_by="slide_name" sort="asc" }}\n										<div class="item text-center{{ if count == ''1'' }} active{{ endif }}">\n											<div class="image-container">\n												<img src="{{ slide_image:image }}" alt="{{ slide_caption }}" />\n											</div>\n											<div class="clearfix image-caption">\n												<p class="text-center">{{ if slide_caption }}{{ slide_caption }}{{ else }}&nbsp;{{ endif }}</p>\n											</div>\n										</div>\n										{{ /property_slideshow }}\n										<!-- /Slides -->\n										\n										<!-- Indicators -->\n										<ol class="carousel-indicators list-unstyled">\n											{{ property_slideshow sort="asc" limit="1" }}\n											<li data-target="#property-slideshow" data-slide-to="0" class="active"></li>\n											{{ /property_slideshow }}\n											{{ property_slideshow sort="asc" }}\n											{{ if count == ''1'' }}{{ else }}<li data-target="#property-slideshow" data-slide-to="{{ helper:count start=''1'' }}" class=""></li>{{ endif }}\n											{{ /property_slideshow }}\n										</ol>\n										<!-- /Indicators -->\n									\n										<!-- Slide Controls -->\n										<a class="left carousel-control text-center" href="#property-slideshow" role="button" data-slide="prev"><span class="fa fa-angle-left" aria-hidden="true"></span><span class="sr-only">Previous</span></a>\n										<a class="right carousel-control text-center" href="#property-slideshow" role="button" data-slide="next"><span class="fa fa-angle-right" aria-hidden="true"></span><span class="sr-only">Next</span></a>\n										<!-- Slide Controls -->\n									\n									</div>\n									<!-- /Wrapper for slides -->\n								\n								</div>\n								<!-- /Property Slideshow -->\n							\n							</div>\n						</div>\n						<div class="row">\n							<div class="col-xs-12 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-12 col-lg-12">\n								\n								<!-- Property Info -->\n								<h3 id="overview">Overview</h3>\n								{{ property_overview }}\n								\n								{{ if property_amenities }}\n								<h3 id="amenities">Amenities</h3>\n								{{ property_amenities }}\n								{{ endif }}\n								\n								<h3 id="rates-fees">Rates & Fees</h3>\n								{{ property_rates_fees }}\n								<!-- /Property Info -->\n								\n								{{ if street_address && city && state && zip_code }}\n								<!-- Google Map -->\n								<h3 id="map">Map</h3>\n								<iframe frameborder="0" src="https://www.google.com/maps/embed/v1/place?key=AIzaSyBkcwuY68At1I2dG9FMTW52jRH4JgQRE0g&q={{ helper:str_replace search='' '' replace=''+'' subject=''{{ street_address }}'' }},{{ helper:str_replace search='' '' replace=''+'' subject=''{{ city }}'' }},{{ state }}+{{ helper:sprintf format=''d'' string=zip_code }}" allowfullscreen></iframe>\n								<!-- /Google Map -->\n								{{ endif }}\n							\n							</div>\n						</div>\n					</main>\n					<!-- /Main -->\n				\n				</div>\n			</div>\n		</div>\n\n		{{ if property_checkfront_item_id }}\n		<!-- Checkfront -->\n		<div id="book-this-property">\n			<div id="checkfront-wrapper" class="container-fluid">\n				<div class="row">\n					\n					<!-- Checkfront Title -->\n					<div id="checkfront-title" class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n						<h3>Book This Property</h3>\n					</div>\n					<!-- /Checkfront Title -->\n					\n					<!-- Checkfront Droplet -->\n					<div id="checkfront-droplet" class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n						<script type="text/javascript" src="//accesswinterparklodg.checkfront.com/lib/interface--30.js"></script>\n						<!-- CHECKFRONT BOOKING PLUGIN v23-->\n						<div id="CHECKFRONT_WIDGET_01"><p id="CHECKFRONT_LOADER" style="background: url(''//accesswinterparklodg.checkfront.com/images/loader.gif'') left center no-repeat; padding: 5px 5px 5px 20px">Searching Availability...</p></div>\n						<script>\n							new CHECKFRONT.Widget ({\n								host: ''accesswinterparklodg.checkfront.com'',\n								target: ''CHECKFRONT_WIDGET_01'',\n								item_id: ''{{ property_checkfront_item_id }}'',\n								style: ''background-color: fff'',\n								provider: ''droplet''\n							}).render();\n						</script>\n						<noscript><a href="https://accesswinterparklodg.checkfront.com/reserve/" style="font-size: 16px">Continue to Secure Booking System &raquo;</a></noscript>\n					</div>\n					<!-- /Checkfront Droplet -->\n					\n				</div>\n			</div>\n		</div>\n		<!-- /Checkfront -->\n		{{ endif }}\n		{{ /streams:properties }}', '', '', 'open.html', 1469835710, 'n', '', ''),
(18, 'property_inquiry_thank_you', 'Property Inquiry Thank You', 'DO NOT USE this layout. It is for displaying the custom "Thank You" page visitors arrive at after successfully filling out the Property Inquiry form in the side column of a property detail page.', 22, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n\n						{{ page_content }}\n\n						<!-- Form Submission Data -->\n						{{ streams:property_inquiry limit="1" include="[segment_2]" }}\n						<p>\n							<strong>Name:</strong> {{ name }}<br />\n							<strong>Email Address:</strong> {{ email_address:email_address }}<br />\n							<strong>Phone Number:</strong> {{ phone_number }}<br />\n							<strong>Property:</strong> {{ property:value }}<br />\n							<strong>Arrival Date:</strong> {{ arrival_date }}<br />\n							<strong>Departure Date:</strong> {{ departure_date }}\n						</p>\n						{{ /streams:property_inquiry }}\n						<!-- /Form Submission Data -->\n\n					</main>\n					<!-- /Main -->\n\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n						\n						{{ if display_properties_subnavigation:key == ''yes'' }}{{ theme:partial name="aside-properties-subnav" }}{{ endif }}\n						\n						{{ if display_features:key == ''yes'' }}\n						\n						<!-- Featured Information -->\n						{{ features_select sort="random" order_by="feature_title" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /features_select }}\n						<!-- /Featured Information -->\n						\n						{{ endif }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1468455534, 'n', '', ''),
(19, 'property_listings', 'Properties', 'For organizing & displaying property groupings data.', 27, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n					\n						<!-- Page Content -->\n						{{ properties_page_content }}\n						<!-- /Page Content -->\n\n						<!-- Listings -->\n						{{ properties_select sort=properties_order:key order_by="property_name" }}\n						<div class="properties-item row">\n							\n							<!-- Name -->\n							<div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n								<h3><a href="/property/{{ property_slug }}">{{ property_name }}</a></h3>\n							</div>\n							<!-- /Name -->\n							\n							<!-- Image -->\n							<div class="properties-image col-xs-12 col-sm-12 col-md-12 col-lg-21">\n								<a style="display: block;" href="/property/{{ property_slug }}"><img class="img-responsive" src="{{ files:image_url id=property_hero:id }}" alt="" /></a>\n							</div>\n							<!-- /Image -->\n							\n							<!-- Preview -->\n							<div class="properties-summary col-xs-12 col-sm-12 col-md-12 col-lg-12">\n								<div class="row">\n									<!--<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Avg. Cost Per Night: <span>{{ property_average_cost_per_night }}</span></div>-->\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Bedrooms: <span>{{ property_bedrooms }}</span></div>\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Sleeps: <span>{{ property_sleeps }}</span></div>\n								</div>\n								<div class="row">\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Bathrooms: <span>{{ property_bathrooms }}</span></div>\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Hot Tub: <span>{{ property_hot_tub:value }}</span></div>\n								</div>\n								<div class="row">\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Pet Friendly: <span>{{ property_pet_friendly:value }}</span></div>\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Smoking: <span>{{ property_smoking:value }}</span></div>\n								</div>\n								<div class="row">\n									<div class="col-xs-12 col-sm-6 col-md-6 col-lg-6">Accessibility: <span>{{ property_handicap_accessible:value }}</span></div>\n								</div>\n							</div>\n							<!-- /Preview -->\n							\n							<!-- Overview -->\n							<div class="properties-overview col-xs-12 col-sm-12 col-md-12 col-lg-12">\n								{{ limit:words text=''{{ property_overview }}'' words=''30'' ending='' ... <a href="/property/{{ property_slug }}">Read More</a>'' }}\n							</div>\n							<!-- /Overview -->\n						\n						</div>\n						{{ /properties_select }}\n						<!-- /Listings -->\n					\n					</main>\n					<!-- /Main -->\n					\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n						\n						{{ if properties_display_properties_subnavigation:key == ''yes'' }}{{ theme:partial name="aside-properties-subnav" }}{{ endif }}\n						\n						{{ if properties_display_features:key == ''yes'' }}\n\n						<!-- Featured Information -->\n						{{ properties_features_select sort="random" order_by="feature_title" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /properties_features_select }}\n						<!-- /Featured Information -->\n\n						{{ endif }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1469407383, 'n', '', ''),
(20, 'news', 'News', 'DO NOT USE this layout. It functions based upon data from a reffering URL. It displays news from the News stream.', 29, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n					\n					{{ streams:news_posts paginate="yes" pag_segment="2" limit="10" }}\n					\n					{{ entries }}\n					<article class="post">\n						{{ if news_post_image }}<a class="post-image" href="/article/{{ news_post_slug }}"><img class="img-responsive" src="{{ news_post_image:image }}" alt="" /></a>{{ endif }}\n						<h3><a href="/article/{{ news_post_slug }}">{{ news_post_title }}</a></h3>\n						<h6>Posted: {{ helper:date timestamp=created }}</h6>\n						<p>{{ limit:words text=''{{ news_post }}'' words=''30'' ending='' ... <a href="/article/{{ news_post_slug }}">Read More</a>'' }}</p>\n					</article>\n					{{ /entries }}\n					\n					{{ pagination }}\n\n					{{ /streams:news_posts }}\n					\n					</main>\n					<!-- /Main -->\n					\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n					\n						{{ theme:partial name="aside-properties-subnav" }}\n						\n						<!-- Featured Information -->\n						{{ streams:features sort="random" limit="2" }}\n						<div class="row aside-featured-info">\n							{{ if feature_image }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<img class="img-responsive" src="{{ feature_image:image }}" alt="" />\n							</div>\n							{{ endif }}\n							<div class="col-xs-offset-1 col-xs-10 col-sm-offset-0 col-sm-6 col-md-12 col-lg-12">\n								<h4>{{ feature_title }}</h4>\n								<p>{{ feature_text }}</p>\n								<p><a href="{{ feature_link_url }}">{{ feature_link_text }}</a></p>\n							</div>\n						</div>\n						{{ /streams:features }}\n						<!-- /Featured Information -->\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1476896154, 'n', '', ''),
(21, 'article', 'Article', 'DO NOT USE this layout. It functions based upon data from a reffering URL. It displays News articles from the News stream.', 30, '', NULL, '', '<!-- Main -->\n					<main class="col-xs-offset-1 col-xs-10 col-sm-offset-1 col-sm-10 col-md-offset-0 col-md-8 col-md-push-4 col-lg-offset-1 col-lg-8 col-lg-push-3">\n\n					{{ streams:news_posts limit="1" include_by="news_post_slug" include="[segment_2]" }}\n					<article class="post">\n						{{ if news_post_image }}<img class="img-responsive" src="{{ news_post_image:image }}" alt="" />{{ endif }}\n						<h3>{{ news_post_title }}</h3>\n						<h6>Posted: {{ helper:date timestamp=created }}</h6>\n						{{ news_post }}\n					</article>\n					{{ /streams:news_posts }}\n\n					<p><a class="btn btn-side-column btn-link" href="javascript:window.history.go(-1);">Back to News</a></p>\n					\n					</main>\n					<!-- /Main -->\n					\n					<!-- Aside (Default) -->\n					<aside id="default" class="col-xs-12 col-sm-12 col-md-4 col-md-pull-8 col-lg-3 col-lg-pull-9">\n					\n						{{ theme:partial name="aside-properties-subnav" }}\n					\n					</aside>\n					<!-- /Aside (Default) -->', '', '', 'default.html', 1476920431, 'n', '', '');
