(1, '2016-05-26 04:08:17', '2016-08-10 23:33:41', 1, 1, 'Antlers #401 at Lakota', 'antlers-401-at-lakota', 'Fabulous Home, Luxury, Comfort, Views. Perfect for 2 Familes. Private Hot Tub', 'f2f8a4047c3c6dc', '10', '4', '3.5', 'private', 'no', 'no', '401 Antler Way', 'Winter Park', 'CO', 80482, '$400', 'no', '<p>ANTLERS 401 AT LAKOTA is a 4-bedroom, 3.5 bath luxury townhome located in the Antlers sub-division of Lakota, an exclusive community located directly across from the Winter Park Ski Resort. Tastefully decorated with upscale mountain lodge style furnishings and offering spectacular views of the Winter Park ski runs, this fabulous home has it all.</p>\n\n<p>This home is approximately 2100 square feet on three levels, making it the perfect place for 8-10 people or two families to rest and relax while enjoying a fun-filled mountain get-a-way.</p>\n\n<p>The entry level features an open floor plan, comprised of a family living area, dining area with seating for 8 and a fully equipped gourmet kitchen with granite counter tops and newer kitchen appliances. A breakfast bar with 3 stools provides additional seating. A cathedral ceiling, log accents and floor to ceiling windows showcase spectacular views of the ski slopes at Winter Park. A gas log stone fireplace and comfortable furnishings add a warm mountain charm. The entry level is slate flooring with in-floor radiant heat to keep your feet warm and toasty. Just off the dining area is the main deck, with a gas grill and outdoor furniture, perfect for enjoying a BBQ&#39;d meal on a summer evening.</p>\n\n<p>The spacious Master Suite occupies the entire upper level, with a King Bed and walk-in closet. The Master bath is complete with jacuzzi tub, walk-in shower and double sinks.</p>\n\n<p>The lower level has 3 bedrooms. The second bedroom is a Queen Master Suite, iwith its own private bathroom. The 3rd bedroom has a Queen bed and a walk-out to the private lower patio, complete with a private hot tub. The fourth bedroom has 2 sets of twin over twin bunks. In the hall is another full bath. A full size washer and dryer is also located on this level.</p>\n\n<p>This home is equipped with Wi-Fi, 4 flat screen TV&#39;s with cable &amp; DVD player as well.</p>\n\n<p>Parking couldn&#39;t be easier, with an attached single car heated garage and space in the driveway for an additional vehicle.</p>\n\n<p>Winter is always great fun in Winter Park...skiing, snowshoeing, hot air balloon rides, tubing, sleigh rides and more.</p>\n\n<p>Great local restaurants are minutes away in the towns of Winter Park and Fraser, or meals can be prepared at home with the fully equipped kitchen and outdoor gas grill. Wind down in the PRIVATE HOT TUB located on the lower patio or relax on the upper deck patio furniture and take in the spectacular views of Winter Park and Mary Jane Mountain.</p>\n\n<p>There are many summer activities available for all ages including rafting, fishing, hiking, golfing, and tons more. Or book early for your Winter &#39;16-17 ski vacation.</p>\n\n<p>During the summer, Winter Park has a great 3000 foot long alpine slide down the mountain that drops you over 600 feet! The kids (and adults) love it!&nbsp; Nothing could make for a more fabulous vacation!</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter ski get-away or a summer &#39;Beat the Heat&#39; vacation.&nbsp;</p>\nBook your get-away now!!!', '<strong>KEY FEATURES:</strong><br />\n4 Bedroom, 3.5 bath townhome<br />\nKing Master Suite on private upper level<br />\nBase Area location....just across the road from Winter Park Resort<br />\nPrivate Hot Tub<br />\nGas grill on upper level deck<br />\n<br />\n<strong>AMENITIES:</strong><br />\nPrivate Outdoor Hot Tub, private 1 car garage &amp; driveway, private washer &amp; dryer, free wireless internet &amp; expanded cable, DVD player, gas log fireplace, gas grill<br />\n<br />\n<strong>SLEEPING ARRANGEMENTS: </strong>Sleeps 10 in beds<br />\nBedroom 1: King Master Suite on private upper level<br />\nBedroom 2: Queen Master Suite<br />\nBedroom 3: Queen Bed<br />\nBedroom 4: Bunk room with 2 sets of twin over twin bunks', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $450/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $375/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 15, 2016):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 16 - Dec 25, 2016):</strong><br />\nFrom $700/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $950/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 12, 2016):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 13 - Jan 15, 2017):</strong><br />\nFrom $800/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $450/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $650/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 2, 2017):</strong><br />\nFrom $450/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 3 - Mar 26, 2017):</strong><br />\nFrom $750/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 9, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $375/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Bargain Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer&nbsp; 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $350<br />\nPrivate Hot Tub Fee: $100<br />\nLodging Tax: 10.9%</p>\n', '20a888b7491a569', 29),
(2, '2016-05-27 17:41:58', '2016-07-29 17:37:11', 1, 2, 'Bavarian Village #11', 'bavarian-village-11', 'Cozy & Comfy Townhome Tucked Away in the Fraser Hills - Perfect for Families', '20319e1e588bdd9', '10', '2', '2.5', 'public', 'no', 'no', '242 County Road 832, Unit 11', 'Fraser ', 'CO', 80442, '$500', 'no', '<p>Newly remodeled in 2013 and tastefully decorated with Colorado mountain style furnishings, our comfortable and cozy 2-bedroom + a loft, 2.5 bath mountain retreat ski condo is the perfect place to relax and unwind after a day on the slopes.</p>\n\n<p>Nestled in the woods in a quiet neighborhood of Fraser, Aspen Hideaway at Bavarian Village is the perfect location for your Winter Park family vacation. Bavarian Village #11,was completely upgraded in 2013 and is tastefully appointed with all the comforts of home.</p>\n\n<p>Sleeping arrangements are family-friendly. A bunk room has 2 sets of twin bunks (sleeping 4). On the same lower level, a queen bedroom with vanity is beautiful and comfortable. The loft on the third level has a queen bed and bathroom.</p>\n\n<p>The main level provides a beautiful location for cooking, dining and gathering. Large windows, brick woodburning fireplace and cathedral ceilings provide a beautiful place to gather and play games or watch TV on the flat screen. Additional casual seating is available at the granite countertop.</p>\n\n<p>Other fine amenities include slate and hardwood flooring, stone tile showers, stainless steel appliances, and granite countertops throughout, The winter resort shuttle stops near the parking lot.</p>\n\n<p>Club Meadowridge Recreation Center is available for guest use. The recreation center has fitness equipment, an outdoor pool and spa, massage therapist, laundry facilities and tennis courts. An onsite equipment shop is also available.</p>\n\n<p>KEY FEATURES:</p>\n\n<ul>\n <li>Three-levels; 2-bedrooms plus a loft, 2.5 bathrooms.</li>\n <li>Access to MeadowRidge Recreation center with swimming pool, hot tubs, exercise room, racquetball courts, tennis courts and spa.</li>\n</ul>\n', '2 Bedroom + loft,&nbsp; townhome<br />\nLocated in the Fraser hills<br />\nFree Shuttle route<br />\nAccess to the amenities at Club Meadowridge<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (swimming pool, hot tubs, work-out room)<br />\n<br />\nSLEEPING ARRANGEMENTS: Sleeps 10 in beds<br />\nBedroom 1: Queen Bedroom<br />\nBedroom 2: Bunk room with 2 sets of twin over twin bunks<br />\nLOFT: Queen Bed', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $200/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $200/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $100/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $125/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $200/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $400/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $375/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $275/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $400/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $200/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Value Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $125/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $135/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Standard Rate:</strong><br />\nFrom $500/night <em>(2 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $250<br />\nLodging Tax: 5.7%<br />\nClub Meadowridge: $25</p>\n', '3d9ed798adbeda7', 36),
(3, '2016-05-27 18:01:25', '2016-09-08 15:15:10', 1, 3, 'Base Camp at Jane Creek #460', 'base-camp-at-jane-creek-460', 'Exquisite 4-Bedroom Ski-in/Ski-Out, Pvt Hot Tub with 2 Living Areas', 'a5611c6e324c97a', '10', '4', '4.5', 'private', 'no', 'no', '460 Iron Horse Way', 'Winter Park', 'CO', 80482, '$1,000', 'no', '<p>Relax, settle in and enjoy this amazing home. An open floor plan, cathedral ceilings and wrap around windows showcase high-end finishes with wood and stone accents throughout the home and the peaceful secluded forest views outside...Spacious and comfortable, this home has it all: 4 bedrooms, 4.5 bathrooms, 2 living areas and a gourmet kitchen. The large stone fireplace with hearth in the living room is the perfect place to relax after a great day outdoors. The well-equipped expansive kitchen offers a professional 6-burner Wolff stove, large Sub-zero refrigerator, plenty of counter space , and a large island with seats for 4. The kitchen&#39;s two-way fireplace overlooks the back porch with a large grill and hot tub, perfect for relaxing to the sounds of the forest and the merry sounds of the water gurgling as is flows down Jane Creek. This home is the perfect combination of luxury and convenience.</p>\n\n<p>Location: Just 1/4 mile from Winter Park Village, about two miles to downtown Winter Park. Ski access available by 150 yard walk on maintained path to Corridor ski trail (some stairs).</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter ski get-away or a summer &quot;Beat the Heat&quot; vscation.</p>\n\n<p>Now booking for the 2016-2017 ski season.</p>\n', '<p><strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Private heated 1 Car Garage &amp; Driveway, Short Hike To Slopes (~150 yards with stairs) Two Living Areas, Private Washer/Dryer, Free Wireless Internet, Gourmet Kitchen, Three Gas Fireplaces, Private Outdoor Gas Grill, On Free Shuttle Route, Cable TV/DVD Player, Private Deck overlooking the National Forest.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n4 bedroom, 4.5 bathroom<br />\nSKI-IN/SKI-OUT<br />\n2 King Master Suites<br />\nPrivate Hot Tub<br />\n2 living areas<br />\n3 fireplaces<br />\nfree shuttle route<br />\nwalking distance to the base village</p>\n\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 9&nbsp; (7 in beds + 2 on sleeper sofa)<br />\nBedroom 1: King Master Suite<br />\nBedroom 2: King Master Suite<br />\nBedroom 3: Queen Bedroom<br />\nBedroom 4: Bunk Room with a twin over twin bunk bed and a pull-out trundle<br />\nPull-out sleeper sofa in lower level family room offers additional sleeping options</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $550/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $450/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $475/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Week Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $550/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $650/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $600/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $700/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $1,600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $1,600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $800/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $950/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $750/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $950/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $700/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $600/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Bargain Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer&nbsp; 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $450/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $500/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $350<br />\nPrivate Hot Tub Fee: $100<br />\nLodging Tax: 10.9%</p>\n', 'f09a7b6aa1675f8', 31),
(4, '2016-05-27 18:14:30', '2016-10-13 00:51:19', 1, 4, 'Base Camp at Jane Creek #490', 'base-camp-at-jane-creek-490', 'Winter Park-Ski-in/Ski-Out 4 BR, Hot Tub, Stay & Play Discounts', 'ba2d0bcced52479', '10', '4', '4.5', 'private', 'no', 'no', '490 Iron Horse Way', 'Winter Park', 'CO', 80482, '$1,000', 'no', '<p>Base Camp - Winter Park&#39;s most sought after destination is waiting for you! This fabulous ski-in/ski-out 4 bedroom townhome is already a huge hit with families or larger groups. High end amenities offering the ultimate in comfort and convenience combine with an unbeatable location to provide our guests with an unforgettable experience.</p>\n\n<p>* DISCOUNTS: Give us a call at 303-704-7291 and ask us about our current discounts...Ask for the &quot;Stay, Play &amp; Save&quot; discounts. We also have discounts on ski rental equipment.</p>\n\n<p>Base Camp at Jane Creek #490 is a brand new ski-in/ski-out 4 bedroom, 4 1/2 bath luxury vacation home located right on the ski slopes in Winter Park Resort, mid-way along the Winter Park and Mary Jane ski corridor. This luxury townhome boasts 2 King Master Suites, a Queen Bedroom and a twin bedroom. Soaring 14 foot ceilings, exquisite Colorado lodge style furnishings, a high-end gourmet kitchen, 2 double-sided gas log fireplaces, 2 decks, a private hot tub &amp; grill and complimentary high speed WI-Fi are just some of the amenities this unforgettable home has to offer. Nestled in the trees with views of the mountain slopes and the trees, this sunny end-unit luxury home is the perfect mountain retreat.</p>\n\n<p>This 3,008 square foot 3-level home features:</p>\n\n<p>UPPER LEVEL:</p>\n\n<ul>\n <li>Master Suite with King Bed, TV &amp; double-sided fireplace shared with Master bath</li>\n <li>Master Bath with his &amp; hers sinks, jetted Victorian tub, oversize shower and a gas log fireplace</li>\n <li>2nd Master Suite with King Bed, full bath, and TV</li>\n <li>Queen Bedroom with full hall bath</li>\n</ul>\n\n<p>MAIN LEVEL:</p>\n\n<ul>\n <li>Gourmet kitchen with high-end appliances, island bar that seats 4</li>\n <li>Dining room with large round table that seats 8, mountain view</li>\n <li>Living room with vaulted ceilings, wet bar, double-sided stone gas log fireplace, TV and DVD/CD player</li>\n <li>Walk out deck with private hot tub and gas BBQ grill</li>\n</ul>\n\n<p>LOWER LEVEL:</p>\n\n<ul>\n <li>Bedroom with 2 twin beds</li>\n <li>Full bath</li>\n <li>Family room with Queen pullout sleeper sofa, TV &amp; wet bar</li>\n <li>Entertainment cabinet with lots of games for kids and adults</li>\n <li>Powder room bath and mud room with bench seat in front entry</li>\n</ul>\n\n<p>HEATED GARAGE &amp; ICE-FREE DRIVEWAY</p>\n\n<p>SLEEPING ARRANGEMENTS: 2 King Master Suites, 1 Queen Bedroom, 4th Bedroom with 2 Twin beds. Queen Sleeper sofa in lower level family room offers additional sleeping options.</p>\n\n<p>This high end luxury home is family friendly and comes complete with in-floor radiant heat, 4 TV&#39;s, 2 DVD players, VCR, free Wi-Fi Internet, Cable TV, 2 washers &amp; 2 dryers, heated enclosed one-car garage with space right out front for a second vehicle on the heated driveway and additional parking nearby!</p>\n\n<p>With a chef&#39;s dream kitchen, 2 living areas, 2 decks and a hot tub, Base Camp is the perfect place for a multi-family get-a-way or a family reunion.</p>\n\n<p>Relax and enjoy the Winter Park lifestyle from the luxurious comfort of Base Camp 490.</p>\n\n<p>Location: Just 1/4 mile from Winter Park Village, about two miles to downtown Winter Park. Ski access available by 150 yard walk on maintained path to Corridor ski trail (some stairs).</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter ski get-away or a summer &quot;Beat the Heat&quot; vscation.</p>\n', '<p><strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Private heated 1 Car Garage &amp; Driveway, Short Hike To Slopes (~150 yards w