(5, '2016-05-27 18:21:37', '2016-09-08 15:14:20', 1, 5, 'Base Camp at Jane Creek #496', 'base-camp-at-jane-creek-496', 'Winter Park - Ski-in/Ski-Out 4 Bedrm,2 King Masters, Pvt Hot Tub, 2 Living Area', '05012d457c02d7f', '10', '4', '4.5', 'private', 'no', 'no', '496 Iron Horse Way', 'Winter Park', 'CO', 80482, '$1,000', 'no', '<p>Breathtaking 4 bedroom, 4.5 bathroom ski-in/ski-out 3000 square foot luxury town home located on the ski corridor, midway between the Mary Jane and Winter Park lifts. Nestled on the banks of Jane Creek and adjacent to the national forest, Base Camp is the ultimate in convenience and luxury. Soaring cathedral ceilings, 3 fireplaces, walls of windows looking out over a cascading mountain creek and the towering pines make a truly memorable setting. Soak in the private hot tub on the back deck and watch the wildlife amble by. For the perfect mountain get-a-away, let Base Camp on Jane Creek be your home-away-from-home.</p>\n\n<p>Tucked away in the scenic Fraser Valley beneath the towering peaks of the Continental Divide lies the Colorado mountain town of Winter Park. Winter Park is known for breath taking scenery, abundant wildlife, gracious hospitality, and world class skiing.</p>\n\n<p>The Winter Park-Mary Jane ski complex averages 400 inches of Colorado champagne powder and boasts the most snowfall of any major Colorado resort! Winter Park has five distinct mountains: Winter Park, Mary Jane, Parsenn Bowl, Vasquez Cirque and Vasquez Ridge, with plenty of runs for skiers and snowboarders of all abilities. Mary Jane is renowned for her moguls. Winter Park&#39;s newest lift, The Panoramic Express is located on Mary Jane Mountain and is the highest, high-speed six-pack chairlift in North America. It starts near the Sunnyside chairlift boarding terminal and runs to the top of Parsenn Bowl, to an elevation of 12,060 feet. With over 3,000 skiable acres, 143 designated trails, over 1200 acres of off-piste terrain, Winter Park has something for skiers and boarders of every ability.</p>\n\n<p>Winter activities include downhill and cross-country skiing, snowboarding, sleigh rides, dog sled rides, hot air ballooning, ice skating, ice fishing, snow cat photographic tours, snowmobiling, sledding, tubing and snowshoeing. Fraser boasts a tubing hill and is 10 minutes away. The Spa at Hot Sulphur Springs is a 20 minute drive away and is open year round. Summer Activities include mountain biking, hiking, alpine tubing, climbing wall, disc &amp; mini golf, leaps &amp; bounds bungee, whitewater rafting, fly fishing, horse-back riding, golf, fishing, hiking, back packing, water skiing, jet skiing, rock climbing, and wildlife viewing &amp; photography and shopping. Rocky Mountain National Park is only 30 minutes away - hike the trails, see the high mountain lakes &amp; snow fields, or watch the herds of elk and big horn sheep. Take a day trip to Mt. Evans and see the mountain goats grazing beside the roadway. Winter Park is truly a four season destination. So come on out and enjoy it all.</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter ski get-away or a summer &quot;Beat the Heat&quot; vacation.</p>\n', '<p><strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Private heated 1 Car Garage &amp; Driveway, Short Hike To Slopes (~150 yards with stairs) Two Living Areas, Washers &amp; Dryer,&nbsp; Free Wireless Internet, Gourmet Kitchen, Three Gas Fireplaces, Private Outdoor Gas Grill, On Free Shuttle Route, 5 TV&#39;s, Comcast Cable, DVD/VCR Player, 2 Decks<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n4 bedrooms, 4.5 bathroom<br />\nSKI-IN/SKI-OUT<br />\n2 King Master Suites<br />\nPrivate Hot Tub<br />\n2 living areas<br />\n3 fireplaces<br />\nfree shuttle route<br />\nwalking distance to the base village<br />\n<br />\n<strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 10 (8 in beds + 2 on sleeper sofa)<br />\nBedroom 1: King Master Suite<br />\nBedroom 2: King Master Suite<br />\nBedroom 3: Queen Bedroom<br />\nBedroom 4/Lower Level Family Room: large family room/sleeping space with 2 twin beds &amp; pull-out sleeper sofa</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $550/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $450/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $475/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Week Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $550/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $650/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $600/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $700/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $1,600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $1,600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $800/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Preside