(6, '2016-06-16 17:56:00', '2016-07-29 17:37:40', 1, 6, 'Divide View Penthouse ', 'divide-view-penthouse', 'Spacious Penthouse in the Heart of Downtown, Mountain Views, Shuttle Route', 'e56ce2c962546b3', '10', '3', '3', 'public', 'no', 'no', '79050 US Hwy 40', 'Winter Park', 'CO', 80482, '$700', 'no', '<p>This top-floor penthouse condominium has a newly customized interior design, a remodeled gourmet kitchen and premium furnishings. Each room presents guests with stunning views including the Continental Divide, Indian Peaks, or Downtown Winter Park.</p>\n\n<p>This gorgeous home has three levels. Entry is on the lower level, which is where two master suites are located. Each master suite has a queen-sized bed, coordinating furniture, a TV/DVD/VCR and a private bath. The main Master has a jetted Jacuzzi tub and a walk-out balcony.</p>\n\n<p>The wide open and spacious main level has two living areas, a fully-equipped gourmet kitchen, a gas fireplace and a dining table that seats eight. Complimentary High Speed Internet and Satellite TV. The d&eacute;cor is amazing. A private ski equipment storage closet is right outside the front door.</p>\n\n<p>Sleeping arrangements: sleeps 10 in beds<br />\nBedroom 1: Queen Master Suite<br />\nBedroom 2: 2nd Queen Master Suite<br />\nBedroom 3: Bunk Room with 2 sets of double bed down, twin bed up bunks (6)</p>\n\n<p>Divide View offers the best of both worlds &ndash; loated in the heart of downtown Winter PArk yet close to the ski base area. If you do not have a car to park in the free underground parking, the shuttle stop is located just outside the front doors. The free Winter Park ski shuttle will deliver you to the ski base in less than ten minutes.</p>\n\n<p>After your return from a hard day of play on the slopes, you can take advantage of the community hot tub and a fitness center with a heated swimming pool is located next door for a nominal guest fee. Gold-medal fly-fishing all over the Grand Valley is just minutes away and the three highly rated golf courses - Grand Elk, Pole Creek, and Sol Vista - are within ten miles of downtown. Do you enjoy hiking, nature watching, biking? While in Winter Park, you must take advantage of the nearly 600 miles of mountain biking/hiking trails.</p>\nWinter Park is truly a 4-season vacation destination.&nbsp; Book your get-way stay in Divide View now!', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Hot Tub,&nbsp; underground parking in a shared garage,&nbsp; Free Wireless Internet &amp; Caable TV, Gourmet Kitchen,&nbsp; Gas Log Fireplace, On Free Shuttle Route,&nbsp; DVD/VCR Player,<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n3 bedrooms, 3 Bathroom:<br />\nLocated in the heart of downtown Winter Park....walking distance to all the downtown shops and restaurants<br />\n2 Queen Master Suites<br />\nShared Community Hot Tub<br />\nlarge living area...open floor plan<br />\n1 gas log fireplaces<br />\nfree shuttle route<br />\n<br />\n<strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 10 (10 in beds)<br />\nBedroom 1: Queen Master Suite<br />\nBedroom 2: Queen Master Suite<br />\nBedroom 3/Loft: Bunk Room with 2 sets of twin over double bunk beds', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $400/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $225/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 