(7, '2016-06-16 18:07:31', '2016-07-29 16:45:20', 1, 7, 'Dreamcatcher #180 at Lakota', 'dreamcatcher-180-at-lakota', 'Fabulous 5-BR Luxury Home in Lakota, Views. Private Hot Tub & Sauna. Sleeps 14. 2 King Master Suites, 2 living areas.', 'b5a70498274264b', '14', '5', '4.5', 'private', 'no', 'yes', '180 Dreamcatcher South Lakota', 'Winter Park', 'CO', 80482, '$1,200', 'no', '<p>BOOK YOUR WINTER SKI VACATION or SUMMER GET-AWAY IN THIS FABULOUS HOME NOW!!</p>\n\n<p>Dreamcatcher 180: a fabulous 5-BR Luxury Home in Lakota, Views. Perfect for 2 families. Sleeps 14 This distinctive home is situated in the signature LAKOTA community across from the world class Winter Park ski base. This five bedroom, 4.5 bath luxury home with over 3700 square feet offers privacy from all locations &ndash; enjoy the hot tub or a gas-grilled meal while gazing at the unobstructed view of the slopes from private lower patio or upper deck. If you are in Winter Park, be sure watch the night time ski show down the front ski slopes at Christmas and New Year&rsquo;s Eve &ndash; it is awesome!</p>\n\n<p>Dreamcatcher at Lakota has a fully-equipped gourmet kitchen and a 40&Prime; HD Plasma TV with a home theater sound system on the main floor living room. The lower level family room is equipped with a 40&Prime; HD Flat Panel LCD TV with a home theater sound system. What could be better than returning from a great day on the slopes to your favorite TV program or movie on these HD televisions with movie theater sound &ndash; all in the privacy of your home! This is life at its best! Dreamcatcher is equipped with radiant (heated) flooring throughout the home (under carpet and the stunning pickel barrel wood flooring) and in the garage.</p>\n\n<p>There are three gas fireplaces (enjoy a fire with a flip of a switch), an amazing sauna, full-sized washer/dryer, and complimentary Ethernet and wireless high-speed internet. And for the wee ones, a portable crib and high chair is provided.</p>\n\n<p>Winter Park offers a free shuttle service from several parking lots (free) located just outside Lakota. Guests can drive one block to the free Winter Park parking lot and hop on the Winter Park free shuttle that runs a continuous circuit from the parking lot to the base. You can leave home and be in line at the chair lift in 10 minutes. Or drive across Hwy 40 and park in one of the resort lots (North Bench or Lone Tree), or even in the parking areas in Old Town.</p>\n\n<p>This signature Dreamcatcher five bedroom/4.5 bathroom home has two master king suites with private bathrooms that are equipped with dual sinks, and a tiled walk-in shower. One master king suite has a Jacuzzi tub. Bedroom #3 is a queen master suite. The 4th bedroom houses two twin beds. Both bedrooms share a guest bath with double sinks and large walk-in tiled shower. Finally, the 5th bedroom on the lower level has a twin/twin bunk and full size bed. Also on the lower level&hellip;a fantastic family/game room with a 40&Prime; HD LCD TV and a wet/dry sauna with seating for 2-4. Walk out the french doors to the private hot tub with seating for 6-8. This home is high end but kid friendly. All distinctive linens and bedding are of high quality.</p>\nWith 5000 square feet including 2 King Master Suites, a chef&#39;s dream kitchen, 2 living areas, 2 decks and a hot tub, Dreamcatcher 180 is the perfect place for a multi-family get-a-way or a family reunion.\n\n<p>Relax and enjoy the Winter Park lifestyle from the luxurious comfort of Base Camp 490.</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter &quot;STAY, PLAY &amp; SAVE&quot; ski get-away or a summer &quot;Beat the Heat&quot; vscation.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Private Sauna, Private heated 3 Car Garage, Two Living Areas, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Three Gas Fireplaces, Private Outdoor Gas Grill, Huge Deck with view of ski slopes &amp; Continental Divide,&nbsp; Patio<br />\n<br />\n<strong>KEY FEATURES:<br />\n5 Bedroom, 4.5 Bathroom</strong><br />\nPrivate hot tub (outdoor)<br />\nWet/Dry Sauna - seats 4.<br />\nJacuzzi corner unit tub in main Master Bathroom<br />\nAttached heated three-car garage with driveway parking for 2 additional vehicles<br />\n3 Gas fireplaces (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) &ndash; Ethernet and wireless provided.<br />\nComcast Cable TV<br />\nMain Level Family Room - 40&rdquo; HD TV with home theater surround sound system<br />\nLower Level Game Room - 42&#39; HD TV with home theater surround sound system<br />\nKing Master Bedroom &ndash; 32&#39; LCD DVD combo<br />\nOther bedrooms - 32&#39; LCD DVD combo (except bunk bedroom)<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, gas range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nTwo decks &ndash; one off the main living space housing the gas grill, and table and chairs. Lower patio houses the five person hot tub.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 14 (12 in beds + 2 on sleeper sofa)<br />\nBedroom #1: King Master Suite 1: King bed. Bathroom with dual sinks, Jacuzzi tub, separate walk-in tile shower.<br />\nBedroom #2: King Master Suite 2: King bed. Bathroom with dual sinks, soaker tub, walk-in tile shower.<br />\nBedroom #3: Queen Bedroom<br />\nBedroom #4: Two twin beds.<br />\nBedroom #5: Bunk Bedroom: Double bed and a twin over twin bunk<br />\nPull-out sleeper sofa in lower level family room offers additional sleeping options.</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $650/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $750/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $650/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $675/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $450/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $575/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $650/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $600/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $700/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $1500/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $1600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $700/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $800/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $750/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $1000/night <em>(4 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $775/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $950/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - 