(8, '2016-06-16 18:18:05', '2016-07-29 17:38:03', 1, 8, 'Red Quill #105', 'red-quill-105', 'Luxury 3-Bedroom Townhome in Downtown Winter Park, Private Hot Tub', 'a5611c6e324c97a', '12', '3', '3.5', 'private', 'no', 'no', '105 Red Quill Way', 'Winter Park', 'CO', 80482, '$500', 'no', '<p>This spacious 3-level 3-bedroom, 3.5 bathroom townhome in Red Quill Village sleeps 8 in beds plus an additional 4 on the sleeper sofa and futon. Beautifully appointed with marble, granite, tile, stainless steel and other fine finishes throughout, you&#39;re home away from home welcomes you!</p>\n\n<p>The entry level has an oversized single car garage with plenty of room to store your gear. The bunk room has a queen bed and twin bunks with its own full bathroom.</p>\n\n<p>Relax and enjoy the private hot tub, located on the patio outside, which seats six comfortably.</p>\n\n<p>The main level has a fully-equipped kitchen with all the amenities you&#39;d desire in a luxury vacation rental. You&#39;ll enjoy the large kitchen with a gas stove, stainless steel appliances, pantry, cupboards and lots of granite counter space. The breakfast table seats four and looks out of the front balcony with peek-a-boo views of the nearby mountains. The main level has a powder room. The dining table has seats for 10 and looks out on the back balcony. The living area is spacious and comfortable, bright and airy with large windows.</p>\n\n<p>The upper level&#39;s beautiful master suite has a king bed and gorgeous bathroom. Outfitted with a separate walk-in glass and tile shower and soaking tub, the bathroom sports marble tile throughout. The queen master suite is accommodating and beautifully dressed.</p>\n\n<p>Red Quill Village is located in the heart of downtown Winter Park near bars, restaurants, and shopping. The free wintertime ski resort shuttle stop is just down the street. The old Idlewild ski area with great hiking trails is just a 5 minute walk from the front door.</p>\n\n<p>With plenty of space to spread out on 3 levels, Red Quill #105 is a great choice for a single family or a multi-family group.</p>\n\n<p>Give us a call at 303-704-7291. We have deals on transportation from the airport and ski gear rentals.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Private 1 Car Garage & parking for 1 additional car in the driveway, Washer & Dryer,  Free Wireless Internet & Cable TV, DVD/VCR Player, Well-equipped Kitchen, Gas Fireplace, Private Outdoor Gas Grill,<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\nPrivate hot tub (outdoor)<br />\nAttached 1car garage with driveway parking for 1 additional vehicle<br />\n3 Gas fireplaces (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) – Ethernet and wireless provided.<br />\nComcast Cable TV<br />\nKitchen – fully equipped kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, gas range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nTwo decks – one off the main living space and one off the reading nook housing the gas grill. Lower patio houses the five person hot tub.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 12 (8 in beds + 2 on sleeper sofa + 2 on futon bed)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen Master Suite<br />\nBedroom #3: Bunk Room with a Queen Bed & a twin over twin bunk<br />\nPull-out sleeper sofa in lliving room & a futon bed in the reading nook roffer additional sleeping options.</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $450/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $250/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $225/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $350/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $500/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $800/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $900/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Weekend 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $450/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s & Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $650/night <em>(4 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $650/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $325/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Value Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Begins 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Standard Rate:</strong><br />\nFrom $500/night <em>(2 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $250<br />\nPrivate Hot Tub Fee: $100<br />\nLodging Tax: 10.9%</p>\n', '96ea98024978e7d', 32),
(9, '2016-06-16 18:41:07', '2016-08-29 10:59:04', 1, 9, 'Slopeside #100', 'slopeside-100', 'Perfect All Season Ski-in Slopeside Townhome.', 'ccaada79a7a1939', '10', '3', '3.5', 'public', 'no', 'no', '100 Clover Lane', 'Winter Park', 'CO', 80482, '$600', 'no', '<p>Welcome to Slopeside #100, the perfect all-season get-a-way. Located in the highly desirable ski base community of Slopeside Village, our luxury 3 bedroom, 3.5 bath townhome has been completely remodeled and has a brand new feel.</p>\n\n<p>Slopeside 100 is just a short walk to Winter Park ski resort, the ski lifts and the Fraser River Trail. The (wintertime only) free resort shuttle stops at the corner and offers quick and convenient access to the resort.</p>\n\n<p>Slopeside #100 has a spacious 2500 square feet on two floors and includes a heated one car enclosed garage with parking for an additional vehicle in the driveway. Soaring tongue &amp; groove cathedral ceilings and windows all around make this home light, bright and airy.</p>\n\n<p>The ground level features a tiled entry foyer with boot bench and coat rack and easy access from the garage. A full size washer, dryer and cleaning supplies in the laundry area make long stays a breeze and just add to the conveniences found at our slopeside home. Two bedrooms and two full baths complete the lower level. Bedroom #2 is a spacious Queen Master Suite, with a dresser, closet and attached bath. Bedroom #3 is a bunk room that will sleep 5. Two sets of twin over twin bunk beds sleeps 4. A pull-out trundle will sleep one more and is perfect for the littlest ones. With 2 sets of twin over bunk beds, a dresser, closet and big 52&#39; flat screen HD TV with a Blu-Ray DVD player, this is the perfect space for the kids to sleep, play and watch TV or a movie. There is a collection of over 100 DVD&#39;s to help keep everyone entertained. Large bay windows and a window seat add additional natural light and views of the great outdoors.</p>\n\n<p>The upper level has an open floor plan, providing easy flow from kitchen to dining to living areas. The large gourmet kitchen has new appliances and is fully equipped for even the most discerning cook. The island bar has seating for three. A gas grill on the deck offers the chance to enjoy a fresh grilled steak after a great day on the slopes. The dining room table will seat six comfortably. Relax on the sofa in front of the cozy stone fireplace while you watch a movie on the 52&#39; flat screen HD TV and DVD Player, read a book or just watch the snow come down outside of the large picture window. A half bath is located just off the living area. A work nook with study desk and chair and free high speed WI-FI internet help keep you connected.</p>\n\n<p>The main level is completed by the spacious Master Suite. The Master bedroom boasts a King bed with an extra comfortable mattress, two night stands, a dresser, and a 42&#39; flat screen digital TV. The attached Master Bath has a large soaker tub and a separate walk-in tile &amp; glass shower.</p>\n\n<p>Slopeside 100 provides you with a cozy and comfortable &#39;home away from home&#39; experience.</p>\n\n<p>The Slopeside Village community is just a 5 minute walk from the beginning of the Fraser River Trail and less than a 10 minute walk from the slopes. Enjoy an early morning cross country or snow shoe excursion along the banks of the Fraser River. Moose are occasionally spotted grazing in the willows that grow along the banks of the river. Follow the trail into downtown Winter Park for a cup of coffee or breakfast at one of the fine restaurants.</p>\n\n<p>After a great day on the slopes, hop in the large community hot tub that seats 6 to 8 and relax your muscles in the steaming waters while enjoying great views of the Winter Park ski runs.</p>\n\n<p>We are kid friendly. A portable crib and high chair is available for the little ones by advance request.</p>\n\n<p>Slopeside is well named. Situated at the base of Winter Park Resort, Slopeside Village offers the convenience of being in the base area without the noise, traffic and congestion of the central resort. It is even possible to ski-in!. The complimentary resort shuttle stops at the entrance to Slopeside Village and whisks you to the lifts in less than 2 minutes.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Private 1 Car Garage with parking in driveway for 1 additional vehicle, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplacs, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedroom, 3.5 bath townhome</strong><br />\nWalking distance to ski area<br />\nFree Shuttle Route<br />\nShared Community hot tub (outdoor)<br />\nAttached heated 1-car garage with driveway parking for 1 additional vehicle<br />\n1 Gas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, gas range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nDeck off the main living space housing the gas grill, and table and chairs.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 8 (8 in beds)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen Master Suite<br />\nBedroom #3: Bunk Bedroom: Two sets of twin over twin bunks</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $450/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $250/night <em>(3 night minimum stay)</em></p>\n\