(11, '2016-06-16 19:58:49', '2016-09-02 20:04:17', 1, 11, 'Slopeside #200', 'slopeside-200', 'Wonderful Slopeside 3 Bedroom Townhome - Perfect Ski Retreat', '794ab4fa5619b34', '10', '3', '3.5', 'public', 'no', 'no', '200 Clover Lane', 'Winter Park', 'CO', 80482, '$600', 'no', '<p>Welcome to Slopeside #200 - the perfect all-season get-a-way. Located in a highly desirable ski base community, our luxury 3 bedroom, 3 full bath townhome is within walking distance of the resort, the ski lifts and the Fraser River Trail.</p>\n\n<p>Slopeside #200 has a spacious 2400 square feet on two floors and includes a heated one car enclosed garage with parking for an additional vehicle in the driveway. Soaring tongue &amp; groove cathedral ceilings and lots of windows make this home light, bright and airy.</p>\n\n<p>The ground level features a tiled entry foyer with closet, boot bench and coat rack - plenty of space to store your winter gear. There is a full size washer, dryer and cleaning supplies in the laundry room. Two bedrooms and a full bath complete this level. One bedroom is a Queen Master Suite, with a dresser and closet. The second bedroom is also a Queen with a closet, window seat and large bay windows, adding additional natural light and views of the great outdoors.</p>\n\n<p>The upper level hosts the King Master Suite. The living space is an open floor plan. The large gourmet kitchen has newer appliances and is fully equipped for even the most discerning cook. The island bar has seating for three. An electric grill on the deck offers the chance to enjoy a fresh grilled steak after a great day on the slopes. The dining room table will seat six comfortably. Relax on the sofa in front of the cozy river rock gas log fireplace while you watch a movie on the HD Big Screen TV, read a book or just watch the snow come down outside the large picture window. A third bath is located just off the living area. Free Wi-Fi keeps you connected.</p>\n\n<p>The main level is completed by the spacious King Master bedroom. The Master Suite boasts a new King bed with an extra comfortable mattress, two night stands, a dresser and a large Master Bath, with a walk-in closet, large soaking tub, and a separate walk-in tile &amp; glass shower.</p>\n\n<p>Each bedroom has a TV with DVD Player.</p>\n\n<p>Colorado style furnishings and decor provide you with a cozy and comfortable &#39;home away from home&#39; experience.</p>\n\n<p>Slopeside is just a 5 minute walk from the beginning of the Fraser River Trail. Enjoy an early morning cross country or snow shoe excursion along the banks of the Fraser River. Moose are occasionally spotted grazing in the willows that grow along the banks of the river. Follow the trail into downtown Winter Park for a cup of coffee or breakfast at one of the fine restaurants.</p>\n\n<p>A large community hot tub that seats 6 to 8 guests and is located just beyond the front door. After a great day on the slopes, hop in and relax your muscles in the steaming waters while enjoying great views of the Winter Park ski runs.</p>\n\n<p>We are kid friendly. A portable crib and high chair is available for the little ones by advance request.</p>\n\n<p>Slopeside is well named. Situated at the base of Winter Park Resort, Slopeside offers the convenience of being in the base area without the noise, traffic and congestion of the central resort. It is even possible to ski-in!. The complimentary resort shuttle stop is a minute walk away and whisks you to the lifts in less than 2 minutes.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Private 1 Car Garage with parking in driveway for 1 additional vehicle, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplacs, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedro