(12, '2016-06-16 20:56:30', '2016-09-12 00:43:57', 2, 12, 'Slopeside #203', 'slopeside-203', 'Upscale Slopeside Townhome, Walking Distance to the Lifts', 'bddddbbe2eca208', '8', '4', '3', 'public', 'no', 'no', '203 Clover Lane', 'Winter Park', 'CO', 80482, '$600', 'no', '<p>Slopeside #203, the perfect all-season get-a-way. Located in the highly desirable ski base community of Slopeside Village, our luxury 4 bedroom, 3 full bath townhome condo is within walking distance of the resort, the ski lifts and the Fraser River Trail. The free resort ski shuttle stop is just steps away!</p>\n\n<p>Slopeside #203 has a spacious 1900 square feet on two floors and includes a heated one car enclosed garage with parking for an additional vehicle in the driveway. Soaring tongue &amp; groove cathedral ceilings, lots of windows and 2 sets of sky lights make this home light, bright and airy.</p>\n\n<p>The ground level features a tiled entry foyer with closet, boot bench and coat rack - plenty of space to store your winter gear. There is a full size washer, dryer and cleaning supplies in the laundry area. Three bedrooms and a full bath complete this level. Bedroom #2 has a queen bed, dresser and closet. The Bedroom #3 is also a queen with a dresser and closet. The Bedroom #4 is has a pull-down Queen size Murphy bed. {there are plans (the bed has been ordered) to convert the 3rd bedroom from a Queen into a bunk room with a Queen bed down and a twin up before Christmas but at present the 3rd bedroom remains a Queen}</p>\n\n<p>The upper level is a great room - open floor plan. The large gourmet kitchen has newer appliances and is fully equipped for even the most discerning cook. The island bar has seating for four. A gas grill on the deck offers the chance to enjoy a fresh grilled steak after a great day on the slopes. The dining table will seat six comfortably. Relax on the leather sofa in front of the cozy stone fireplace while you watch a movie, read a book or just watch the snow come down outside of the large picture window. A third full bath with a steam shower is located just off the living area.</p>\n\n<p>The main level is completed by the spacious Master bedroom. (Bedroom #1). The Master Suite boasts a comfy Queen bed with an extra comfortable mattress, two night stands, a dresser and a large Master Bath, with a walk-in closet, large soaking tub, and a separate walk-in tile &amp; glass shower.</p>\n\n<p>Colorado style furnishings and decor provide you with a cozy and comfortable &#39;home away from home&#39; experience.</p>\n\n<p>Slopeside Village is just a 5 minute walk from the beginning of the Fraser River Trail. Enjoy an early morning cross country or snow shoe excursion along the banks of the Fraser River. Moose are occasionally spotted grazing in the willows that grow along the banks of the river. Follow the trail into downtown Winter Park for a cup of coffee or breakfast at one of the fine restaurants.</p>\n\n<p>Slopeside #203 offers its guests a large community hot tub that seats 6 to 8 guests and is located right out the front door. After a great day on the slopes, hop in and relax your muscles in the steaming waters while enjoying great views of the Winter Park ski runs.</p>\n\n<p>We are kid friendly. A portable crib and high chair is available for the little ones by advance request.</p>\n\n<p>Slopeside is well named. Situated at the base of Winter Park Resort, Slopeside Village offers the convenience of being in the base area without the noise, traffic and congestion of the central resort. It is even possible to ski-in!. The complimentary resort shuttle stops at the entrance to Slopeside Village and whisks you to the lifts in less than 2 minutes.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Private 1 Car Garage with parking in driveway for 1 additional vehicle, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplacs, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>4 Bedroom, 3 bath townhome</strong><br />\nWalking distance to ski area<br />\nFree Shuttle Route<br />\nShared Community hot tub (outdoor)<br />\nAttached heated 1-car garage with driveway parking for 1 additional vehicle<br />\n1 Gas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, gas range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nDeck off the main living space housing the gas grill, and table and chairs.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 9 (9 in beds)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen Master Suite<br />\nBedroom #3: Bunk Bedroom: Queen bed down and twin bed up (sleeps 3)<br />\nBedroom #4: Pull down Queen Murphy bed</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $450/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $450/night <em>(3 night minimum stay)</em></p>\n\