(13, '2016-06-16 21:10:28', '2016-09-12 18:26:55', 2, 13, 'Slopeside #206', 'slopeside-206', 'Winter Park Base Location with Views, Privacy; Walk or Take Free Shuttle', '806a2e007e9a832', '10', '3', '3', 'public', 'no', 'no', '206 Clover Lane', 'Winter Park', 'CO', 80482, '$500', 'no', '<p>This spacious three bedroom luxury townhouse with over 2000 square feet is located in the signature ski base community of Slopeside Village, located in Old Town Winter Park, just a short walk to Winter Park Ski Resort or a quick 2 minute trip on the free ski shuttle. Slopeside 206 provides first-class amenities with a classic Colorado mountain theme and feels like a home away from home.</p>\n\n<p>This home has a fully-equipped gourmet kitchen, a 40&Prime; LCD TV in the living room as well as a garage, gas fireplace (enjoy a fire with a flip of a switch), full-sized washer/dryer, cable TV, and complimentary wireless high-speed internet. The dining room has seating for 8 people plus 4 more at the breakfast bar.</p>\n\n<p>The king master suite is located on the main level and provides a king-sized bed. It has a 27&quot; TV. The King Master bathroom includes a soaker tub and walk-in shower stall and a separated toilet stall. Bedroom #2 offers a queen-sized bed and is located on the lower floor and also has a 20&rdquo; TV. Bedroom #3) has a twin/twin bunk bed and a double futon with a single bunk up and an en-suite bathroom with a tub-shower combination. The double futon folds up in a sitting position so the kids can sit and watch the wall-mounted 32&quot; flat screen TV. There are plenty of games for all ages in the upstairs living area.</p>\n\n<p>Slopeside 206 has a powder room on the main level and a full-sized bathroom on the lower floor for bedrooms #2. This bathroom has a steam shower.... And for extra bed space, Slopeside 206 offers guests a pull-out sleeper sofa located on the main level.</p>\n\n<p>Slopeside 206 is conveniently located within two blocks of the ski base. Slopeside Village offers the best of both worlds &ndash; close enough to the ski base to either walk or take the free Winter Park two minute shuttle ride, but not too close to be involved in the traffic and congestion of the ski base area.</p>\n\n<p>This end unit offers borders a wetlands and offers unobstructed views of the Winter Park ski slopes. A large wrap around deck is the perfect place to sit relax and watch the skiers come down the slopes or take in the clear Colorado starry night skies. There is an outdoor gas grill on the covered portion of the deck.</p>\n\n<p>Slopeside offers its owners and guests an amazing community hot tub that seats 6 &ndash; 8 guests. Want a thrill? Run barefoot from the condominium to the community hot tub and then jump in. WOW! Talk about tingling skin&hellip; And for the wee ones, a portable crib and high chair is stored in the queen bedroom closet.</p>\n\n<p>In addition to the excellent location to the ski base, Slopeside 206 is also located across the street from the trailhead of the renowned Fraser River Trail which leads into Downtown Winter Park where most of the restaurants and shopping are located. Enjoy hiking, snow-shoeing, biking, cross-country skiing, wildlife viewing on the extensive trails, plus much, much more. Keep your eye out for moose who like to browse on the willows that grow along the banks of the river. You&#39;ll find beaver dams all along the river...and if you are lucky, you&#39;ll catch a glimpse of nature&#39;s engineers at work!</p>\n\n<p>NO SMOKING &amp; NO PETS</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Private 1 Car Garage with parking in driveway for 1 additional vehicle, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplacs, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedroom, 3.5 bath townhome</strong><br />\nWalking distance to ski area<br />\nFree Shuttle Route<br />\nShared Community hot tub (outdoor)<br />\nAttached heated 1-car garage with driveway parking for 1 additional vehicle<br />\n1 Gas fireplaces (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, gas range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nDeck off the main living space housing the gas grill, and table and chairs.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 8 (8 in beds)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen bedroom<br />\nBedroom #3: Bunk Room with attached bathroom: Two sets of twin over twin bunks</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $325/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $250/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $250/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFr