(14, '2016-06-16 21:25:13', '2016-09-02 20:19:46', 2, 14, 'Telemark #572', 'telemark-572', 'Luxurious Riverfront Home: Private Hot Tub, Internet, Shuttle', 'a5611c6e324c97a', '9', '3', '2', 'private', 'no', 'no', '572 Telemark Court', 'Winter Park', 'CO', 80482, '$750', 'no', '<p>This brand new townhome in downtown Winter Park is within walking distance to virtually all the restaurants, boutiques, ski shops and bars in town. It is situated behind Hernando&#39;s Pizza (most popular restaurant in town!) and the Sushi Bar, on the free shuttle route, and has mountain, lake, and river views. A private outdoor hot tub for 4-6 people, outside the master suite, sits directly on the pristine Fraser River. Location, location....</p>\n\n<p>The townhome is very well-appointed and decorated impeccably by an interior designer. The spcious great room, kitchen, and dining areas have 13 ft. high ceilings and gorgeous views of the Continental Divide, Fraser River, and a peak view of Baker Lake. There are three bedrooms - a fully-upgraded king master suite, an upstairs quiet queen-sized room with High Def TV, and a third room with a double/twin beds that comfortably accommodates both adults and children. There is also a queen sleeper-sofa in the great room that provides additional sleeping space.</p>\n\n<p>The kitchen/dining room will accommodate at least eight people and is fully equipped with new accessories and utensils. All kitchen/bathroom counter tops are granite! For entertainment, there are 3 HDTVs (with over 100 HD channels (DirecTV) and surround sound), DVD/CD players, books, and board games for the entire family.</p>\n\n<p>Reasons you will love this place:</p>\n\n<ul>\n <li>Walk to popular restaurants/shops in town</li>\n <li>On Free Shuttle Route</li>\n <li>Private outdoor hot tub set on Fraser River</li>\n <li>Decorated impeccably by an interior designer</li>\n <li>Fully equipped kitchen with outdoor BBQ grill</li>\n <li>Movies, sports, and music on 3 HDTV systems</li>\n <li>Sounds of river as you sleep at night</li>\n <li>Views of river, private lake, and mountains!</li>\n</ul>\n\n<p>So come and relax in your own private hot tub outside the most well-appointed townhome in Winter Park. You can&#39;t beat the location, style, and comfort!</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Private 1 Car Garage with parking in driveway for 1 additional vehicle, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplacs, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedroom, 2 bath townhome</strong><br />\nBacks to the Fraser River in downtown Winter Park<br />\nFree Shuttle Route<br />\nPRIVATE HOT TUB (outdoor)<br />\nAttached heated 1-car garage with driveway parking for 1 additional vehicle<br />\n1 Gas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, electric range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nDeck off the main living space housing the gas grill, and table and chairs.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 9 (7 in beds + 2 on sleepr sofa)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen Bedroom<br />\nBedroom #3: Bunk Bedroom: Double bed down and single bed up<br />\nSleeper sofa in the living room offers additional sleeping options</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $350/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016