(15, '2016-06-16 21:48:50', '2016-09-02 20:20:10', 2, 15, 'Trademark 3-1', 'trademark-31', 'Gorgeous Winter Park Base Area Ski Condo - Walk to Lifts', '8dc780382b68205', '10', '3', '3', 'public', 'no', 'no', '20 Trademark Drive, Bldg 3, Unit 1', 'Winter Park', 'CO', 80482, '$650', 'no', '<p>This luxury one level condo is located in Trademark, Winter Park&#39;s most prestigious neighborhood. Trademark 3-1 is located in the front of Trademark, in the Trademark building closest to the lifts. Windows &amp; deck look out over the Fraser River and the ski area. Look for moose browsing in the willows along the river!</p>\n\n<p>CALENDAR or AVAILABILITY PROBLEMS? On occasion this online calendar is not accurate. Dates will occasionally appear as &#39;not available&#39; when they actually are available or the dates may show as available when they are not available. Please call 303-704-7291 or email us to confirm availability for your desired dates.</p>\n\n<p>With a great-room style floor plan, high end furnishings and a large deck overlooking the Winter Park mountain ski slopes as well as the Fraser River, Trademark 3-1 offers both comfort, views and privacy. BBQ on the gas grill. Relax in the deck chairs and listen to the sounds of the river running by.</p>\n\n<p>The well appointed living room has a river rock gas log fireplace and comfortable seating on the leather sofa and loveseat to enjoy cable TV, DVD, VCR and stereo. Curl up in the large easy chair with ottoman and read a book. There are plenty of games for adults and children alike. Complimentary wireless internet with high speed broadband connection is available, along with local phone service.</p>\n\n<p>The well equipped kitchen has granite countertops and all the necessary amenities to prepare a gourmet meal. The dining room seats 6 comfortably. The kitchen bar seats an additional 4 people. Or, dine out at any of Winter Park&#39;s great restaurants.</p>\n\n<p>The Master Suite includes a queen bed, TV and ample closet space. The master bath has a large soaker tub, oversized shower and double vanity sinks. The Queen Suite has a queen bed and its own private bathroom with a tub-shower combination. The Bunk room has two sets of twin over twin bunk beds, easily accommodating 4. Two of the bedrooms have individual color televisions with cable. There is an additional third full bathroom with a tub-shower. The leather couch is a queen sleeper sofa and there is an air bed available by advance request. We are kid friendly and a port-a-crib and high chair are available by request.</p>\n\n<p>Get away from the noise, traffic and congestion of the central resort! Enjoy the convenience of a base area location without the hassles. There is private parking for 2 of your vehicles &amp; mountain bikes in our enclosed underground heated garage. A short walk brings you to the base of Winter Park Resort. Hop on the lifts - your entry point to world class skiing. Don&#39;t like to to walk in ski boots? - catch the complimentary resort shuttle that passes by the Trademark entry gate about every 15 minutes. You can also take a shuttle to downtown Winter Park and Fraser.</p>\n\n<p>Trademark 3-1 is ideally located in Old Town Winter Park, by the ski area base. The Winter Park-Mary Jane ski complex averages over 400 inches of Colorado champagne powder and boasts the most snowfall of any major Colorado resort! Winter Park has five distinct mountains: Winter Park, Mary Jane, Parsenn Bowl, Vasquez Cirque and Vasquez Ridge, with plenty of runs for skiers and snowboarders of all abilities. Mary Jane is renowned for her moguls. Winter Park&#39;s newest lift, The Panoramic Express is located on Mary Jane Mountain and is the highest, high-speed six-pack chairlift in North America. It starts near the Sunnyside chairlift boarding terminal and run to the top of Parsenn Bowl, to an elevation of 12,060 feet.</p>\n\n<p>Winter activities include downhill and cross-country skiing, snowboarding, sleigh rides, dog sled rides, hot air ballooning, ice skating, ice fishing, snowcat photographic tours, snowmobiling, sledding, tubing and snowshoeing. Fraser boasts a tubing hill and is 10 minutes away. The Spa at Hot Sulphur Springs is a 20 minute drive away and is open year round.</p>\n\n<p>Close enough to walk to the lifts but without the noise, traffic and congestion of the central resort, Trademark 3-1 offers the very best in a ski resort location.</p>\n\n<p>So, come on out and enjoy the many activities in and around Winter Park. Summer or winter, Trademark 3-1 is the perfect place to stay and enjoy all that Colorado has to offer.</p>\n\n<p>Enjoy all four seasons in Winter Park from the comfort of Trademark 3-1</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Shared Community Outdoor Hot Tub, Garage with parking for 2 vehicles, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplace, Private Outdoor Gas Grill, Deck with view of ski slopes, walking distance to the ski lifts (6 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n3 Bedroom, 3 full bath condo<br />\nLocated in OldTown....a 5 minute walk to the ski area<br />\nPrivate ski locker located on the premises...perfect for stowing skis, boards, hiking or fishing gear<br />\nViews of the slopes and the river<br />\nFree Shuttle Route<br />\nShared Community hot tub (outdoor)<br />\nSecure garage parking for 2 vehicles.<br />\n1 Gas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, electric range and oven, coffee maker, blender, griddle<br />\nGas grill with cooking utensils<br />\nDeck off the main living space housing the gas grill, and table and chairs.\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 10 (8 in beds + 2 on sleeper sofa)<br />\nBedroom #1: King Master Suite<br />\nBedroom #2: Queen Master Suite<br />\nBedroom #3: Bunk Bedroom: Two sets of twin over twin bunks<br />\nSleeper sofa in living area offers additional sleeping options</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $300/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $200/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $275/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $325/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 22, 2016):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 23, 2016 - Jan 3, 2017):</strong><br />\nFrom $700night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Weekend 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $450/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $400/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $550/night <em>(4 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $600/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Value Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Begins 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Standard Rate:</strong><br />\nFrom $650/night <em>(2 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $250<br />\nLodging Tax: 10.9%</p>\n', 'a000369e25e9217', 22),
(16, '2016-06-16 22:26:44', '2016-07-29 17:41:58', 2, 16, 'Trademark 3-2', 'trademark-32', 'Perfect Winter Park Ski Condo - Walk to Lifts, Hot Tub, Lift Tickets', 'f9d781786c75f94', '8', '3', '3', 'private', 'no', 'no', '20 Trademark Drive, Bldg 3, Unit 2', 'Winter Park', 'CO', 80482, '$600', 'no', '<p>Trademark 3-2 is a luxury condo, located in Trademark Village, a private gated enclave in the Winter Park Ski Resort base area. Trademark 3-2 is an end unit and is located in the Trademark building closest to the Winter Park Resort ski lifts.</p>\n\n<p>Trademark 3-2 is a 3 bedroom, 3 full bath upscale vacation condo located in Trademark Village, a private gated enclave in the Winter Park Ski Resort base area. This one-level luxury condo looks directly out over the Winter Park-Mary Jane ski slopes and the Fraser River. Nestled in the trees with spectacular views of the mountain slopes and the Fraser River, this condo offers privacy with stunning views as well as a premier location in the ski base area. It is conveniently located within walking distance of the Winter Park Resort ski lifts and is on the complimentary resort shuttle line as well. The Fraser River Trail begins at the back of the Trademark Village.</p>\n\n<p>Trademark, Winter Park&#39;s most prestigious neighborhood, is adjacent to the north entrance of Winter Park Resort ski base area, and adjoins &#39;Old Town&#39;. Our gorgeous Trademark 3-2 is an end unit and is located in Trademark building closest to the Winter Park Resort ski lifts!</p>\n\n<p>With a coveted location at the front of Trademark, Trademark 3-2 offers stunning views of the ski slopes and the Fraser River. Floor-to-ceiling windows showcase jaw dropping views of Winter Park ski runs. Relax in the hot tub and watch the resident wildlife wander by. Grill a steak on the gas grill or just relax on the patio furniture, listen to the sounds of the river and watch the snow falling.</p>\n\n<p>The well appointed living room has a river rock gas log 