y)</em></p>\n\n<p><strong>MLK Weekend 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $500/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $425/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s & Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $750/night <em>(4 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $425/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 03 - Mar 26, 2017):</strong><br />\nFrom $750/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $450/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $350/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Spring Value Days 2017 (Apr 24 - May 24, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Memorial Day Weekend 2017 (May 25 - May 29, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer Begins 2017 (Jun 15 - Jun 29, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>4th of July weekend 2017 (Jun 30- Jul 09, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Summer continues 2017 (Jul 10- Jul 13, 2017):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Standard Rate:</strong><br />\nFrom $600/night <em>(1 night minimum stay)</em></p>\n\n<h6>Fees:</h6>\n\n<p>AWP Fee: $79<br />\nCleaning Fee: $250<br