(17, '2016-06-16 22:41:05', '2016-08-29 11:12:27', 2, 17, 'Trademark 3-4', 'trademark-34', 'Winter Park: Stunning Views, Private Hot Tub, Walk to Lifts, Discount Lift Tickets', '9dec709862cda8c', '8', '3', '3', 'private', 'no', 'no', '20 Trademark Drive, Bldg 3, Unit 4', 'Winter Park', 'CO', 80482, '$400', 'no', '<p>This luxury 3-bedroom, 3 bath, one-level condo is located in Trademark, Winter Park&#39;s most prestigious neighborhood. Because it is an end unit, Trademark 3-4 offers spectacular views and privacy. This very private top floor unit looks directly out over the ski area and the Fraser River. It backs to a wooded hillside. There is marble and granite throughout. Great room style floor plan with two decks overlooking the ski slopes and the Fraser River. Soak in the private hot tub that has spectacular views of both the ski runs and the river. BBQ on the gas grill or sit and relax to the sounds of the river below and look at the stars. Inside, floor to ceiling windows provide stunning views of the both the ski area and the river.</p>\n\n<p>With a great-room style floor plan, high end furnishings and two large decks overlooking the Winter Park mountain ski slopes as well as the Fraser River, Trademark 3-4 offers both comfort, views and privacy. Soak in the private hot tub while enjoying spectacular views of both the Winter Park ski runs and the Fraser river. BBQ on the gas grill or sit and relax to the sounds of the river below and look at the nightime stars. Inside, floor to ceiling windows provide jaw dropping views of the mountain ski slopes and the river. Watch the kids ski down the slopes from the comfort of the leather sofa.</p>\n\n<p>The well appointed living room has a gas log fireplace and comfortable seating on the leather sofa and love seat to enjoy cable TV, DVD, VCR and Bose surround sound stereo. Curl up in the large rattan chair and read a book. There are plenty of games for adults and children alike. Wireless and wired internet with broadband connection is available, along with local phone service.</p>\n\n<p>The well equipped kitchen has granite counter tops and all the necessary amenities to prepare a gourmet meal. The dining room seats 6 comfortably and more chairs can be added. Or, dine out at any of Winter Park&#39;s great restaurants.</p>\n\n<p>The master suite includes a king bed, TV and ample closet space. The master bath is tiled in marble and has a large tub, separate walk-in over-sized shower and double vanity sinks. The second bedroom is a Queen Master Suite, with a queen bed and its own private bathroom tiled in travertine. The 3rd bedroom has a Queen bed and a twin over twin bunk bed. All bedrooms rooms color televisions with basic cable. There is a third full bathroom with a travertine tile tub-shower. An air bed can be requested if additional sleeping options are needed. Please request early as air beds are available on a first come, first served basis. We are kid friendly and a port-a-crib and high chair are available by request on a first-come, first-served basis..</p>\n\n<p>Get away from the noise, traffic and congestion of the central resort! Enjoy the convenience of a base area location without the hassles. There is private parking for 2 of your vehicles in our enclosed underground heated garage. A short walk or shuttle ride brings you to the base of Winter Park Resort. Hop on the lifts - your entry point to world class skiing.</p>\n\n<p>Trademark 3-4 is ideally located in Old Town Winter Park, by the Winter Park Ski Resort base area. The Winter Park-Mary Jane ski complex averages over 400 inches of Colorado champagne powder and boasts the most snowfall of any major Colorado resort! Winter Park has five distinct mountains: Winter Park, Mary Jane, Parsenn Bowl, Vasquez Cirque and Vasquez Ridge, with plenty of runs for skiers and snowboarders of all abilities.</p>\n\n<p>Come on out and enjoy the many wintertime and summertime activities in and around Winter Park.</p>\n\n<p>Nestled in the trees with spectacular views, Trademark 3-4 offers a premium combination of luxurious comfort, privacy and stunning views in a quiet ski base area location. Trademark 3-4 is the perfect place to stay and enjoy all that Colorado has to offer.</p>\n\n<p>NO SMOKING and NO PETS allowed.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: Private Outdoor Hot Tub, Secure Heated Garage parking for 2 vehicles, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Gourmet Kitchen, Gas Fireplace, Outdoor Gas Grill, 2 Decks, Great views of ski slopes &amp; river, Walking distance to the ski lifts (5 minute), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedroom, 3 full bath penthouse condo<br />\nPRIVATE HOT TUB</strong> (outdoor) on 1st deck with spectacular view of the ski slopes<br />\nSingle level....all on one floor, top floor penthouse condo<br />\nCathedral ceilings with floor to ceiling windows to take in the breathtaking views<br />\nGranite, marble and travertine accents throughout<br />\nWalking distance to Winter Park ski area (5 minute walk)<br />\nOn the complimentary Resort Shuttle Route<br />\n2 Decks with stunning views of slopes &amp; river<br />\nGas grill on 2nd deck with the same spoectacular views of the ski slopes and the river<br />\nOutdoor seating on both decks<br />\nLarge in-ground community hot tub is just steps away<br />\nFull size Washer &amp; Dryer<br />\nParking for 2 cars in the secure enclosed Heated Garage<br />\nPrivate ski closet on site for ski&#39;s &amp; snowboards, hiking or fishing gear<br />\n1 Gas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV, expanded channels<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, electric range and oven, coffee maker, blender, crockpot<br />\nFraser River 