(18, '2016-06-17 00:20:11', '2016-07-29 17:43:01', 2, 18, 'Wapiti #840', 'wapiti-840', 'Spacious, Well Equipped Condo with Views, Wifi, Free Ski Shuttle Route', 'b27a9ed5b3c3171', '8', '3', '2.5', 'no', 'no', 'yes', '840 Wapiti Drive, Unit #2', 'Fraser', 'CO', 80442, '$400', 'no', '<p>Our well-appointed mountain retreat has everything you need! Comfortable and cozy - 2 living areas make this townhome perfect for families!</p>\n\n<p>Spacious, light and bright with a great main level open floor plan with large windows and sky lights to capture the views of Byers Peak, the beautiful sunsets and starry nights.</p>\n\n<p>The main level open living area is well furnished and offers a large flat screen HD TV so no one misses the big game. Cozy up in front of the fireplace on the sofa or loveseat and enjoy a glass of wine or hot chocolate after a great day outdoors. Large windows let the sunshine in and showcase our mountain views. Open the glass sliding door and walk out onto the deck to take in the views or a breath of fresh mountain air. Fire up the gas grill and enjoy a steak or burger cooked to perfection. The living room sofa and love seat pictured in the photos has been replaced by a leather sofa and love seat. NEW PHOTOS COMING SOON!</p>\n\n<p>The updated kitchen has new stainless steel appliances, granite counter tops and everything you will need to make your meals at home. There is a Safeway grocery store just a mile down the road. There is seating for six at the dining room table and additional three stools at the breakfast bar.</p>\n\n<p>The large king master suite on private upper level boasts vaulted ceilings, large closet, nightstands, a en-suite master bath, a sitting area and computer desk nook. A 43&quot; HD TV completes the master suite.</p>\n\n<p>The lower level family room has a 50-inch HD flat screen HDTV, ,a DVD player and digital cable. The sofa converts to a comfortable double size bed for additional sleeping options. The other two bedrooms and a full bath are also on the lower level so the kids can watch their own TV or get to bed while the adults relax in the main level living room upstairs. The 2nd bathroom has double sinks and a bathtub with shower - perfect for getting all the kiddos ready! All linens and towels provided. The Queen bedroom has a nightstand, a dresser and a 32&quot; HD TV. The twin bedroom has a nightstand, dresser and a 20&quot; HD TV. There is also a full size washer and dryer in the laundry closet for your use.</p>\n\n<p>A ski closet just outside the front door is the perfect place to stow your outdoor gear.</p>\n\n<p>Sleeping arrangements:<br />\nBedroom 1: King Master Suite<br />\nBedroom 2: Queen Bedroom<br />\nBedroom 3: Two twin beds<br />\nSleeper sofa in the lower level family room provides additional sleeping options</p>\n\n<p>Free Comcast cable TV and high speed Wifi internet access!</p>\n\n<p>Wapiti 840 offer a great combination of comfort, location and great value.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: 2 Living areas, Parking for 2 vehicles, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Well equipped Kitchen, Gas Fireplace, Outdoor Gas Grill,&nbsp; Deck, free resort shuttle route.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>3 Bedroom, 2.5 full bath townhome</strong><br />\n2 Living areas<br />\nOn the complimentary Resort Shuttle Route<br />\nDeck with views of the mountains<br />\nGas grill<br />\nFull size Washer &amp; Dryer<br />\nParking for 2 cars in the parking area out front<br />\nGas fireplace (enjoy a fire with a flip of a switch!)<br />\nHigh speed internet (complimentary) wireless<br />\nComcast Cable TV, expanded channels<br />\nKitchen &ndash; fully equipped gourmet kitchen stocked with amenities including: refrigerator with ice maker, dishwasher, microwave, range and oven, coffee maker, blender, crockpot\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 8 (8 in beds)<br />\nBedroom #1: King M