(19, '2016-06-17 00:33:23', '2016-07-29 17:43:31', 2, 19, 'Winter Park Place #08', 'winter-park-place-08', 'Beautiful Winter Park Condo Walking Distance to the Lifts; Free Shuttle', 'a5611c6e324c97a', '4', '1', '1', 'public', 'no', 'no', '1080 Winter Park Drive, Unit #8, Winter Park Place Condos', 'Winter Park', 'CO', 80482, '$200', 'no', '<p>Winter is here!!!!</p>\n\n<p>Our premium 1-bedroom, 1-bath ski condo is newly remodeled and well-appointed with decorator touches throughout and upscale furnishings. It&#39;s the perfect place to relax and unwind after a great day spent outdoors.</p>\n\n<p>Nestled in the trees alongside the Fraser River in a small private complex, our slope-side retreat offers the best of both worlds - great views and the convenience of a great base area location without the noise, traffic and congestion of the central resort.</p>\n\n<p>The property has approximately 800 square feet of living space all on one level.</p>\n\n<p>The condo has an open floor plan with the great room comprised of the living area, dining area and kitchen. A glass sliding door to the walk-out balcony from the living room offers great views of the Winter Park ski slopes. The kitchen is fully equipped and is complete with new appliances and gorgeous granite counter tops. Watch the skiers swoop down the slopes from the comfort of the living room or while relaxing on the deck. The views of the ski runs and Continental Divide from the large windows in the living room and the deck are amazing.</p>\n\n<p>A large flat screen TV sits above the fireplace and offers Comcast Cable channels. There is free WiFi to help keep everyone connected.</p>\n\n<p>The queen bedroom is right off the entry foyer and also has a flat screen TV and it&#39;s own entrance into the full bathroom. The bathroom is a tub/shower combination with a jetted tub. A condo sized washer and dryer can be found in the laundry closet right next to the bathroom. There is also a large coin-op commercial washer and dryer available in the common area for large bulky items like comforters and big heavy winter jackets.</p>\n\n<p>Winter Park Place #8 also has access to the common area with indoor hot-tub, dry sauna and coin-op laundry facilities. Relax in the hot tub while looking out over the Fraser River.</p>\n\n<p>SLEEPING ARRANGEMENTS:</p>\n\n<p>Bedroom 1: Queen Bed<br />\nSleeper sofa in living room offers additional sleeping options</p>\n\n<p>KEY FEATURES:</p>\n\n<ul>\n <li>One-level; 1-bedroom, 1 full bathroom, with great views of the Winter Park Ski runs</li>\n <li>QUEEN Bedroom with high quality linens.</li>\n <li>Full bath</li>\n <li>Sleeper sofa and/or air bed offers additional sleeping options.</li>\n <li>Newly remodeled with granite counter tops, new tile, hardwood floors and new carpet and new appliances.</li>\n <li>1 deck with stunning ski slope &amp; Continental Divide views</li>\n <li>1 fireplace with stone hearth</li>\n <li>TV (flat screen) in Master and Living Room with Comcast cable (basic pkg)</li>\n <li>Outdoor storage closet for your skis or mountain bikes.</li>\n <li>Walking distance to the lifts...about a 5 minute walk</li>\n <li>On the FREE Resort Ski Shuttle Route (2 minute ride)</li>\n <li>Hot Tub &amp; Sauna with views of Fraser River in Common Area</li>\n <li>Short walk to the Fraser River Trail - perfect for x-country skiing, snowshoeing or biking</li>\n <li>Picnic Tables alongside the Fraser River for summer time use</li>\n</ul>\n\n<p>We are child friendly. A portable crib, high chair,are available upon advance request, subject to availability.</p>\n\n<p>Our Winter Park Place slope side condominium is available all year and is the perfect place to relax after exploring all that Colorado has to offer. We are located in the heart of Old Town Winter Park, adjacent to the Winter Park Ski Resort. You can easily walk to the resort or take a 2 minute ride on the free resort shuttle.</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: SHARED COMMUNITY HOT TUB &amp; SAUNA, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Well equipped Kitchen, Gas Fireplace, Outdoor Gas Grill, Deck overlooking the ski area, Great views of ski slopes &amp; river, Walking distance to the ski lifts (5-6 minutes), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>1 Bedroom, 1 full bath condo</strong><br />\nOne-level; 1-bedroom, 1 full bathroom, with great views of the Winter Park Ski runs<br />\nQUEEN Bedroom with high quality linens.<br />\nFull bath (tub/shower)<br />\nSleeper sofa and/or air bed offers additional sleeping options.<br />\nNewly remodeled with granite counter tops, new tile, hardwood floors and new carpet and new appliances.<br />\nDeck with stunning ski slope &amp; Continental Divide views<br />\nGas log fireplace with stone hearth<br />\nTV (flat screen) in Master and Living Room with Comcast cable (basic pkg)<br />\nWasher &amp; Dryer<br />\nOutdoor storage closet for your skis or mountain bikes.<br />\nWalking distance to the lifts...about a 5 minute walk<br />\nOn the FREE Resort Ski Shuttle Route (2 minute ride)<br />\nSHARED COMMUNITY Hot Tub &amp; Sauna with views of Fraser River in the Common Area<br />\nShort walk to the Fraser River Trail - perfect for x-country skiing, snowshoeing or biking<br />\nPicnic Tables alongside the Fraser River for summer time use\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 4 (2 in beds + 2 on sleeper sofa)<br />\nBedroom #1: Queen Bedroom<br />\nSleeper sofa in living room offers additional sleeping options</p>\n', '<strong>Summer 2016 (Jul 11 - Jul 13, 2016):</strong><br />\nFrom $100/night <em>(1 night minimum stay)</em>\n<p><strong>Jazz Festival 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $150/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 28, 2016):</strong><br />\nFrom $125/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day 2016 (Aug 29 - S