(20, '2016-06-17 00:41:32', '2016-07-29 17:44:00', 2, 20, 'Winter Park Place #14', 'winter-park-place-14', 'Great Condo Winter Park Ski Resort Base Area -Walk to Lifts', '6c3d3583c529135', '6', '2', '2', 'public', 'no', 'no', '1080 Winter Park Drive, Unit #14, Winter Park Place Condos', 'Winter Park', 'CO', 80482, '$500', 'no', '<p>Our comfortable and cozy 2-bedroom, 2 bath mountain retreat ski condo is newly remodeled and beautifully decorated with Colorado mountain style furnishings. It&#39;s the perfect place to relax and unwind after a great day on the slopes.</p>\n\n<p>Nestled in the trees alongside the Fraser River in a small private complex, our slope-side retreat offers the best of both worlds - great views and the convenience of a great base area location without the noise, traffic and congestion of the central resort.</p>\n\n<p>The split level interior has 1200 square feet of living space. The entry level contains the 2nd bedroom with a queen bed, second bathroom, open-plan living room with gas fireplace, TV, dining area and kitchen, plus walk-out access to the 2nd deck. The kitchen is fully equipped and has new appliances and granite counter tops. Watch the skiers swoop down the slopes from the comfort of the living room or while relaxing on the deck.</p>\n\n<p>The king master suite is located on the private upper level and has a king-bed, decorative fireplace, TV and walk-out access to the upper deck. The views of the ski runs and Continental Divide from the large windows and the deck are amazing.</p>\n\n<p>Winter Park Place also has a common area with indoor hot-tub, dry sauna and coin-op laundry facilities. Relax in the hot tub while looking out over the Fraser River.</p>\n\n<p>We are child friendly. A portable crib, high chair, booster seat, and baby gate are available upon advance request., subject to availability. We have toys and games to help keep the little ones entertained.</p>\n\n<p>Our Winter Park Place slope-side condominium is available all year and is the perfect place to relax after exploring all that Colorado has to offer. We are located in the heart of Old Town Winter Park, adjacent to the Winter Park Ski Resort. You can easily walk to the resort or take a 2 minute ride on the free resort shuttle.</p>\n\n<p>NO SMOKING and NO PETS</p>\n', '<strong>AMENITIES:</strong><br />\nAmenities: KIng Master Suite, SHARED COMMUNITY HOT TUB &amp; SAUNA, Washer &amp; Dryer,&nbsp; Free Wireless Internet &amp; Cable TV, DVD/VCR Player, Well equipped Kitchen, Gas Fireplace, Outdoor Gas Grill, Deck overlooking the ski area, Great views of ski slopes &amp; river, Walking distance to the ski lifts (5-6 minutes), free resort shuttle route too.<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\n<strong>2 Bedroom, 2 full bath condo</strong><br />\nKing Master Suite on private upper level with private walk-out deck<br />\nNewly remodeled with granite counter tops, new tile, hardwood floors and new carpet and new appliances.<br />\nStunning ski slope &amp; Continental Divide views<br />\nGas log fireplace with stone hearth<br />\nTV (flat screen) in Master and Living Room with Comcast cable (basic pkg)<br />\nWasher &amp; Dryer<br />\nOutdoor storage closet for your skis or mountain bikes.<br />\nWalking distance to the lifts...about a 5 minute walk<br />\nOn the FREE Resort Ski Shuttle Route (2 minute ride)<br />\nSHARED COMMUNITY Hot Tub &amp; Sauna with views of Fraser River in the Common Area<br />\nShort walk to the Fraser River Trail - perfect for x-country skiing, snowshoeing or biking<br />\nPicnic Tables alongside the Fraser River for summer time use\n<p><strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 6 (4 in beds + 2 on sleeper sofa)<br />\nBedroom #1: King Master Suite on private upper level with walk-out deck<br />\nBedroom #2: Queen Bedroom<br />\nSleeper sofa in living room offers additional sleeping options</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $250/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $175/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $125/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $155/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $250/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $225/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $255/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valenties&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $400/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 02, 2017):</strong><br />\nFrom $300/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2