(21, '2016-06-17 00:50:04', '2016-07-29 17:45:53', 2, 21, 'Zephyr 2223', 'zephyr-2223', '1 Bedroom, Ski-in/Ski-Out.', 'a5611c6e324c97a', '4', '1', '1', 'public', 'no', 'no', '201 Zephyr Way, Zephyr Mountain Lodge, Zephyr Riverside, Unit #2223', 'Winter Park', 'CO', 80482, '$300', 'no', '<p>ZEPHYR 2223: PREMIER SKI-IN / SKI-OUT 1BR/1BA CONDO. Just take the elevator down, grab your ski gear in the private ski locker and hit the slopes and enjoy an epic Winter Park powder day. It couldn&#39;t be easier<strong>!</strong></p>\n\n<p>Relax in front of the gas fireplace, have a glass of wine or hot chocolate or take a stroll through Winter Park Village. Two flat screen TV&#39;s with cable help keep everyone entertained.</p>\n\n<p>Eat out at one of the Village restaurants or cook up a meal at home in the fully equipped kitchen.</p>\n\n<p>There are 4 in-ground hot tubs and even an exercise gym on the premises. Other amenities at ZML include heated underground parking (additional fee), and free wi-fi. When staying here, you are just steps away from the ski lifts, ice-skating and the Coca-Cola tubing hill.</p>\n\n<p>This condo is well appointed and well-maintained, with meticulous attention to cleanliness and details.</p>\n\n<p>Great location, cozy furnishings &amp; easy access to everything at Winter Park Resort, make this condo a great choice for your vacation!</p>\n\n<p>Relax, unwind, and enjoy our Colorado hospitality!</p>\n\n<p>We are very glad to have you and hope to have you back, time after time.</p>\n', '<p><strong>AMENITIES:</strong><br />\nSki-in/Ski-out, free wi-fi, free cable, private balcony overlooking the Village at Winter Park, SHARED COMMUNITY HOT TUBS,<br />\n<br />\n<strong>KEY FEATURES:</strong><br />\nSki In/ Ski Out<br />\nFree Wireless Internet<br />\nCable TV / DVD Player / X-Box<br />\nPrivate Balcony<br />\nShared Outdoor Hot Tubs<br />\nOPTIONAL Heated Underground Parking Available for an Additional Fee ($15/day) or Free Offsite Parking<br />\nShared Washer/Dryer (coin-op)<br />\nFully Equipped Kitchen<br />\nGas Fireplace<br />\nComplimentary Ski Locker<br />\nWorkout Facility Access<br />\nOn Free Shuttle Route to Town</p>\n\n<p><strong>SLEEPING ARRANGEMENTS:</strong> Sleeps 4 (2 in beds + 2 on sleeper sofa)<br />\nQueen bed in the bedroom<br />\nPull-out Sleeper sofa in the living room offers additional sleeping options<br />\n&nbsp;</p>\n', '<p><strong>Summer 2016 (Jul 5 - Jul 13, 2016):</strong><br />\nFrom $100/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Jazz Fest 2016 (Jul 14 - Jul 18, 2016):</strong><br />\nFrom $200/night <em>(3 night minimum stay) </em></p>\n\n<p><strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $150/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $95/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $110/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $135/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $150/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $550/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 11, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Weekend 2017 (Jan 12 - Jan 15, 2017):</strong><br />\n