(22, '2016-07-31 21:47:15', '2016-10-20 20:16:15', 3, 22, 'Slopeside #113-D', 'slopeside-113d', '2 bedroom, 2 bath upscale condo, walking distance to Winter Park Resort, elevator, handicap accessible, sleeps 8, shared hot tub, ski-in, ', '20319e1e588bdd9', '8', '2', '2', 'public', 'no', 'yes', '113 Clover Lane, Unit D', 'Winter Park', 'CO', 80482, '250', 'no', '<p>This 2-bedroom, 2 full bath tastefully furnished townhome has it all....location, views, amenities and a classic mountain theme. Ideally located in Old Town Winter Park, just a 5 minute walk or a 3 minute free shuttle ride from the ski lifts and Winter Park Resort, Slopeside 113 offers all the conveniences of a base area location without the noise, traffic or congestion of the base village. You can even ski-in!</p>\n\n<p>The spacious open &quot;all-on-one level&quot; floor plan is perfect for a family or a small group of friends. <strong>This property sleeps up to 8</strong>.&nbsp; <strong data-redactor-tag="strong">Elevator access</strong> makes this property-handicap accessible to persons with limited mobility. Large windows offer stunning views of the Continental Divide and the Winter Park Resort ski slopes. Wood accents and Colorado mountain style furnishings maintain the mountain theme throughout the property. In-floor radiant heat keeps everyone warm and comfy - less drying than other types of heat.</p>\n\n<p>With 2 couches and a leather recliner, the living area has plenty of seating for everyone. A large flat screen TV and stereo system offer apres-ski entertainment. A gas log fireplace and the rich warm glow of the newly installed hard wood flooring in the main living area really add that special touch!&nbsp;</p>\n\n<p>The well equipped open kitchen, complete with granite countertops, newer appliances and all the necessary acoutrements to prepare a gourmet meal, makes eating in a breeze. There is plenty of eating and seating space: the dining table seats 6 and the kitchen island has seats for 4.</p>\n\n<p>The King Master Suite boasts a custom King size log bed. A flat screen TV in the master is also provided for your entertainment. The master bath has a Jacuzzi tub/shower.</p>\n\n<p>The 2nd bedroom has a queen log bed and a twin over twin bunk. The hall bath has a walk-in steam shower....perfect for relaxing after a great day outdoors.</p>\n\n<p>A very comfortable queen sleeper sofa in the living room offers additional sleeping options.</p>\n\n<p>Additional amenities to ensure all the comforts of home include free wifi &amp; cable TV, a washer &amp; dryer, gas grill on the large deck, ski storage, heated one car private garage with room for a 2nd vehicle in the driveway, and a large outdoor common area hot tub just steps from the front door. An interior entry foyer has a boot bench and plenty of space to hang jackets, hats and gloves and even space to leave ski boots in a heated area! The elevator provides easy access and will be a delightful surprise!</p>\n', '<strong>SLEEPING ARRANGEMENTS</strong>: Sleeps 8 (6 in beds + 2 on sleeper sofa)<br />\nBedroom 1: King Master Suite<br />\nBedroom 2: Queen Bed and a twin over twin bunk bed (sleeps 4 in this room)<br />\nSleeper sofa offers additional sleeping options\n<p><strong data-redactor-tag="strong">AMENITIES:</strong> <strong data-redactor-tag="strong">Elevator </strong>(<strong data-redactor-tag="strong">Handicap accessible</strong>) Shared Community Outdoor Hot Tub Private 1 Car Garage with parking in driveway for 1 additional vehicle Washer &amp; Dryer Free Wireless Internet &amp; Cable TV, DVD/VCR Player Gourmet Kitchen Gas Fireplace Private Outdoor Gas Grill, Private Deck with view of ski slopes</p>\n\n<p><strong data-redactor-tag="strong">LOCATION</strong>: walking distance to the ski lifts (5-6 minute), free resort shuttle route too.</p>\n', '<strong>Summer 2016 (Jul 19 - Aug 31, 2016):</strong><br />\nFrom $200/night <em>(2 night minimum stay)</em>\n<p><strong>Labor Day Weekend 2016 (Sep 01 - Sept 05, 2016)</strong><br />\nFrom $225/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Fall Value Days 2016 (Sep 06 - Nov 6, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Opening Days Ski Season 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $175/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $275/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Early Ski Season 2016 (Nov 28 - Dec 8, 2016):</strong><br />\nFrom $250/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Winter Begins 2016 (Dec 9 - Dec 18, 2016):</strong><br />\nFrom $275/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $575/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Christmas - New Years 2016/17 (Dec 26, 2016 - Jan 3, 2017):</strong><br />\nFrom $575/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Days Begin 2017 (Jan 4 - Jan 12, 2016):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>MLK Week 2017 (Jan 13 - Jan 15, 2017):</strong><br />\nFrom $375/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Powder Days 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $300/night <em>(2 night minimum stay)</em></p>\n\n<p><strong>Valentine&#39;s &amp; Presidents Week 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $475/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 2, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Spring Break Begins 2017 (Mar 3 - Mar 26, 2017):</strong><br />\nFrom $500/night <em>(5 night minimum stay)</em></p>\n\n<p><strong>Late Spring Break 2017 (Mar 27 - Apr 9, 2017):</strong><br />\nFrom $400/night <em>(3 night minimum stay)</em></p>\n\n<p><strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $300/night <em>(3 nigh