(23, '2016-09-11 00:08:12', '2016-09-11 00:24:49', 3, 23, 'Pioneer 1735', 'pioneer-1735', 'Gorgeous 5 Bedroom custom home in Rendezvous; 3 King Master Suites, stunning views of Byers Peak, Private hot tub', 'd74cf9e352bfb2b', '12', '5', '4.5', 'private', 'no', 'yes', '1735 Pioneer Trail', 'Fraser', 'CO', 80442, '1000', 'no', 'Gorgeous 5 bedroom custom home located in Rendezvous.&nbsp; This home has everything....3 King Master Suites, 2 living areas, 3 fireplaces, 2 decks, a patio and a private hot tub.&nbsp;\n<p>BOOK YOUR WINTER SKI VACATION IN THIS FABULOUS HOME NOW!!<br />\nSKI SEASON RENTAL AVAILABLE Jan 01 - April 23, 2017</p>\n\n<p>Pioneer 1735: a fabulous 5-BR Custom Luxury Home in Rendezvous is the perfect place for your family to stay.&nbsp; This property is perfect for 2-3 families. Sleeps 12.&nbsp; This distinctive home is situated in the signature RENDEZVOUS community.&nbsp; Located in the hills of Rendezvous, this home borders open space and offers commanding views of Byers Peak and the western mountains .&nbsp; Sunsets are incredible from this home.<br />\n<br />\nThis five bedroom, 4.5 bath luxury home with over 4200 square feet is fully equipped with high end appliances, all the amenities and is a great place to unwind &ndash; enjoy the private hot tub or a gas-grilled meal while watching the sun set over the western mounta ins from private lower patio or upper deck.</p>\n\n<p>Pioneer 1735 has a fully-equipped gourmet kitchen and a flat screen TV with sound system on the main floor living room. The lower level family room is equipped with a Flat Screen TV as well.&nbsp; What could be better than returning from a great day on the slopes to your favorite TV program or movie on these HD televisions with movie theater sound &ndash; all in the privacy of your home! This is life at its best! Pioneer is equipped with radiant (heated) flooring throughout the home (under carpet, wood flooring and tile).</p>\n\n<p>There are three gas fireplaces (enjoy a fire with a flip of a switch), an amazing hot tub, full-sized washer/dryer, and complimentary wireless high-speed internet is provided.</p>\n\n<p>Rendezvous offers a free shuttle service from the sales center. Guests can also drive to any of the free Winter Park parking lots. You can leave home and be in line at the chair lift in 15 minutes.</p>\n\n<p>This signature Rendezvous home has three king master king suites with private ensuite bathrooms that are equipped with dual sinks, tub and a tiled walk-in shower.&nbsp; Bedroom #4 is a queen bedroom.&nbsp; The 5h bedroom has 2 sets of twin over twin bunks . Both these bedrooms share a guest bath with double sinks and a tub/shower. Also on the lower level&hellip;a fantastic family/game room with a flat screen TV&nbsp; and work/stidy desk. Walk out the sliding glass doors to the patio with private hot tub with seating for 6-8. This home is high end but kid friendly. All linens and bedding are of high quality.</p>\nWith 4200 square feet including 3 King Master Suites, a chef&#39;s dream kitchen, 2 living areas, 2 decks and a hot tub, Pioneer is the perfect place for a multi-family get-a-way or a family reunion.\n\n<p>Relax and enjoy the Winter Park lifestyle from the luxurious comfort of Pioneer 1375</p>\n\n<p>CALL (303-704-7291), EMAIL (accesswinterpark@mac.com) or BOOK ONLINE for the perfect winter &quot;STAY, PLAY &amp; SAVE&quot; ski get-away or a summer &quot;Beat the Heat&quot; vscation.</p>\n', '3 King MAster Suites', 'Dec 26 - Jan 03, 2017....$1600/night', 'd3f777a08b66700', NULL),
(25, '2016-09-28 19:16:34', '2016-09-30 22:40:02', 2, 24, 'Hi Country Haus 1009', 'hi-country-haus-1009', 'Cute & Cozy 1-bedroom condo with fireplace. Located in quiet neighborhood with community rec center: indoor heated swimmingg pool, hot tubs, pool table, game room and more.', '20319e1e588bdd9', '4', '1', '1', 'public', 'no', 'no', '432 Hi Country Drive, Bldg 10, Unit 9', 'Winter Park', 'CO', 80482, '$100', 'no', 'Nestled in the the pines in a downtown Winter Park location, this warm, charming, inviting and newly renovated (summer 2016) 1-bedroom, 1 bath condo is the perfect mountain retreat. With enough room to comfortably accommodate 4 guests, this condo is perfect for a couple&#39;s romantic get-away or for a small family out for a memorable high country adventure. The free shuttle stops just steps from the front door. All the shops and restaurants of downtown Winter Park are just a short walk away!<br />\n<br />\nTastefully furnished in a cozy mountain theme with a large moss-rock wood burning fireplace this condo offers that true Colorado mountain ambiance. It has a full kitchen with breakfast bar seating. Kick back and relax in front of a crackling fire after a great day spent outdoors. There&#39;s a flat screen TV in the living room so no one misses the big game! Eat out at one of the great downtown restaurants of whip up a delicious meal in the well-stocked kitchen.<br />\n<br />\nJust steps away is the newly renovated Hi Country Haus Rec Center, with a glass-enclosed indoor heated swimming pool, 2 hot tubs, and tables and chairs. Just off the pool enclosure is a large sundeck with lounge furniture and an outdoor hot tub. Don&#39;t forget to check out the pool table/ game room, locker rooms, children&#39;s area, flat screen TV, computer station with free WiFi &amp; a printer. The picnic area with BBQ grills, horseshoes &amp; volley ball is a great place for get-togethers with family and friends. The Fraser River flows right past the complex, so during the summer months, grab a fishing license and fill your days with fly fishing or bike rides along the river. Meadow Trail begins just beyond the Rec Center and offers access to miles and miles of hiking, biking, x-country skiing and snow shoeing trails.<br />\n<br />\nConveniently located in downtown Winter Park, quaint shops, restaurants (Pepe Osaka&#39;s Fish Taco and Hernando&rsquo;s Pizza Pub are local favorites), a movie theater, bowling and more are all just a short walk away. Situated on Winter Park Resort&rsquo;s bus route, the free shuttle will whisk you to the slopes in no time!<br />\n<br />\nThis newly remodeled condo&#39;s combination of cozy d&eacute;cor, a quiet mountain setting, popular recreation center amenities and a convenient downtown location makes it the perfect choice for your next mountain retreat.<br />\n<br />\nSleeping Arrangements: Sleeps up to 4<br />\nQueen bed in bedroom with brand new mattress, bedding &amp; linens<br />\nQueen pull-out sleeper sofa in the living room.', 'Amenities:<br />\n*Charming Remodel<br />\n*Free Wireless Internet (Rec Center)<br />\n*Wood Burning Fireplace<br />\n*On Free Shuttle Route<br />\n*Fully Equipped Kitchen<br />\n-Cable TV<br />\n-Brand new Rec Center Clubhouse with indoor pool , three hot tubs, pool table, laundry facilities &amp; more<br />\n<br />\nLocation: Walking Distance to Downtown Shops &amp; Restaurants.<br />\nApprox Two miles from Winter Park Resort<br />\n<br />\nNO SMOKING &amp; NO PETS', '<strong>NIGHTLY RATES: 2016 - 2017</strong><br />\n<br />\n<strong>Fall Value Days 2016 (Sep 12 - Nov 6, 2016):</strong><br />\nFrom $65/night (2 night minimum stay)<br />\n<br />\n<strong>Opening Days 2016 (Nov 7 - Nov 20, 2016):</strong><br />\nFrom $75/night (2 night minimum stay)<br />\n<br />\n<strong>Thanksgiving 2016 (Nov 21 - Nov 27, 2016):</strong><br />\nFrom $125/night (4 night minimum stay)<br />\n<br />\n<strong>Early Ski Season 2016 (Nov 28 - Dec 08, 2016):</strong><br />\nFrom $90/night (2 night minimum stay)<br />\n<br />\n<strong>Winter Holiday Begins 2016 (Dec 09 - Dec 18, 2016):</strong><br />\nFrom $150/night (2 night minimum stay)<br />\n<br />\n<strong>Christmas Week 2016 (Dec 19 - Dec 25, 2016):</strong><br />\nFrom $225/night (5 night minimum stay)<br />\n<br />\n<strong>Christmas - New Year 2016/17 (Dec 26 - Jan 3, 2017):</strong><br />\nFrom $225/night (5 night minimum stay)<br />\n<br />\n<strong>Powder Ski Season Begins 2017 (Jan 4 - Jan 11, 2017):</strong><br />\nFrom $110/night (2 night minimum stay)<br />\n<br />\n<strong>MLK Week 2017 (Jan 12 - Jan 15, 2017):</strong><br />\nFrom $125/night (3 night minimum stay)<br />\n<br />\n<strong>Powder Season Cont.&#39;s 2017 (Jan 16 - Feb 12, 2017):</strong><br />\nFrom $175/night (2 night minimum stay)<br />\n<br />\n<strong>Valentines &amp; Presidents 2017 (Feb 13 - Feb 20, 2017):</strong><br />\nFrom $225/night (3 night minimum stay)<br />\n<br />\n<strong>Powder Season Cont.&#39;s 2017 (Feb 21 - Mar 2, 2017):</strong><br />\nFrom $115/night (2 night minimum stay)<br />\n<br />\n<strong>Spring Break Prime Ski 2017 (Mar 3 - Mar 26, 2017):</strong><br />\nFrom $250/night (5 night minimum stay)<br />\n<br />\n<strong>Late Spring Break 2017 (Mar 27 - Apr 09, 2017):</strong><br />\nFrom $175/night (3 night minimum stay)<br />\n<br />\n<strong>Easter 2017 (Apr 10 - Apr 16, 2017):</strong><br />\nFrom $115/night (2 night minimum stay)<br />\n<br />\n<strong>Spring Sunshine Skiing 2017 (Apr 17 - Apr 23, 2017):</strong><br />\nFrom $100/night (2 night minimum stay)<br />\n<br />\n<strong>Spring Value Days 2017 (Apr 24- May 24, 2017):</strong><br />\nFrom $75/night (2 night minimum stay)<br />\n<br />\n<strong>Memorial Day Weekend 2017 (May 26 - May 29, 2017):</strong><br />\nFrom $100/night (2 night minimum stay)<br />\n<br />\n<strong>Summer Value Days 2017 (May 30 - Jun 14, 2017):</strong><br />\nFrom $90/night (2 night minimum stay)<br />\n<br />\n<strong>Summer Begins 2017 (June 15 - Jun 29, 2017):</strong><br />\nFrom $100/night (2 night minimum stay)<br />\n<br />\n<strong>4th of July 2017 (June 30 - Jul 09, 2017):</strong><br />\nFrom $135/night (2 night minimum stay)<br />\n<br />\n<br />\n<strong>Standard Rate:</strong><br />\nFrom $100/night (2 night minimum stay)<br />\n<br />\n<strong>Fees:</strong><br />\nAWP Fee: $55<br />\nCleaning Fee: $100<br />\nLodging Tax: 10.9%', 'bad96fa8ffd7465', NULL);
